(18, 1, '2020-04-30 10:43:29', '2020-04-30 08:43:29', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>Young Men\'s Christian Association</em> (YMCA) joue un grand r√¥le dans la diffusion du basketball √† travers les √âtats-Unis et le Canada, mais aussi dans le reste du monde. Le premier match europ√©en est disput√© en 1893 √† Paris, dans le quartier de Montmartre. √Ä la m√™me √©poque, des matchs sont organis√©s √† Tianjin (Chine), en Inde, au Japon et en Perse. D√®s 1895, le sport est pratiqu√© dans plusieurs lyc√©es de jeunes filles. Toutefois, la YMCA ne parvient pas √† pr√©server l\'esprit originel du basketball, qui devient de plus en plus violent et est pratiqu√© par des bandes de jeunes bagarreurs. Pour permettre le respect des r√®gles de jeu, la premi√®re ligue professionnelle, la <em>National Basketball League</em>, est fond√©e aux √âtats-Unis en 1898 avec six √©quipes. Les premiers champions sont les <em>Trenton Nationals</em>, suivis des <em>New York Wanderers</em>, des <em>Bristol Pile Drivers</em> et des <em>Camden Electrics</em>. La ligue est dissoute en 1904. De nombreux championnats sont alors organis√©s.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout d√©but du <abbr title=\"20·µâ si√®cle\">XX<sup>e</sup></abbr>¬†si√®cle, le basketball devient peu √† peu une activit√© courante dans de nombreuses universit√©s am√©ricaines, notamment gr√¢ce √† l\'action de James Naismith. Le premier match interuniversitaire est disput√© le 9 f√©vrier 1895 entre l\'universit√© Hamline et l\'√©cole d\'agriculture de l\'universit√© du Minnesota¬†; cette derni√®re remporte le match sur le score de 9 points √† 3. La premi√®re √©quipe universitaire est fond√©e en 1896 au <em>Geneva College</em> de Pittsburgh. Naismith lui-m√™me entra√Æne pendant six ans l\'√©quipe de l\'universit√© du Kansas, avant de laisser la place √† Phog Allen. Amos Alonzo Stagg introduit le basketball √† l\'universit√© de Chicago tandis qu\'Adolph Rupp, un ancien √©l√®ve de Naismith, conna√Æt le succ√®s en tant qu\'entra√Æneur de l\'universit√© du Kentucky.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">D√®s 1897, l\'<em>Amateur Athletic Union</em> prend le contr√¥le de la gestion du basketball √† la YMCA. En 1901, de nombreuses universit√©s commencent √† financer des matchs, dont l\'universit√© de Chicago, Columbia, le Dartmouth College, l\'universit√© du Minnesota, l\'Acad√©mie navale d\'Annapolis, l\'universit√© du Colorado et Yale. Le premier match universitaire au Canada a lieu le 6 f√©vrier 1904 et oppose l\'universit√© McGill √† l\'universit√© Queen\'s. En avril 1905, des repr√©sentants de quinze universit√©s cr√©ent le <em>Basket Ball Rule Committee</em> (<q>Comit√© de r√®glementation du basket-ball</q>) afin de superviser le basketball universitaire. La m√™me ann√©e, sur la suggestion du pr√©sident Theodore Roosevelt qui estimait que les blessures √©taient trop fr√©quentes dans le football am√©ricain, se forme l‚Äô<em>Intercollegiate Athletic Association</em>. Elle absorbe le comit√© en 1909, et devient en 1910 la NCAA - la principale f√©d√©ration am√©ricaine de sport universitaire actuelle.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu avant le d√©but de la Premi√®re Guerre mondiale, la NCAA et l‚Äô<em>Amateur Athletic Union</em> se disputent ainsi le contr√¥le des r√®gles</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">du jeu. Apr√®s l\'entr√©e en guerre des √âtats-Unis en 1917, les forces arm√©es am√©ricaines contribuent √† la diffusion du basketball sur le continent europ√©en¬†: plusieurs entra√Æneurs sportifs √©taient pr√©sents aux c√¥t√©s des troupes. Naismith a lui-m√™me pass√© deux ans en France avec la YMCA √† cette √©poque.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":19,\"width\":810,\"height\":642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Kansas_U_team_1899.jpg\" alt=\"\" class=\"wp-image-19\" width=\"810\" height=\"642\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'√©quipe de l\'universit√© du Kansas en 1899, avec leur entra√Æneur James Naismith (rang du haut, √† droite).</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'D√©veloppement aux √âtats-Unis et au Canada', '', 'publish', 'open', 'open', '', 'developpement-aux-etats-unis-et-au-canada', '', '', '2020-04-30 14:45:02', '2020-04-30 12:45:02', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?p=18', 0, 'post', '', 0),
