c√®s en tant qu\'entra√Æneur de l\'universit√© du Kentucky.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>D√®s 1897, l\'<em>Amateur Athletic Union</em> prend le contr√¥le de la gestion du basketball √† la YMCA. En 1901, de nombreuses universit√©s commencent √† financer des matchs, dont l\'universit√© de Chicago, Columbia, le Dartmouth College, l\'universit√© du Minnesota, l\'Acad√©mie navale d\'Annapolis, l\'universit√© du Colorado et Yale. Le premier match universitaire au Canada a lieu le 6 f√©vrier 1904 et oppose l\'universit√© McGill √† l\'universit√© Queen\'s. En avril 1905, des repr√©sentants de quinze universit√©s cr√©ent le <em>Basket Ball Rule Committee</em> (<q>Comit√© de r√®glementation du basket-ball</q>) afin de superviser le basketball universitaire. La m√™me ann√©e, sur la suggestion du pr√©sident Theodore Roosevelt qui estimait que les blessures √©taient trop fr√©quentes dans le football am√©ricain, se forme l‚Äô<em>Intercollegiate Athletic Association</em>. Elle absorbe le comit√© en 1909, et devient en 1910 la NCAA - la principale f√©d√©ration am√©ricaine de sport universitaire actuelle.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Peu avant le d√©but de la Premi√®re Guerre mondiale, la NCAA et l‚Äô<em>Amateur Athletic Union</em> se disputent ainsi le contr√¥le des r√®gles du jeu. Apr√®s l\'entr√©e en guerre des √âtats-Unis en 1917, les forces arm√©es am√©ricaines contribuent √† la diffusion du basketball sur le continent europ√©en¬†: plusieurs entra√Æneurs sportifs √©taient pr√©sents aux c√¥t√©s des troupes. Naismith a lui-m√™me pass√© deux ans en France avec la YMCA √† cette √©poque.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":19,\"width\":810,\"height\":642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Kansas_U_team_1899.jpg\" alt=\"\" class=\"wp-image-19\" width=\"810\" height=\"642\"/><fig