t √† fleurir au sein de l‚Äô√©cosyst√®me WordPress. L‚Äô√©quipe de traduction de WordPress en fran√ßais a d√©cid√© de lancer son [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8293:\"\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-1024x579.jpg\" alt=\"\" class=\"wp-image-1587\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-1024x579.jpg 1024w, https://fr.wordpress.org/files/2020/04/wptd-2020-300x170.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-768x435.jpg 768w, https://fr.wordpress.org/files/2020/04/wptd-2020-1536x869.jpg 1536w, https://fr.wordpress.org/files/2020/04/wptd-2020.jpg 1953w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure>\n\n\n\n<p>En raison des circonstances actuelles, de nombreux WordCamps ont √©t√© annul√©s ou report√©s √† l‚Äôautomne, comme par exemple le WordCamp Paris qui devait se tenir vendredi prochain. Mais la communaut√© s‚Äôorganise‚Ä¶ plusieurs √©v√®nements en ligne commencent √† fleurir au sein de l‚Äô√©cosyst√®me WordPress.</p>\n\n\n\n<p>L‚Äô√©quipe de traduction de WordPress en fran√ßais a d√©cid√© de lancer son premier WordPress Translation Day FR, et il aura lieu le vendredi 17 avril 2020 √† partir de 13h&nbsp;!</p>\n\n\n\n<h2>Comment participer</h2>\n\n\n\n<p>L‚Äô√©v√®nement se d√©roulera en visioconf√©rence sur le logiciel Zoom. Vous pouvez d√©j√† vous y inscrire gratuitement&nbsp;:</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link has-text-color has-background\" href=\"https://zoom.us/meeting/register/vJQodeqhqjsopEDTK3ILgH2gYgFoDGQtdQ\" style=\"background-color:#1d7ab0;color:#ffffff;border-radius:7px\" target=\"_blank\" rel=\"noreferrer noopener\">S‚Äôinscrire au WP Translation Day FR</a></div>\n</div>\n\n\n\n<p>Afin de coordonner nos actions nous vous demandons aussi de rejoindre le Slack WordPress FR. Pour vous inscrire gratuitement, si ce n‚Äôest d√©j√† fait, <a href=\"https://wpfr.net/slack\">il vous suffit de remplir ce formulaire</a>. Vous recevrez alors une invitation par e-mail. Nous vous attendons dans le canal <em>#wptranslationday</em>&nbsp;!</p>\n\n\n\n<span id=\"more-1576\"></span>\n\n\n\n<h2>Le WordPress Translation Day FR, qu‚Äôest-ce que c‚Äôest&nbsp;?</h2>\n\n\n\n<p>Habituellement, un <em>WordPress Translation Day</em>, ce sont 24 heures pendant lesquelles les diff√©rentes √©quipes de traduction de chaque langue contribuent ensemble √† la traduction de l‚Äô√©cosyst√®me&nbsp;: c≈ìur WordPress, extensions, th√®mes, ainsi que tous les sites WordPress.org. Cela se d√©roule sur 24 heures et sur tous les fuseaux horaires, avec des conf√©rences donn√©es en direct dans toutes les langues.</p>\n\n\n\n<p>Le 17 avril prochain, nous vous proposerons une version all√©g√©e du <em>WordPress Translation Day</em> mondial. Il s‚Äôagira de contribuer ensemble √† la traduction de WordPress, pendant une demi-journ√©e (vendredi apr√®s-midi √† partir de 13h), en visioconf√©rence.</p>\n\n\n\n<h2>Pourquoi participer √† cet √©v√®nement</h2>\n\n\n\n<p>WordPress est un projet open source que nous sommes nombreuses et nombreux √† utiliser. Qui dit open source dit contribution. Il y a diff√©rentes mani√®res de contribuer au projet WordPress : entre autres, en am√©liorant le c≈ìur du CMS, en organisant des √©v√®nements (meetups, WordCamps) mais aussi en traduisant WordPress lui-m√™me, ses extensions, ses th√®mes ou encore sa documentation. Alors vous aussi contribuez !</p>\n\n\n\n<p>L‚Äô√©quipe de traduction de WordPress en fran√ßais sera ravie de vous accueillir. Pour en savoir plus sur son organisation, n‚Äôh√©sitez pas √† consulter le <a href=\"https://fr.wordpress.org/team/handbook\">guide d√©di√©</a> ou encore <a href=\"https://fr.wordpress.org/team\">le blog officiel de l‚Äô√©quipe</a>.</p>\n\n\n\n<h2>Le programme</h2>\n\n\n\n<p>C‚Äôest tr√®s simple&nbsp;: rendez-vous √† partir de 13 heures sur la conf√©rence Zoom. Si vous ne pouvez pas vous lib√©rer d√®s 13 heures, n‚Äôh√©sitez pas √† nous rejoindre en cours de route&nbsp;!</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link has-text-color has-background\" href=\"https://zoom.us/meeting/register/vJQodeqhqjsopEDTK3ILgH2gYgFoDGQtdQ\" style=\"background-color:#1d7ab0;color:#ffffff;border-radius:7px\" target=\"_blank\" rel=\"noreferrer noopener\">S‚Äôinscrire √† la visio-conf√©rence Zoom</a></div>\n</div>\n\n\n\n<p>Apr√®s une petite introduction de la part des responsables de la traduction de WordPress, chacun pourra contribuer √† la traduction des extensions ou des th√®mes de son choix. Nous vous pr√©senterons √©galement le travail en cours sur la traduction de la documentation de WordPress en fran√ßais.</p>\n\n\n\n<h2>Faites passer l‚Äôinfo¬†!</h2>\n\n\n\n<p><a href=\"https://fr.wordpress.org/files/2020/04/communique-presse-wptranslationday-fr.pdf\">Communiqu√© de presse version PDF</a></p>\n\n\n\n<p>Banni√®re grand format¬†:</p>\n\n\n\n<ul><li><a href=\"https://fr.wordpress.org/files/2020/04/wptd-2020.jpg\" target=\"_blank\" rel=\"noreferrer noopener\">T√©l√©charger la banni√®re</a></li><li>Code d&rsquo;int√©gration HTML</li></ul>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/files/2020/04/wptd-2020.jpg\" alt=\"WordPress Translation Day FR, le 17 avril √† partir de 13h\" /&gt;&lt;/a&gt;</pre>\n\n\n\n<p>Badges pour site web :</p>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:30%\">\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator.jpg\" alt=\"\" class=\"wp-image-1585\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator.jpg 400w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator-300x300.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator-150x150.jpg 150w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></figure>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<p>Code d&rsquo;int√©gration HTML¬†:</p>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator.jpg\" alt=\"WordPress Translation Day FR, le 17 avril √† partir de 13h\" /&gt;&lt;/a&gt;</pre>\n</div>\n</div>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:30%\">\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga.jpg\" alt=\"\" class=\"wp-image-1583\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga.jpg 545w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga-300x300.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga-150x150.jpg 150w\" sizes=\"(max-width: 545px) 100vw, 545px\" /></figure>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<p>Code d&rsquo;int√©gration HTML¬†:</p>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/f