\"https://wordpress.org/news/files/2020/03/textcolor.mp4\";s:6:\"length\";s:6:\"440616\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:56032:\"\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/03/adderley.png\" alt=\"\" class=\"wp-image-1552\" srcset=\"https://fr.wordpress.org/files/2020/03/adderley.png 768w, https://fr.wordpress.org/files/2020/03/adderley-300x300.png 300w, https://fr.wordpress.org/files/2020/03/adderley-150x150.png 150w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\">\n<p style=\"background-color:#216bce;color:#ffffff\" class=\"has-text-color has-background has-normal-font-size\"><strong>Construisez davantage avec les blocs. Plus vite et plus facilement.</strong><br><br>Nous vous proposons une meilleure exp√©rience d‚Äôadministration de contenus web avec l‚Äô√©diteur am√©lior√© de <strong>WordPress 5.4</strong>.<br><br>Nomm√©e <em><strong>¬´&nbsp;Adderley&nbsp;¬ª</strong></em> en l‚Äôhonneur du cornettiste de jazz Nat Adderley, la derni√®re version de WordPress est maintenant disponible en t√©l√©chargement.</p>\n</div></div>\n\n\n\n<span id=\"more-1551\"></span>\n\n\n\n<p>Chaque version majeure am√©liore l‚Äô√©diteur de blocs. Pour WordPress 5.4 nous avons fait <em>plus</em> fort&nbsp;:</p>\n\n\n\n<ul><li>Plus de moyens de donner vie aux articles et aux pages avec vos meilleures images</li><li>Plus de moyens d‚Äôattirer et de fid√©liser vos visiteurs gr√¢ce √† la richesse des m√©dias int√©gr√©s depuis les principaux services du web</li><li>Plus de moyens de concr√©tiser votre vision de votre site web et de concevoir vos blocs √† l‚Äôendroit id√©al &#8211; et cela m√™me si un type de bloc particulier est nouveau pour vous</li><li>Des processus plus efficaces</li><li>Plus de vitesse partout, de sorte que lorsque vous construisez des sections ou des galeries, ou que vous r√©digez simplement une ligne de po√©sie, vous pourrez ressentir √† quel point votre travail s‚Äôacc√©l√®re</li></ul>\n\n\n\n<p>Plus, plus plus‚Ä¶ Du positif dont nous avons tous besoin en ces temps compliqu√©s.</p>\n\n\n\n<p style=\"color:#000000\" class=\"has-text-color has-background has-very-light-gray-background-color\">Malgr√© les difficult√©s actuelles, la sortie de la version 5.4 de WordPress (et de sa traduction en fran√ßais) a pu √™tre maintenue gr√¢ce √† l&rsquo;investissement de milliers de contributeurs √† travers le monde, que cela concerne le d√©veloppement de WordPress 5.4 ou les contributrices et contributeurs ayant traduit WordPress en fran√ßais <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f499.png\" alt=\"üíô\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><br><br>Nous les remercierons en bas de cet article. En attendant, place aux √©volutions majeures de WordPress 5.4&nbsp;!</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/Squares.jpg\" alt=\"\" class=\"wp-image-1553\" srcset=\"https://fr.wordpress.org/files/2020/04/Squares.jpg 768w, https://fr.wordpress.org/files/2020/04/Squares-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>Deux nouveaux blocs et des am√©liorations sur tous les blocs existants</h2>\n\n\n\n<ul><li>Deux blocs tout neufs¬†: Les liens sociaux et les boutons rendent rapide et facile l‚Äôajout de fonctionnalit√©s interactives.</li><li>De nouvelles fa√ßons d&rsquo;utiliser la couleur : D√©grad√©s dans les blocs des boutons et de couverture, acc√®s par la barre d‚Äôoutils aux options de couleur dans les blocs de texte enrichi, et pour la premi√®re fois, options de couleur dans les blocs de groupe et de colonnes.</li><li>La version 5.4 rationalise l&rsquo;ensemble du processus de placement et de remplacement de m√©dia dans chaque bloc. Elle fonctionne d√©sormais de la m√™me mani√®re dans presque tous les blocs¬†!</li><li>Le bloc M√©dia + Texte permet maintenant de lier un document joint disponible en t√©l√©chargement.</li></ul>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2020/03/textcolor.mp4\"></video></figure>\n\n\n\n<h2>Une interface et une navigation plus claires, et plus facile √† utiliser au clavier</h2>\n\n\n\n<ul><li>Une navigation dans les blocs plus claire via le navigateur de l‚Äô√©diteur, et une s√©lection plus facile des blocs.</li><li>Pour quand vous avez besoin de naviguer avec le clavier, mieux tabuler et vous concentrer. De plus, vous pouvez tabuler sur la colonne lat√©rale de presque tous les blocs.</li><li>Et en vitesse&nbsp;! Le chargement de l‚Äô√©diteur est 14&nbsp;% plus rapide et le temps d‚Äôattente avant la saisie est 51&nbsp;% moins long&nbsp;!</li><li>Les astuces ont disparu. √Ä leur place, une fen√™tre de guide de bienvenue s‚Äôaffiche lorsque vous en avez besoin et uniquement lorsque vous en avez besoin.</li><li>Sachez en un coup d‚Äô≈ìil si vous √™tes en mode modification de bloc ou navigation. Ou bien, si vous avez une vision limit√©e, votre lecteur d‚Äô√©cran vous indiquera dans quel mode vous √™tes.</li></ul>\n\n\n\n<p>Bien entendu, si vous souhaitez travailler avec les derniers outils et fonctionnalit√©s, installez l‚Äô<a href=\"https://wordpress.org/plugins/gutenberg/\">extension Gutenberg</a>. Vous serez la premi√®re personne √† utiliser les nouvelles fonctionnalit√©s excitantes de l&rsquo;√©diteur de blocs, avant que quiconque ne les ait vues.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/Rectangles-and-circles.jpg\" alt=\"\" class=\"wp-image-1554\" srcset=\"https://fr.wordpress.org/files/2020/04/Rectangles-and-circles.jpg 768w, https://fr.wordpress.org/files/2020/04/Rectangles-and-circles-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>Votre droit fondamental&nbsp;: la confidentialit√©</h2>\n\n\n\n<p>5.4 aide √† r√©soudre divers probl√®mes de protection de la vie priv√©e dans le monde. Ainsi, lorsque les utilisateurs et les parties prenantes posent des questions sur le respect de la r√©glementation ou sur la mani√®re dont votre √©quipe traite les donn√©es des utilisateurs, il devrait √™tre beaucoup plus facile d&rsquo;obtenir des r√©ponses correctes.</p>\n\n\n\n<p>Voici quelques am√©liorations notables&nbsp;:</p>\n\n\n\n<ul><li>D√©sormais, les exportations de donn√©es personnelles comprennent les informations sur les sessions des utilisateurs et les donn√©es de localisation des utilisateurs √† partir du widget des √©v√©nements communautaires. Plus, une table des mati√®res !</li><li>Suivez l‚Äô√©volution du traitement des demandes d‚Äôexportation et d‚Äôeffacement gr√¢ce aux outils de protection de confidentialit√©.</li><li>De plus, de petites am√©liorations ont √©t√© apport√©es aux outils de confidentialit√© pour leur donner un aspect plus net. Vos yeux vous remercieront&nbsp;!</li></ul>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/Mixed.jpg\" alt=\"\" class=\"wp-image-1555\" srcset=\"https://fr.wordpress.org/files/2020/04/Mixed.jpg 768w, https://fr.wordpress.org/files/2020/04/Mixed-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>Pour les d√©veloppeuses et les d√©veloppeurs</h2>\n\n\n\n<h3>Ajout de champs personnalis√©s aux √©l√©ments de menu &#8211; nativement</h3>\n\n\n\n<p>Deux nouvelles actions vous permettent d‚Äôajouter des champs personnalis√©s aux menus ‚Äì sans extension et sans utiliser de ¬´&nbsp;walkers&nbsp;¬ª personnalis√©s.</p>\n\n\n\n<p>Sur l‚Äô√©cran d‚Äôadministration des menus, l‚Äôaction&nbsp;<code>wp_nav_menu_item_custom_fields</code>&nbsp;se d√©clenche juste avant les boutons de d√©placement des √©l√©ments du menu de navigation.</p>\n\n\n\n<p>Dans l‚Äôoutil de personnalisation,&nbsp;<code>wp_nav_menu_item_custom_fields_customize_template</code>&nbsp;se d√©clenche √† la fin du mod√®le contenant les champs de formulaire de gestion du menu.</p>\n\n\n\n<p>V√©rifiez votre code et voyez o√π ces nouvelles actions peuvent remplacer votre code personnalis√©, et si vous √™tes pr√©occup√© par la duplication, ajoutez une v√©rification pour la version de WordPress.</p>\n\n\n\n<h3>Concernant les blocs&nbsp;: une mise en forme plus facile, de nouvelles APIs et contenus embarqu√©s</h3>\n\n\n\n<ul><li>La mise en forme des blocs est&nbsp;<strong>radicalement</strong>&nbsp;simplifi√©e. Fini les marges externes n√©gatives et les marges internes par d√©faut&nbsp;! Vous pouvez maintenant mettre en forme les blocs comme vous le souhaitez. De plus, une refactorisation du code g√©n√©r√© nous a permis de supprimer plusieurs divs d‚Äôencapsulation redondantes.</li><li>Si vous cr√©ez des extensions, vous pouvez maintenant enregistrer des collections de vos blocs avec des espaces de noms tranversaux aux cat√©gories. Une bonne fa√ßon de donner de la visibilit√© √† votre marque.</li><li>Laissez les utilisateurs en faire plus avec deux nouvelles APIs&nbsp;: variations de bloc et d√©grad√©s.</li><li>Dans les contenus embarqu√©s, l‚Äô√©diteur de bloc prend maintenant en charge TikTok et CollegeHumor a √©t√© retir√©.</li></ul>\n\n\n\n<p>Il y a bien d‚Äôautres choses faites pour les d√©veloppeuses et les d√©veloppeurs dans WordPress 5.4. Pour en d√©couvrir davantage et apprendre √† tirer parti de ces modifications pour vos sites, vos th√®mes ou vos extensions, consultez le&nbsp;guide technique de WordPress 5.4&nbsp;:</p>\n\n\n\n<figure 