√©rience d‚Äôadministration de WordPress.</p>\n\n\n\n<p>En tant que d√©veloppeuse ou d√©veloppeur, WordPress 5.4 apportera&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=enhancement&amp;type=feature+request&amp;milestone=5.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">122</a>&nbsp;am√©liorations et nouvelles fonctionnalit√©s et <a href=\"https://core.trac.wordpress.org/query?type=defect+(bug)&amp;milestone=5.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">210</a>&nbsp;correctifs. Bien entendu, tout cela induit des changements de code dans le c≈ìur du CMS, ce qui pourrait vous demander d‚Äôeffectuer des modifications dans le code de votre site, de vos th√®mes ou de vos extensions.</p>\n\n\n\n<p>Dans cet article, nous nous concentrerons justement sur les changements techniques majeurs de cette nouvelle version.</p>\n\n\n\n<span id=\"more-1536\"></span>\n\n\n\n<h2>Accessibilit√©</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~accessibility&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=keywords&amp;order=priority\">14 modifications</a>&nbsp;li√©es √† l‚Äôaccessibilit√© dans WP 5.4, notons particuli√®rement des modifications sur l&rsquo;ordre de chargement de la barre d&rsquo;administration dans le DOM, sur les widgets Calendrier et Derniers commentaires, sur l&rsquo;√©cran de gestion des Menus, et des correctifs de bugs report√©s par l‚Äôaudit d‚Äôaccessibilit√© effectu√© l&rsquo;ann√©e derni√®re par <a href=\"https://wpcampus.org/audit/\">WPCampus</a>.</p>\n\n\n\n<h2>√âditeur / Gutenberg</h2>\n\n\n\n<p>Le d√©veloppement de l&rsquo;√©diteur a continu√© son d√©veloppement rapide depuis la version 5.0 de WordPress. Aujourd&rsquo;hui, la version 7.5 de Gutenberg a √©t√© int√©gr√©e dans WordPress 5.4, ce qui fait 10 versions de Gutenberg de diff√©rence avec la version qui avait √©t√© int√©gr√©e dans WordPress 5.3 en novembre dernier¬†! WordPress 5.4 comprend donc les versions¬†<a href=\"https://make.wordpress.org/core/2019/10/02/whats-new-in-gutenberg-2-october/\">6.6</a>,¬†<a href=\"https://make.wordpress.org/core/2019/10/16/whats-new-in-gutenberg-16-october/\">6.7</a>,¬†<a href=\"https://make.wordpress.org/core/2019/10/30/whats-new-in-gutenberg-30-october/\">6.8</a>,¬†<a href=\"https://make.wordpress.org/core/2019/11/13/whats-new-in-gutenberg-13-november/\">6.9</a>,¬†<a href=\"https://make.wordpress.org/core/2019/11/27/whats-new-in-gutenberg-27-november/\">7.0</a>,¬†<a href=\"https://make.wordpress.org/core/2019/12/11/whats-new-in-gutenberg-11-december/\">7.1</a>,¬†<a href=\"https://make.wordpress.org/core/2020/01/09/whats-new-in-gutenberg-8-january/\">7.2</a>,¬†<a href=\"https://make.wordpress.org/core/2020/01/22/whats-new-in-gutenberg-22-january/\">7.3</a>,¬†<a href=\"https://make.wordpress.org/core/2020/02/05/whats-new-in-gutenberg-5-february/\">7.4</a>¬† et¬†<a href=\"https://make.wordpress.org/core/2020/02/12/whats-new-in-gutenberg-12-february/\">7.5</a> de Gutenberg, et m√™me des correctifs et am√©liorations de performances de la version¬†<a href=\"https://make.wordpress.org/core/2020/02/26/whats-new-in-gutenberg-26-february/\">7.6</a> qui ont trouv√© le moyen de se glisser discr√®tement dans WP 5.4¬†! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60e.png\" alt=\"üòé\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>L‚Äôarticle¬†<a href=\"https://wordpress.org/news/2020/02/wordpress-5-4-beta-1/\">WordPress 5.4 Beta 1 (en anglais)</a>¬†met en avant plusieurs des nouvelles fonctionnalit√©s de l&rsquo;√©diteur. Notons particuli√®rement que depuis WordPress 5.3, une r√©duction impressionnante du temps de chargement de l&rsquo;√©diteur de 14¬†% a √©t√© rendue possible, et surtout une r√©duction du temps √† attendre avant de pouvoir saisir du contenu de l&rsquo;ordre de 51¬†%¬†!</p>\n\n\n\n<p>Ci-dessous, vous trouverez des liens vers des notes pour les d√©veloppeur¬∑euse¬∑s, en anglais. Il s&rsquo;agit de changements concernant&nbsp;:</p>\n\n\n\n<h3>L&rsquo;ajout de deux nouveaux blocs&nbsp;: r√©seaux sociaux et ensemble de boutons</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"2NTN582pDm\"><a href=\"https://make.wordpress.org/core/2020/02/27/new-or-updated-blocks-in-wordpress-5-4/\">New Blocks in WordPress 5.4</a></blockquote><iframe title=\"&#8220;New Blocks in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/27/new-or-updated-blocks-in-wordpress-5-4/embed/#?secret=2NTN582pDm\" data-secret=\"2NTN582pDm\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Une mise √† jour du composant <code>button</code></h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"mk8tJvOZto\"><a href=\"https://make.wordpress.org/core/2020/02/13/an-updated-button-component-in-wordpress-5-4/\">An updated Button component in WordPress 5.4</a></blockquote><iframe title=\"&#8220;An updated Button component in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/13/an-updated-button-component-in-wordpress-5-4/embed/#?secre