quo;√©diteur</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"EhdivLKc1s\"><a href=\"https://make.wordpress.org/core/2020/03/02/markup-and-style-related-changes/\">Markup and style-related changes</a></blockquote><iframe title=\"&#8220;Markup and style-related changes&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/markup-and-style-related-changes/embed/#?secret=EhdivLKc1s\" data-secret=\"EhdivLKc1s\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Les mises √† jour g√©n√©rales de l‚ÄôAPI de l&rsquo;√©diteur</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"cQnR3xLr1V\"><a href=\"https://make.wordpress.org/core/2020/03/02/general-block-editor-api-updates/\">General Block Editor API Updates</a></blockquote><iframe title=\"&#8220;General Block Editor API Updates&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/general-block-editor-api-updates/embed/#?secret=cQnR3xLr1V\" data-secret=\"cQnR3xLr1V\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>L‚Äôoutil de personnalisation (Customizer)</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Customize&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=owner&amp;col=type&amp;col=priority&amp;col=milestone&amp;order=priority\">14 modifications</a>¬†de l‚Äôoutil de personnalisation (appel√© Customizer en anglais), notons principalement que WordPress 5.4 va grandement am√©liorer l‚Äôaccessibilit√© des √©l√©ments s√©lectionnables (√©tat <code>focus</code> notamment) dans la lign√©e des nombreuses am√©liorations d√©j√† approt√©es par WordPress 5.3. Notons √©galement l&rsquo;ajout de documentation concernant les fonctions et crochets (en anglais ¬´¬†hooks¬†¬ª, il s&rsquo;agit des actions et filtres disponibles dans l&rsquo;API WordPress) existants, la suppression de la balise meta¬†<code>apple-touch-icon-precomposed</code>¬†qui est maintenant d√©pr√©ci√©e, et l&rsquo;am√©lioration de la logique de s√©lection d&rsquo;√©l√©ments de menus.</p>\n\n\n\n<p>Veuillez noter que certaines classes PHP inutilis√©es par le c≈ìur WordPress sont maintenant formellement d√©pr√©ci√©es et ne devront donc plus √™tre utilis√©es&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"xZtLy14mXx\"><a href=\"https://make.wordpress.org/core/2020/02/12/formal-deprecation-of-some-unused-customizer-classes-in-wordpress-5-4/\">Formal deprecation of some unused Customizer classes in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Formal deprecation of some unused Customizer classes in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/12/formal-deprecation-of-some-unused-customizer-classes-in-wordpress-5-4/embed/#?secret=xZtLy14mXx\" data-secret=\"xZtLy14mXx\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Menus</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Menus&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">5 modifications</a>&nbsp;concernant le composant Menus, il convient de noter que WordPress 5.4 am√©liore l&rsquo;accessibilit√© au clavier du panneau de s√©lection des √©l√©ments qui iront dans vos menus, et que des am√©liorations de l&rsquo;interface ont √©t√© r√©alis√©es.</p>\n\n\n\n<p>Si vos extensions ajoutent des champs personnalis√©s aux √©l√©ments de menus, alors vous pourriez avoir besoin de mettre √† jour votre code afin d‚Äôutiliser le nouveau crochet <code>wp_nav_menu_item_custom_fields</code>:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"nijtmI8vPD\"><a href=\"https://make.wordpress.org/core/2020/02/25/wordpress-5-4-introduces-new-hooks-to-add-custom-fields-to-menu-items/\">New hooks let you add custom fields to menu items</a></blockquote><iframe title=\"&#8220;New hooks let you add custom fields to menu items&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/25/wordpress-5-4-introduces-new-hooks-to-add-custom-fields-to-menu-items/embed/#?secret=nijtmI8vPD\" data-secret=\"nijtmI8vPD\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Confidentialit√© et donn√©es priv√©es</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Privacy&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">15 modifications</a>¬†concernant ce composant de WordPress, voici les changements les plus notables¬†:</p>\n\n\n\n<ul><li>Les exports de donn√©es personnelles incluent maintenant les jetons de session, les emplacements des √©v√®nements communautaires auxquels on s&rsquo;est int√©ress√© dans le tableau de bord, leur localisation et ‚Äì surtout¬†‚Äì les m√©tadonn√©es personnalis√©es des utilisateurs et utilisatrices.</li><li>Les exports de donn√©es personnelles incluent √©galement un fichier JSON et une table des mati√®res.</li><li>De nouveaux filtres sont disponibles pour modifier les en-t√™tes de tous les e-mails relatifs aux donn√©es priv√©es.</li><li>Les tableaux de listing des demandes relatives aux donn√©es priv√©es ont √©t√© am√©lior√©s.</li><li>La fonction <code>wp_get_user_request_data()</code>¬†a √©t√© totalement remplac√©e par la fonction¬†<code>wp_get_user_request()</code>¬†pour une meilleure compr√©hension.</li></ul>\n\n\n\n<p>Toutes ces modifications sont d√©taill√©es dans une seule note de d√©veloppement&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"dAZ0ZV3kAT\"><a href=\"https://make.wordpress.org/core/2020/03/02/privacy-updates-in-5-4/\">Privacy Updates in 5.4</a></blockquote><iframe title=\"&#8220;Privacy Updates in 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/privacy-updates-in-5-4/embed/#?secret=dAZ0ZV3kAT\" data-secret=\"dAZ0ZV3kAT\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Changements concernant l‚ÄôAPI REST</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=REST+API&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">22 modifications</a>&nbsp;li√©es √† l&rsquo;API REST, les points suivants sont particuli√®rement importants&nbsp;:</p>\n\n\n\n<ul><li>WordPress 5.4 prend maintenant en charge la valeur <code>OR</code> du param√®tre <code>relation</code> des requ√™tes de taxonomies</li><li>Ajout de l&#8217;embarquement (embed) s√©lectif de liens</li><li>Modifications de la m√©thode <code style=\"font-size: 16px\">WP_REST_Server</code></li></ul>\n\n\n\n<p>Les modifications importantes de l&rsquo;API REST sont list√©es dans cet article&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"MhTK4AOGpc\"><a href=\"https://make.wordpress.org/core/2020/02/29/rest-api-changes-in-5-4/\">REST API Changes in 5.4</a></blockquote><iframe title=\"&#8220;REST API Changes in 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/29/rest-api-changes-in-5-4/embed/#?secret=MhTK4AOGpc\" data-secret=\"MhTK4AOGpc\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Codes courts / shortcodes</h3>\n\n\n\n<p>WordPress 5.4 va introduire <code>apply_shortcodes()</code> en tant qu&rsquo;alias de <code>do_shortcode()</code>. Les d√©veloppeuses et d√©veloppeurs sont invit√©s √† utiliser la nouvelle fonction. L&rsquo;ancienne restera toutefois conserv√©e pour assurer la r√©tro-compatibilit√©.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"8NM6hMeUZT\"><a href=\"https://make.wordpress.org/core/2020/02/13/wordpress-5-4-introduces-apply-shortcodes-as-an-alias-for-do-shortcode/\">WordPress 5.4 introduces apply_shortcodes() as an alias for do_shortcode()</a></blockquote><iframe title=\"&#8220;WordPress 5.4 introduces apply_shortcodes() as an alias for do_shortcode()&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/13/wordpress-5-4-introduces-apply-shortcodes-as-an-alias-for-do-shortcode/embed/#?secret=8NM6hMeUZT\" data-secret=\"8NM6hMeUZT\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Widgets</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Widgets&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">9 modifications</a>&nbsp;concernant les Widgets, WordPress 5.4 am√©liore l&rsquo;accessibilit√© et l&rsquo;ergonomie de l&rsquo;√©cran de gestion des Widgets et introduit des modifications sur les Widgets Derniers commentaires et Calendrier.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zzVyhi6nOU\"><a href=\"https://make.wordpress.org/core/2020/02/12/changes-related-to-calendar-widget-markup-in-wordpress-5-4/\">Changes related to Calendar Widget markup in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Changes related to Calendar Widget markup in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/12/changes-related-to-calendar-widget-markup-in-wordpress-5-4/embed/#?secret=zzVyhi6nOU\" data-secret=\"zzVyhi6nOU\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres modifications √† destination des d√©veloppeur¬∑euse¬∑s</h2>\n\n\n\n<h3>Simplification de la mise en place d&rsquo;environnements de d√©veloppement en local sur WordPress</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"KBWeyVMK0l\"><a href=\"https://make.wordpress.org/core/2020/03/03/wp-env-simple-local-environments-for-wordpress/\">wp-env: Simple Local Environments for WordPress.</a></blockquote><iframe title=\"&#8220;wp-env: Simple Local Environments for WordPress.&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/03/wp-env-simple-local-environments-for-wordpress/embed/#?secret=KBWeyVMK0l\" data-secret=\"KBWeyVMK0l\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Modification sur le traitement des requ√™tes d&rsquo;affichage de favicons</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"r61Qy7GJml\"><a href=\"https://make.wordpress.org/core/2020/02/19/enhancements-to-favicon-handling-in-wordpress-5-4/\">Enhancements to favicon handling in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Enhancements to favicon handling in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/19/enhancements-to-favicon-handling-in-wordpress-5-4/embed/#?secret=r61Qy7GJml\" data-secret=\"r61Qy7GJml\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Et pour finir, un petit floril√®ge de modifications diverses et vari√©es</h2>\n\n\n\n<p>Un article regroupe √©galement des modifications importantes vari√©es, dont  notamment&nbsp;:</p>\n\n\n\n<ul><li>Une meilleure information sur les erreurs au niveau de¬†<code style=\"font-size: 16px\">wp_login_failed</code></li><li>L&rsquo;ajout de l&rsquo;ID du site dans le filtre multisite¬†<code style=\"font-size: 16px\">newblog_notify_siteadmin</code></li><li>Un nouvel embed vid√©o pour TikTok</li><li>La suppression de l&#8217;embed CollegeHumor</li><li>Le stockage de l&rsquo;URL d&rsquo;origine des m√©dias attach√©s dans la m√©ta¬†<code style=\"font-size: 16px\">_source_url</code>¬†</li><li>Le chargement de la barre d&rsquo;administration en utilisant¬†<code style=\"font-size: 16px\">wp_body_open</code></li><li>La suppression des ID dupliqu√©s dans le widget Derniers commentaires</li><li>Un nouveau param√®tre dans l&rsquo;action <code style=\"font-size: 16px\">lostpassword_post</code>¬†de¬†<code style=\"font-size: 16px\">retrieve_password()</code></li><li>Les en-t√™tes de th√®mes prennent maintenant en charge les instructions  ‚ÄúRequires at least‚Äù et ‚ÄúRequires PHP‚Äù</li><li>La capacit√©¬†<code style=\"font-size: 16px\">delete_posts</code>¬†ne d√©clenchera plus d&rsquo;avertissements PHP pour les types de publications personnalis√©s</li></ul>\n\n\n\n<p>Tout est d√©taill√© en anglais sur cette note de d√©veloppement&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"GTxbJT1rBG\"><a href=\"https://make.wordpress.org/core/2020/02/26/miscellaneous-developer-focused-changes-in-wordpress-5-4/\">Miscellaneous Developer Focused Changes in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Miscellaneous Developer Focused Changes in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/26/miscellaneous-developer-focused-changes-in-wordpress-5-4/embed/#?secret=GTxbJT1rBG\" data-secret=\"GTxbJT1rBG\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.4 est pr√©vue le 31 mars 2020. Vous pouvez d‚Äôores et d√©j√† la tester en version¬†<em>Release Candidate</em>¬†en installant l‚Äôextension officielle WordPress Beta Tester puis en allant dans ses r√©glages et en cochant la case¬†<em>¬´¬†Beta¬†¬ª</em>¬†/ version de d√©veloppement puis en mettant √† jour votre installation de fa√ßon classique.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"iswXokV2Ox\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe title=\"¬´¬†WordPress Beta Tester¬†¬ª &#8212; Plugin Directory\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src