;¬ª en l&rsquo;honneur du multi-instrumentaliste de jazz Rahsaan Roland Kirk, la derni√®re version de WordPress est disponible en t√©l√©chargement.</p>\n\n\n\n<span id=\"more-1493\"></span>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/divider.png\" alt=\"\" class=\"wp-image-1497\" srcset=\"https://fr.wordpress.org/files/2019/11/divider.png 768w, https://fr.wordpress.org/files/2019/11/divider-300x76.png 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<p>5.3 d√©veloppe et affine l‚Äô√©diteur introduit dans WordPress 5.0 avec un nouveau bloc, des interactions plus intuitives et une accessibilit√© am√©lior√©e.</p>\n\n\n\n<p>Les nouvelles fonctionnalit√©s de l‚Äô√©diteur augmentent la libert√© de conception, fournissent des options de mise en page suppl√©mentaires et des variations de styles permettant aux concepteurs de contr√¥ler totalement l‚Äôapparence de leur site. </p>\n\n\n\n<p>Cette version introduit √©galement le th√®me Twenty Twenty, offrant √† l‚Äôutilisateur plus de flexibilit√© de conception et d‚Äôint√©gration avec l&rsquo;√©diteur. Cr√©er de belles pages web et des mises en page avanc√©es n‚Äôa jamais √©t√© aussi simple.</p>\n\n\n\n<h2>Des am√©liorations de l‚Äô√©diteur de blocs et de l&rsquo;ergonomie du back- office</h2>\n\n\n\n<figure class=\"wp-block-video\"><video controls muted src=\"https://wordpress.org/news/files/2019/11/navigation.mp4\"></video></figure>\n\n\n\n<p>Cette mise √† jour focalis√©e sur les am√©liorations introduit plus de 150 nouvelles fonctionnalit√©s et am√©liorations d‚Äôutilisabilit√©, comme la prise en charge des grandes images pour t√©l√©verser les images de haute r√©solution prises avec votre t√©l√©phone ou avec d‚Äôautre appareils de haute r√©solution. En combinaison avec l‚Äôutilisation de tailles d‚Äôimages plus larges, vos photos seront le mieux trait√©es possible.</p>\n\n\n\n<p>Les am√©liorations d‚Äôaccessibilit√© incluent l‚Äôint√©gration des styles de l‚Äô√©diteur dans l‚Äôinterface d‚Äôadministration. Ces am√©liorations corrigent de nombreux probl√®mes d‚Äôaccessibilit√©&nbsp;: contrastes des couleurs sur les champs de formulaires et sur les boutons, coh√©rence entre l‚Äô√©diteur et les √©crans d‚Äôadministration, nouvelles notices affich√©es √† la vol√©e, standardisation du jeu de couleurs par d√©faut de WordPress, et l‚Äôintroduction d‚Äôanimations pour rendre l‚Äôinteraction avec les blocs plus √©l√©gante et naturelle. </p>\n\n\n\n<p>Pour les personnes utilisant un clavier pour naviguer sur l‚Äôadministration, l‚Äô√©diteur dispose maintenant d‚Äôun mode de navigation. Cela permet de sauter d‚Äôun bloc √† l‚Äôautre sans tabuler √† travers l‚Äôensemble des √©l√©ments de chaque bloc.</p>\n\n\n\n<h2>Une flexibilit√© de conception √©tendue</h2>\n\n\n\n<p>WordPress 5.3 ajoute des outils toujours plus robustes pour concevoir de beaux sites.</p>\n\n\n\n<ul><li>Le nouveau bloc Groupe vous permet de diviser facilement votre page en sections color√©es</li><li>Le bloc des colonnes prend maintenant en charge les largeurs fixes de colonnes</li><li>Les nouvelles mises en page pr√©d√©finies transforment en jeu d&rsquo;enfant l‚Äôorganisation du contenu dans des conceptions avanc√©es</li><li>Le bloc Titre dispose maintenant d‚Äôun s√©lecteur de couleur de texte</li><li>Des options de style suppl√©mentaires vous permettent de d√©finir votre style pr√©f√©r√© pour n&rsquo;importe quel bloc qui prend en charge cette fonctionnalit√©</li></ul>\n\n\n\n<h2>Arriv√©e de Twenty Twenty</h2>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/twentytwenty-desktop.png\" alt=\"\" class=\"wp-image-1498\" srcset=\"https://fr.wordpress.org/files/2019/11/twentytwenty-desktop.png 768w, https://fr.wordpress.org/files/2019/11/twentytwenty-desktop-300x297.png 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-medium\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/twentytwenty-mobile-267x300.png\" alt=\"\" class=\"wp-image-1499\" srcset=\"https://fr.wordpress.org/files/2019/11/twentytwenty-mobile-267x300.png 267w, https://fr.wordpress.org/files/2019/11/twentytwenty-mobile.png 768w\" sizes=\"(max-width: 267px) 100vw, 267px\" /></figure></div>\n\n\n\n<p>Le nouvel √©diteur f√™tant son premier anniversaire, il est appr√©ciable que l‚Äôid√©e directrice de Twenty Twenty soit la flexibilit√©. Montrez vos services ou vos produits avec des combinaisons de colonnes, de groupes et de blocs m√©dias. Mettez en place vos contenus en grande ou m√™me pleine largeur pour des mises en page dynamiques et attirantes‚Ä¶ ou laissez vos r√©flexions prendre toute la place avec une simple colonne de contenu centr√©e&nbsp;!</p>\n\n\n\n<p>Ce th√®me nomm√© ¬´&nbsp;Twenty Twenty&nbsp;¬ª le m√©rite bien&nbsp;: la clart√© et la lisibilit√© sont aussi de grandes priorit√©s. Le th√®me inclut la police&nbsp;<a href=\"https://rsms.me/inter/\">Inter</a>, con√ßue par Rasmus Andersson. ¬´&nbsp;Inter&nbsp;¬ª est impl√©ment√©e sous la forme d‚Äôune police variable, une premi√®re pour un th√®me par d√©faut. Cela am√©liore les temps de chargement car cette police contient toutes les tailles et toutes les variations de styles en seulement deux fichiers.</p>\n\n\n\n<h2>Improvements for Everyone</h2>\n\n\n\n<h3>Rotation automatique des images</h3>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-thumbnail is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/Rotate-150x150.png\" alt=\"\" class=\"wp-image-1501\" width=\"75\" height=\"75\" srcset=\"https://fr.wordpress.org/files/2019/11/Rotate-150x150.png 150w, https://fr.wordpress.org/files/2019/11/Rotate.png 300w\" sizes=\"(max-width: 75px) 100vw, 75px\" /></figure></div>\n\n\n\n<p>Vos images seront correctement orient√©es lors du t√©l√©versement en fonction des donn√©es d‚Äôorientation embarqu√©es dans le fichier. Cette fonctionnalit√© a √©t√© propos√©e pour la premi√®re fois il y a neuf ans, et son impl√©mentation a √©t√© rendue possible gr√¢ce √† la pers√©v√©rance de plusieurs contributrices et contributeurs passionn√©¬∑e¬∑s.</p>\n\n\n\n<h3>V√©rifications de l‚Äô√©tat de sant√© du site</h3>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-thumbnail is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/Health-150x150.png\" alt=\"\" class=\"wp-image-1507\" width=\"75\" height=\"75\" srcset=\"https://fr.wordpress.org/files/2019/11/Health-150x150.png 150w, https://fr.wordpress.org/files/2019/11/Health.png 300w\" sizes=\"(max-width: 75px) 100vw, 75px\" /></figure></div>\n\n\n\n<p>Les am√©liorations introduites dans 5.3 rendent encore plus facile l‚Äôidentification des probl√®mes. Les recommandations qui n√©cessiteraient un d√©pannage sont mises en avant sur l‚Äô√©cran ¬´&nbsp;Sant√© de votre site&nbsp;¬ª.</p>\n\n\n\n<h3>V√©rification de l‚Äôe-mail d‚Äôadministration</h3>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-thumbnail is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/Email-150x150.png\" alt=\"\" class=\"wp-image-1508\" width=\"75\" height=\"75\" srcset=\"https://fr.wordpress.org/files/2019/11/Email-150x150.png 150w, https://fr.wordpress.org/files/2019/11/Email.png 300w\" sizes=\"(max-width: 75px) 100vw, 75px\" /></figure></div>\n\n\n\n<p>Il vous sera dor√©navant p√©riodiquement demand√© de confirmer que votre adresse de messagerie est √† jour quand vous vous connectez en tant qu‚Äôadministrateur. Cela r√©duit le risque de verrouillage sans pouvoir acc√©der √† votre site si vous changez d‚Äôadresse de messagerie.</p>\n\n\n\n<h2>Pour les d√©veloppeuses et les d√©veloppeurs</h2>\n\n\n\n<h3>Correctifs sur le composant date/heure</h3>\n\n\n\n<p>Les d√©veloppeurs et d√©veloppeuses peuvent maintenant mieux travailler avec les&nbsp;<a href=\"https://make.wordpress.org/core/2019/09/23/date-time-improvements-wp-5-3/\">dates et fuseaux horaires</a>. La fonctionnalit√© de gestion de la date et de l‚Äôheure a re√ßue quantit√© de nouvelles fonctions API pour unifier l‚Äôutilisation des fuseaux horaires, pour am√©liorer l‚Äôint√©rop√©rabilit√© PHP ainsi que plusieurs correctifs et am√©liorations diverses.</p>\n\n\n\n<h3>Compatibilit√© PHP 7.4</h3>\n\n\n\n<p>WordPress 5.3 vise √† prendre en charge totalement PHP 7.4. Cette version contient de&nbsp;<a href=\"https://make.wordpress.org/core/2019/10/11/wordpress-and-php-7-4/\">multiples modifications</a>&nbsp;pour retirer les fonctionnalit√©s d√©pr√©ci√©es et assurer la compatibilit√©. WordPress continue d‚Äôencourager ses utilisatrices et utilisateurs √† faire tourner leurs sites sur la derni√®re et la meilleure version de PHP.</p>\n\n\n\n<p>Si vous cherchez des informations plus techniques sur les √©volutions de WordPress 5.3, n&rsquo;oubliez pas de <a href=\"https://fr.wordpress.org/2019/10/24/les-changements-a-venir-dans-wordpress-5-3/\">consulter notre article d√©di√©</a>.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/divider.png\" alt=\"\" class=\"wp-image-1497\" srcset=\"https://fr.wordpress.org/files/2019/11/divider.png 768w, https://fr.wordpress.org/files/2019/11/divider-300x76.png 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>L&rsquo;√©quipe derri√®re WP 5.3</h2>\n\n\n\n<p>Cette version de WordPress a √©t√© coordonn√©e par <a href=\"http://ma.tt/\">Matt Mullenweg</a>,&nbsp;<a href=\"https://profiles.wordpress.org/francina\">Francesca Marano</a> et&nbsp;<a href=\"https://dream-encode.com/blog/\">David Baumwald</a>. Ils ont √©t√© soutenu par une √©quipe de direction √©largie&nbsp;:</p>\n\n\n\n<ul><li><strong>√âditeur (technique) :</strong> Riad Benguella (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://profiles.wordpress.org/youknowriad