ns de 3 contributeurs de la communaut√© francophone sur les 11 personnes de l&rsquo;√©quipe de direction de cette version, la version 5.3 de WordPress sera ax√©e autour d&rsquo;am√©liorations graphiques de l&rsquo;interface d&rsquo;administration de WP, d&rsquo;am√©liorations techniques √† destination des d√©veloppeurs et de l&rsquo;√©volution de l&rsquo;√©diteur Gutenberg.</p>\n\n\n\n<p>Sans oublier les centaines de correctifs de bugs et petites am√©liorations diverses associ√©es. Au total, ce sont donc&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=enhancement&amp;type=feature+request&amp;milestone=5.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">157</a>&nbsp;am√©liorations et nouvelles fonctionnalit√©s et&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=defect+(bug)&amp;milestone=5.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">366</a>&nbsp;corrections de bugs&nbsp;!</p>\n\n\n\n<p>Dans cet article, nous vous proposons de parcourir les principaux changements √† venir sur WordPress 5.3. En plus d&rsquo;un panorama complet des modifications pr√©vues, des liens vous sont propos√©s vers les notes de d√©veloppement officielles de chaque √©volution ou modification majeure.</p>\n\n\n\n<span id=\"more-1457\"></span>\n\n\n\n<h2>Twenty Twenty, le nouveau th√®me par d√©faut de WordPress&nbsp;!</h2>\n\n\n\n<p>Nous reviendrons plus en d√©tails sur ce nouveau th√®me dans un prochain article sur <em>fr.wordpress.org</em>, mais le travail r√©alis√© est vraiment s√©duisant&nbsp;!</p>\n\n\n\n<p>Ce th√®me est clairement con√ßu comme une vitrine des nouvelles fonctionnalit√©s propos√©es par l&rsquo;√©diteur Gutenberg. Il utilise une police variable (une premi√®re pour un th√®me natif de WordPress), am√©liorant grandement les performances de chargement. Le th√®me peut tr√®s facilement √™tre adapt√© pour des besoins tr√®s diff√©rents, et il existe d√©j√† de nombreux exemples de sites qui l&rsquo;utilisent en version beta.</p>\n\n\n\n<p>Nous vous proposerons un panorama complet des fonctionnalit√©s de Twenty Twenty dans un prochain article <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"üôÇ\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h2>Accessibilit√©</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?focuses=~accessibility&amp;milestone=5.3&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">50 tickets</a>&nbsp;li√©s √† l&rsquo;accessibilit√© trait√©s sur WP 5.3, les changements les plus notables concernent les √©volutions CSS de l&rsquo;interface d&rsquo;administration, les am√©liorations des formulaires contenus dans la biblioth√®que de m√©dias, l&rsquo;ajout de l&rsquo;attribut&nbsp;<code>aria-current=\"page\"</code>&nbsp;sur les widgets qui le n√©cessitent, et l&rsquo;ajout automatique d&rsquo;attributs&nbsp;<code>aria-label</code>&nbsp;pour certains menus de navigation qui le n√©cessitent.</p>\n\n\n\n<p>Nous vous invitons √† lire les notes de d√©veloppement concernant ces modifications. Vous les trouverez list√©es ci-dessous.</p>\n\n\n\n<h3>√âvolution des CSS de l&rsquo;interface d&rsquo;administration</h3>\n\n\n\n<p>Consulter la note de d√©veloppement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wa03VhNG1x\"><a href=\"https://make.wordpress.org/core/2019/10/18/noteworthy-admin-css-changes-in-wordpress-5-3/\">Noteworthy Admin CSS changes in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Noteworthy Admin CSS changes in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/18/noteworthy-admin-css-changes-in-wordpress-5-3/embed/#?secret=wa03VhNG1x\" data-secret=\"wa03VhNG1x\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>√Ä noter que ces changements CSS sur l&rsquo;interface d&rsquo;administration ont fait l&rsquo;objet d&rsquo;une campagne de test des extensions les plus populaires du d√©p√¥t WordPress.org afin de s&rsquo;assurer que celles-ci n&rsquo;introduisent pas de probl√®mes de compatibilit√© majeurs sur les extensions existantes. Les r√©sultats de ces tests ont √©t√© consign√©s dans cet article (en anglais)&nbsp;: </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"M7iaIFVkeu\"><a href=\"https://make.wordpress.org/core/2019/10/15/report-wp-5-3-admin-css-changes-tested-against-top-20-plugins/\">Report: WP 5.3 Admin CSS changes tested against top 20 plugins</a></blockquote><iframe title=\"&#8220;Report: WP 5.3 Admin CSS changes tested against top 20 plugins&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/report-wp-5-3-admin-css-changes-tested-against-top-20-plugins/embed/#?secret=M7iaIFVkeu\" data-secret=\"M7iaIFVkeu\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Pour r√©sumer, les auteurs d&rsquo;extensions, de th√®mes, ainsi que les d√©veloppeuses et d√©veloppeurs sont invit√©s √†&nbsp;:</p>\n\n\n\n<ul><li>Ne pas utiliser de hauteur fixe sur les √©l√©ments de formulaires dans l&rsquo;administration de WP&nbsp;: les hauteurs flexibles font partie des standards de code pour WordPress (et l&rsquo;un des buts principaux de ces changements CSS √† venir sur 5.3).</li><li>Ne pas utiliser de valeur personnalis√©e pour le <code>padding</code> haut et bas des √©l√©ments de formulaires (celui-ci est flexible et calcul√© automatiquement en fonction du contenu).</li><li>Ne pas utiliser de valeur personnalis√©e pour le <code>line-height</code> (interlignage).</li><li>Si vous surchargez les styles des boutons pour leur donner une couleur d&rsquo;arri√®re-plan diff√©rente, pensez √† mettre √† jour leur CSS pour surcharger √©galement leur √©tat <code>focus</code> et <code>hover</code>.</li></ul>\n\n\n\n<h3>Attribut aria-current dans les widgets</h3>\n\n\n\n<p>Consulter la note de d√©veloppement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"caDJ3LJndK\"><a href=\"https://make.wordpress.org/core/2019/09/23/core-widgets-new-aria-current-attribute-in-wordpress-5-3/\">Core Widgets: new aria-current attribute in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Core Widgets: new aria-current attribute in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/23/core-widgets-new-aria-current-attribute-in-wordpress-5-3/embed/#?secret=caDJ3LJndK\" data-secret=\"caDJ3LJndK\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Attribut aria-label dans la navigation entre page/articles/commentaires et types de publications personnalis√©s</h3>\n\n\n\n<p>Consulter la note de d√©veloppement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"uiJaRaUrtV\"><a href=\"https://make.wordpress.org/core/2019/10/15/use-aria-label-to-ensure-posts-and-comments-navigation-has-proper-context-in-wordpress-5-3/\">Use aria-label to ensure Posts and Comments navigation has proper context in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Use aria-label to ensure Posts and Comments navigation has proper context in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/use-aria-label-to-ensure-posts-and-comments-navigation-has-proper-context-in-wordpress-5-3/embed/#?secret=uiJaRaUrtV\" data-secret=\"uiJaRaUrtV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>√âditeur (Gutenberg)</h2>\n\n\n\n<p>L&rsquo;√©diteur de WordPress a continu√© ses cycles d&rsquo;it√©rations commenc√©s avec WP 5.0. WordPress 5.3 int√©grera la version 6.5 de Gutenberg, ce qui fait que <strong>douze</strong> nouvelles versions de Gutenberg seront directement int√©gr√©es dans WP 5.3 (les versions&nbsp;<a href=\"https://make.wordpress.org/core/2019/04/03/whats-new-in-gutenberg-3rd-april/\">5.4</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/04/17/whats-new-in-gutenberg-17th-april/\">5.5</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/05/01/whats-new-in-gutenberg-1st-may/\">5.6</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/05/15/whats-new-in-gutenberg-15th-may/\">5.7</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/05/29/whats-new-in-gutenberg-29th-may/\">5.8</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/06/12/whats-new-in-gutenberg-12th-june/\">5.9</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/06/26/whats-new-in-gutenberg-26th-june/\">6.0</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/07/10/whats-new-in-gutenberg-10-july/\">6.1</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/07/31/whats-new-in-gutenberg-31-july/\">6.2</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/08/14/whats-new-in-gutenberg-14-august/\">6.3</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/08/28/whats-new-in-gutenberg-28-august/\">6.4</a>, et&nbsp;<a href=\"https://make.wordpress.org/core/2019/09/19/whats-new-in-gutenberg-18-september/\">6.5</a>).</p>\n\n\n\n<p>Les correctifs de bugs et am√©liorations de performances des versions &nbsp;<a href=\"https://make.wordpress.org/core/2019/10/02/whats-new-in-gutenberg-2-october/\">6.6</a>&nbsp;et&nbsp;<a href=\"https://make.wordpress.org/core/2019/10/16/whats-new-in-gutenberg-16-october/\">6.7</a>&nbsp;seront √©galement int√©gr√©s.</p>\n\n\n\n<p>Les changements majeurs&nbsp;:</p>\n\n\n\n<ul><li>Le temps de chargement pour un article ¬´¬†g√©ant¬†¬ª de 36¬†000 mots et environ 1000 blocs se charge maintenant en 1,5 secondes</li><li>Une nouvelle API pour g√©rer les variations de styles des blocs c√¥t√© serveur (en PHP donc)</li><li>Le bloc groupe/section, permettant de d√©finir diff√©rentes sections dans une publication et par exemple de leur appliquer un arri√®re-plan commun et de les manipuler ensemble</li><li>Am√©liorations sur l&rsquo;accessibilit√© de l&rsquo;√©diteur afin de corriger les probl√®mes remont√©s par l&rsquo;audit ind√©pendant d&rsquo;accessibilit√© de Gutenberg r√©alis√© au printemps 2019, avec notamment le mode ¬´¬†navigation¬†¬ª permettant une navigation clavier bien plus performante</li><li>Am√©liorations sur le HTML/CSS g√©n√©r√© par l&rsquo;√©diteur : noms de classes, gestion de l&rsquo;alignement, gestion des colonnes, gestion des couleurs, gestion des blocs tableau et galerie, etc.</li></ul>\n\n\n\n<h3>Nouvelles API concernant les blocs de l&rsquo;√©diteur sur WordPress 5.3</h3>\n\n\n\n<p>Consulter la note de d√©veloppement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YZCinvsj27\"><a href=\"https://make.wordpress.org/core/2019/09/24/new-block-apis-in-wordpress-5-3/\">New Block APIs in WordPress 5.3</a></blockquote><iframe title=\"&#8220;New Block APIs in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/24/new-block-apis-in-wordpress-5-3/embed/#?secret=YZCinvsj27\" data-secret=\"YZCinvsj27\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>WordPress 5.3¬†: mise √† jour de l&rsquo;√©diteur concernant les th√®mes </h3>\n\n\n\n<p>Consulter la note de d√©veloppement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"FXR5SBTYlz\"><a href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Block Editor Theme-related updates in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Block Editor Theme-related updates in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/embed/#?secret=FXR5S