block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YZFZT7zWFk\"><a href=\"https://make.wordpress.org/core/2019/09/18/integer-menu-slugs-are-no-longer-supported-from-wordpress-5-3/\">Integer menu slugs are no longer supported from WordPress 5.3</a></blockquote><iframe title=\"&#8220;Integer menu slugs are no longer supported from WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/18/integer-menu-slugs-are-no-longer-supported-from-wordpress-5-3/embed/#?secret=YZFZT7zWFk\" data-secret=\"YZFZT7zWFk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Un nouveau bouton ¬´¬†Afficher le mot de passe¬†¬ª dans l&rsquo;√©cran de connexion √† votre administration WP</h3>\n\n\n\n<p>Tr√®s souvent utilis√© sur nombre d&rsquo;applications web, WordPress adopte √©galement un petit bouton permettant de visualiser le mot de passe que l&rsquo;on est en train de saisir.</p>\n\n\n\n<p>Consulter la note de d√©veloppement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"y79Mssuxvf\"><a href=\"https://make.wordpress.org/core/2019/10/10/wordpress-5-3-adds-a-show-button-next-to-the-password-field-on-the-login-screen/\">WordPress 5.3 adds a &#8220;Show&#8221; button next to the password field on the login screen</a></blockquote><iframe title=\"&#8220;WordPress 5.3 adds a &#8220;Show&#8221; button next to the password field on the login screen&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/10/wordpress-5-3-adds-a-show-button-next-to-the-password-field-on-the-login-screen/embed/#?secret=y79Mssuxvf\" data-secret=\"y79Mssuxvf\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Et pour finir, un petit floril√®ge de modifications diverses</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"UM16bjeKGL\"><a href=\"https://make.wordpress.org/core/2019/10/15/miscellaneous-developer-focused-changes-in-5-3/\">Miscellaneous Developer Focused Changes in 5.3</a></blockquote><iframe title=\"&#8220;Miscellaneous Developer Focused Changes in 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/miscellaneous-developer-focused-changes-in-5-3/embed/#?secret=UM16bjeKGL\" data-secret=\"UM16bjeKGL\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.3 est pr√©vue le 12 novembre 2019. Vous pouvez d&rsquo;ores et d√©j√† la tester en version <em>Release Candidate</em> en installant l&rsquo;extension officielle WordPress Beta Tester puis en allant dans ses r√©glages et cocher la case <em>¬´¬†Bleeding Edge¬†¬ª</em> / version de d√©veloppement puis en mettant √† jour votre installation de fa√ßon classique.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Czet7k2tcq\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe title=\"¬´¬†WordPress Beta Tester¬†¬ª &#8212; Plugin Directory\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/embed/#?secret=Czet7k2tcq\" data-secret=\"Czet7k2tcq\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Merci √† <a href=\"https://profiles.wordpress.org/wolforg/\">Wolforg</a>, <a href=\"https://profiles.wordpress.org/chaton666/\">Marie Comet</a> et <a href=\"https://profiles.wordpress.org/crash_47/\">Thomas Piron</a> pour leur relecture attentive <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"üíö\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> </p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://fr.wordpress.org/2019/10/24/les-changements-a-venir-dans-wordpress-5-3/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"WordPress et la documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://fr.wordpress.org/2019/09/18/wordpress-et-la-documentation/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://fr.wordpress.org/2019/09/18/wordpress-et-la-documentation/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Sep 2019 07:53:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1427\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:368:\"Lorsque vous recherchez de la documentation sur WordPress, votre r√©flexe est probablement de saisir le nom de la fonction PHP, du crochet (hook) ou de l&#8217;√©l√©ment dont vous avez besoin sur votre moteur de recherche favori. Plusieurs sources sont alors propos√©es : les sources officieuses comme les articles de blogs, et les sources officielles. Elles [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:12748:\"<span id=\"more-1427\"></span>\n<!--noteaser-->\n\n\n\n<p>Lorsque vous recherchez de la documentation sur WordPress, votre r√©flexe est probablement de saisir le nom de la fonction PHP, du crochet (hook) ou de l&rsquo;√©l√©ment dont vous avez besoin sur votre moteur de recherche favori. Plusieurs sources sont alors propos√©es : les sources officieuses comme les articles de blogs, et les sources officielles. Elles sont simples √† identifier puisqu&rsquo;elles utilisent le domaine <code>WordPress.org</code>.</p>\n\n\n\n<p>Deux types de sources officielles co-existent actuellement dans les r√©sultats de recherche : l&rsquo;ancien <a href=\"https://codex.wordpress.org/\">Codex</a>, et <a href=\"https://developer.wordpress.org\">DevHub</a>.</p>\n\n\n\n<h2>Le codex c&rsquo;est termin√©, place √† DevHub&nbsp;!</h2>\n\n\n\n<p>Depuis maintenant quelques ann√©es, une migration a √©t√© lanc√©e vers la nouvelle plateforme de r√©f√©rence pour la documentation de WordPress&nbsp;: surnomm√©e ¬´&nbsp;DevHub&nbsp;¬ª, <a href=\"https://developer.wordpress.org\">developer.wordpress.org</a> a pour vocation de remplacer totalement l&rsquo;ancien Codex.</p>\n\n\n\n<h3>Pourquoi changer&nbsp;?</h3>\n\n\n\n<p>Bas√© sur un Wiki (une encyclop√©die modifiable), le Codex avait l&rsquo;avantage (et l&rsquo;inconv√©nient) d&rsquo;avoir un contenu int√©gralement g√©n√©r√© par ses utilisatrices et utilisateurs. </p>\n\n\n\n<p>Avantages, car il n&rsquo;y avait pas de limite √† la cr√©ation de pages de documentation et cela permettait √† tout un chacun de proposer des contributions, des exemples, etc.</p>\n\n\n\n<p>Inconv√©nients, car il √©tait alors quasiment impossible de maintenir √† jour cette documentation. Les fonctionnalit√©s de WordPress √©voluent rapidement, au rythme de g√©n√©ralement 3 nouvelles versions majeures par an et une dizaine de versions mineures. Il est tr√®s difficile de tenir la documentation de ces fonctionnalit√©s √† jour avec quelques dizaines de volontaires. Ainsi, le Codex est condamn√© √† une certaine obsolescence, le volume de contribution des nouvelles pages de documentation ne pouvant suivre le volume d&rsquo;√©volutions au sein du CMS.</p>\n\n\n\n<h3>DevHub, vers une documentation semi-automatis√©e</h3>\n\n\n\n<p>Au contraire du Codex, la nouvelle plateforme de r√©f√©rence DevHub ‚Äì <a href=\"https://developer.wordpress.org\">developer.wordpress.org</a> ‚Äì fonctionne de fa√ßon automatis√©e (ou presque).</p>\n\n\n\n<p style=\"background-color:#04598a;color:#ffffff\" class=\"has-text-color has-background has-medium-font-size\">Sur DevHub, la documentation des fonctions, crochets (hooks), filtres et autres actions est g√©n√©r√©e automatiquement √† partir de la documentation pr√©sente dans les fichiers du c≈ìur du CMS.<br><strong>Cette documentation est donc toujours 100% √† jour par rapport au c≈ìur WP.</strong></p>\n\n\n\n<p>Pour le coup, l&rsquo;avantage est clair&nbsp;: <strong>d√®s la sortie d&rsquo;une nouvelle version de WordPress, l&rsquo;ensemble de la documentation est automatiquement mis √† jour</strong> pour int√©grer les nouvelles fonctionnalit√©s, comprenant les pages de documentation existantes comme la cr√©ation de nouvelles pages pour les nouvelles fonctionnalit√©s.</p>\n\n\n\n<p>L&rsquo;inconv√©nient que l&rsquo;on peut y voir est un format plus rigide que l&rsquo;ancien Codex. M√™me si cela a clairement des avantages en terme de rapidit√© de l&rsquo;acc√®s √† l&rsquo;information vu que tout est format√© de la m√™me fa√ßon, cela aura peut-√™tre pour certain¬∑e¬∑s un peu moins de charme que le bon vieux Codex et ses pages g√©n√©r√©es √† l&rsquo;huile de coude <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"üôÇ\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h3>Le codex progressivement redirig√© vers DevHub</h3>\n\n\n\n<p>Les pages du Codex seront progressivement redirig√©es de fa√ßon permanente vers DevHub (c&rsquo;est d√©j√† le cas pour beaucoup d&rsquo;entre elles). D&rsquo;ici l√†, faites attention :</p>\n\n\n\n<p style=\"background-color:#04598a;color:#ffffff\" class=\"has-text-color has-background has-medium-font-size\"><strong>Les contenus du Codex ne sont plus maintenus</strong> et proposent donc une documentation incompl√®te ou obsol√®te. <br>Il est fortement recommand√© d&rsquo;utiliser la documentation propos√©e sur developer.wordpress.org <strong>qui est maintenant la seule documentation officielle de WordPress √† jour</strong>.</p>\n\n\n\n<p>Bien s√ªr, les pages du Codex √©tant progressivement redirig√©es vers DevHub, nous sommes dans une p√©riode de transition pendant laquelle les deux co-existent. Forts d&rsquo;une grande notori√©t√©, les pages du Codex apparaissent souvent avant les pages DevHub dans les r√©sultats de recherche. Mais cela sera r√©solu au fur et √† mesure de la redirection permanente des pages vers DevHub.</p>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/codex-devhub.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/codex-devhub-1024x406.png\" alt=\"\" class=\"wp-image-1432\" srcset=\"https://fr.wordpress.org/files/2019/09/codex-devhub-1024x406.png 1024w, https://fr.wordpress.org/files/2019/09/codex-devhub-300x119.png 300w, https://fr.wordpress.org/files/2019/09/codex-devhub-768x304.png 768w, https://fr.wordpress.org/files/2019/09/codex-devhub.png 1120w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<h2>Comment lire une page de documentation sur DevHub</h2>\n\n\n\n<p>Prenons par exemple une fonction de base de WP au hasard&nbsp;:&nbsp;<a href=\"https://developer.wordpress.org/reference/functions/get_the_time/\"><code>get_the_time()</code></a>.</p>\n\n\n\n<p>Sur la fiche developer.w.org, on retrouvera plusieurs sections :</p>\n\n\n\n<ul><li>Le&nbsp;<strong>nom</strong>&nbsp;de la fonction</li><li>Une&nbsp;<strong>description courte</strong></li><li>Une&nbsp;<strong>description longue</strong>&nbsp;(quand c&rsquo;est n√©cessaire)</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-1.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-1.png\" alt=\"\" class=\"wp-image-1433\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-1.png 737w, https://fr.wordpress.org/files/2019/09/devhub-1-300x50.png 300w\" sizes=\"(max-width: 737px) 100vw, 737px\" /></a></figure>\n\n\n\n<ul><li>Les&nbsp;<strong>param√®tres d‚Äôentr√©e</strong>&nbsp;de la fonction :</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-2.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-2.png\" alt=\"\" class=\"wp-image-1434\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-2.png 710w, https://fr.wordpress.org/files/2019/09/devhub-2-300x116.png 300w\" sizes=\"(max-width: 710px) 100vw, 710px\" /></a></figure>\n\n\n\n<ul><li>Les √©l√©ments&nbsp;<strong>retourn√©s</strong>&nbsp;par la fonction (si la fonction est sens√©e retourner quelque chose) :</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-3.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-3.png\" alt=\"\" class=\"wp-image-1435\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-3.png 782w, https://fr.wordpress.org/files/2019/09/devhub-3-300x47.png 300w, https://fr.wordpress.org/files/2019/09/devhub-3-768x120.png 768w\" sizes=\"(max-width: 782px) 100vw, 782px\" /></a></figure>\n\n\n\n<ul><li>La&nbsp;<strong>source</strong>&nbsp;de la fonction dans le c≈ìur WordPress, avec les √©l√©ments suivants :<ul><li>Le fichier dans lequel la fonction est d√©clar√©e (lien cliquable vers la liste de toutes les fonctions d√©clar√©es dans ce fichier).</li><li>Le code de la fonction.</li><li>Un bouton permettant de voir le code source en entier.</li><li>Un lien ¬´&nbsp;View on Trac&nbsp;¬ª pour voir la fonction au sein du fichier o√π elle est d√©clar√©e sur Trac, sur le d√©p√¥t du code source de WordPress.</li></ul></li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-4.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-4.png\" alt=\"\" class=\"wp-image-1436\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-4.png 989w, https://fr.wordpress.org/files/2019/09/devhub-4-300x113.png 300w, https://fr.wordpress.org/files/2019/09/devhub-4-768x289.png 768w\" sizes=\"(max-width: 989px) 100vw, 989px\" /></a></figure>\n\n\n\n<ul><li>Le&nbsp;<strong>changelog</strong>&nbsp;: il s‚Äôagit de la liste des diff√©rentes modifications faites sur la fonction et de la version de WordPress correspondant √† chaque modification. Cela permet de savoir quand une fonction a √©t√© introduite dans le c≈ìur WP et quand est-ce qu‚Äôelle a √©t√© modifi√©e.</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-5.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-5.png\" alt=\"\" class=\"wp-image-1437\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-5.png 895w, https://fr.wordpress.org/files/2019/09/devhub-5-300x70.png 300w, https://fr.wordpress.org/files/2019/09/devhub-5-768x179.png 768w\" sizes=\"(max-width: 895px) 100vw, 895px\" /></a></figure>\n\n\n\n<ul><li>Une section&nbsp;<strong>Related</strong>&nbsp;compos√©e de deux sous-sections :<ul><li><strong>Uses :</strong>&nbsp;les autres fonctions utilis√©es par la fonction en question</li><li><strong>Used by :</strong>&nbsp;les autres fonctions qui utilisent la fonction en question</li></ul></li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-6.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-6.png\" alt=\"\" class=\"wp-image-1438\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-6.png 963w, https://fr.wordpress.org/files/2019/09/devhub-6-300x196.png 300w, https://fr.wordpress.org/files/2019/09/devhub-6-768x501.png 768w\" sizes=\"(max-width: 963px) 100vw, 963px\" /></a></figure>\n\n\n\n<ul><li>Des <strong>User contributed notes :</strong>&nbsp;des sortes de commentaires permettant aux d√©veloppeur¬∑euse¬∑s de proposer des exemples d‚Äôutilisation et autres remarques concernant la fonction.</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-7.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-7.png\" alt=\"\" class=\"wp-image-1439\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-7.png 965w, https://fr.wordpress.org/files/2019/09/devhub-7-300x133.png 300w, https://fr.wordpress.org/files/2019/09/devhub-7-768x341.png 768w\" sizes=\"(max-width: 965px) 100vw, 965px\" /></a></figure>\n\n\n\n<h2>Contribuer √† la documentation de WordPress sur DevHub</h2>\n\n\n\n<p>N‚Äôh√©sitez pas √† proposer des&nbsp;<em>user contributed notes</em>&nbsp;!</p>\n\n\n\n<p>D‚Äôune part c‚Äôest un excellent moyen de contribuer √† WordPress, d‚Äôautre part vous serez peut-√™tre content de retrouver votre propre exemple ou remarque la prochaine fois que vous chercherez de la documentation sur cette fonction&nbsp;!</p>\n\n\n\n<p><strong>Les <em>user contributed notes</em> sont valid√©es manuellement par l‚Äô√©quipe de documentation de WordPress.</strong></p>\n\n\n\n<h3>Des questions&nbsp;?</h3>\n\n\n\n<p>Si vous utilisez le Slack WordPress-fr, n&rsquo;h√©sitez pas √† poser vos questions dans le canal #documentation-fr (pour vous inscrire gratuitement, c&rsquo;est <a href=\"https://wpfr.net/slack\">par ici</a>). Sinon, vous pouvez utiliser le <a href=\"https://wpfr.net/support/\">forum d&rsquo;entraide de l&rsquo;association WPFR</a> ou encore tout simplement publier un commentaire sur le pr√©sent article (mod√©ration a priori) <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"üôÇ\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h3>¬´&nbsp;Attends une minute‚Ä¶ mais c&rsquo;est tout en anglais DevHub&nbsp;!&nbsp;¬ª</h3>\n\n\n\n<p>Oui‚Ä¶ <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60a.png\" alt=\"üòä\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>‚Ä¶pour l&rsquo;instant&nbsp;! L&rsquo;√©quipe de d√©veloppement du r√©seau de sites WordPress.org a mis en place un outil permettant √† chacune des 192 langues (!) dans lesquelles WordPress est traduit de proposer leur propre traduction de la documentation de WordPress.</p>\n\n\n\n<p>Cet outil est en cours de test et le site fran√ßais (fr.wordpress.org) sera parmi les premiers √† disposer de cet outil. Nous sommes actuellement en train de finaliser les pr√©paratifs. L&rsquo;√©quipe de documentation de WP en fran√ßais devrait pouvoir commencer son travail d&rsquo;ici quelques semaines/mois. Bien entendu, il s&rsquo;agit d&rsquo;un travail de longue haleine et toutes les bonnes volont√©s seront les bienvenues&nbsp;!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://fr.wordpress.org/2019/09/18/wordpress-et-la-documentation/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WordPress 5.3 et Twenty Nineteen¬†: v√©rifiez vos CSS¬†!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2019/09/05/wordpress-5-3-et-twenty-nineteen-verifiez-vos-css/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2019/09/05/wordpress-5-3-et-twenty-nineteen-verifiez-vos-css/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Sep 2019 11:40:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1416\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:251:\"Si vous avez surcharg√© le CSS du th√®me Twenty Nineteen via l\'outil de personnalisation ou via un th√®me enfant, nous vous invitons √† v√©rifier que ce changement √† venir dans WP 5.3 ne vous concerne pas, ou √† faire les modifications CSS si besoin.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5859:\"\n<p>La prochaine version majeure de WordPress sera la version 5.3. Elle est pr√©vue le 12 novembre 2019.</p>\n\n\n\n<p>D&rsquo;ici l√†, nous attirons votre attention sur le fait que WordPress 5.3 apportera un petit changement sur la structure HTML du th√®me natif Twenty Nineteen. </p>\n\n\n\n<p>Si vous avez surcharg√© le CSS du th√®me Twenty Nineteen via l&rsquo;outil de personnalisation (en anglais, <em>Customizer</em>) ou via un th√®me enfant, nous vous invitons √† lire cet article et √† v√©rifier que ce changement ne vous concerne pas, ou √† faire les (petites) modifications CSS qui s&rsquo;imposent si besoin. En effet, la mise √† jour WordPress 5.3 pourrait alors occasionner des bugs d&rsquo;affichage.</p>\n\n\n\n<p>Nous commencerons par une description du probl√®me avant d&rsquo;expliquer comment v√©rifier si cela vous concerne et faire les modifications n√©cessaires le cas √©ch√©ant.</p>\n\n\n\n<span id=\"more-1416\"></span>\n\n\n\n<h2>Description d√©taill√©e du changement qui arrive avec WP 5.3</h2>\n\n\n\n<p>Dans certains mod√®les de pages, le th√®me Twenty Nineteen utilisait jusqu&rsquo;√† pr√©sent l‚Äô√©l√©ment HTML <code>&lt;main&gt;</code> en tant que descendant direct de l&rsquo;√©l√©ment HTML <code>&lt;section&gt;</code>. Cela donnait alors des erreurs de balisage dans les mod√®les de page suivants&nbsp;:</p>\n\n\n\n<ul><li>404.php</li><li>archive.php</li><li>image.php</li><li>index.php</li><li>page.php</li><li>search.php</li><li>single.php</li></ul>\n\n\n\n<p>Pour information, voici les sp√©cifications HTML (en anglais)</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>A hierarchically correct main element is one whose ancestor elements are limited to html, body, div, form without an accessible name, and autonomous custom elements.</p><cite><a href=\"https://html.spec.whatwg.org/multipage/grouping-content.html#hierarchically-correct-main-element\">Source: HTML Living Standard</a></cite></blockquote>\n\n\n\n<p>Pour r√©sumer, l&rsquo;√©l√©ment HTML <code>&lt;main&gt;</code> ne doit pas avoir pour parent direct un √©l√©ment autre que <code>&lt;html&gt;</code>, <code>&lt;body&gt;</code>, <code>&lt;div&gt;</code>, <code>&lt;form&gt;</code> ou  qu&rsquo;un √©l√©ment personnalis√© sp√©cifique.</p>\n\n\n\n<p>Avec WordPress 5.3, le balisage actuel de Twenty Nineteen va √™tre corrig√© en utilisant un √©l√©ment neutre <code>&lt;div&gt;</code> √† la place de l&rsquo;√©l√©ment <code>&lt;section&gt;</code>.</p>\n\n\n\n<p>Ancien rendu HTML :</p>\n\n\n\n<pre class=\"wp-block-code\"><code>&lt;section id=\"primary\" class=\"content-area\"&gt;\n    &lt;main id=\"main\" class=\"site-main\"&gt;\n        ‚Ä¶\n    &lt;/main&gt;\n&lt;/section&gt;</code></pre>\n\n\n\n<p>Nouveau rendu HTML :</p>\n\n\n\n<pre class=\"wp-block-code\"><code>&lt;div id=\"primary\" class=\"content-area\"&gt;\n    &lt;main id=\"main\" class=\"site-main\"&gt;\n        ‚Ä¶\n    &lt;/main&gt;\n&lt;/div&gt;</code></pre>\n\n\n\n<h2>Comment v√©rifier votre th√®me et le corriger si n√©cessaire</h2>\n\n\n\n<p class=\"has-background has-very-light-gray-background-color\">Note importante : Si vous utilisez Twenty Nineteen directement sans avoir de th√®me enfant ou si vous n&rsquo;utilisez pas du tout le th√®me Twenty Nineteen (avec ou sans th√®me enfant), alors ce qui suit ne vous concerne pas et vous n&rsquo;avez rien √† faire de sp√©cial.</p>\n\n\n\n<p>Les utilisateurs du th√®me Twenty Nineteen ou d&rsquo;un th√®me enfant de Twenty Nineteen sont invit√©s √† v√©rifier que la feuille de styles CSS de leur th√®me enfant ou que le code CSS √©ventuellement pr√©sent dans leur outil de personnalisation (en anglais <em>customizer</em>) n&rsquo;utilisent pas des s√©lecteurs de balises tels que :</p>\n\n\n\n<ol><li><code>section#primary</code> (tout attach√©)</li><li><code>section.content-area</code> (tout attach√©)</li><li><code>section .site-main</code> (avec un espace avant le point)</li><li><code>section #main</code> (avec un espace avant le di√®se)</li></ol>\n\n\n\n<p>Vous pouvez chercher cela dans la feuille de style g√©n√©rale de votre th√®me enfant de Twenty Nineteen ou dans votre outil de personnalisation (Apparence &gt; Personnaliser). Si c&rsquo;est le cas, nous vous pr√©conisons de remplacer ces s√©lecteurs par, respectivement :</p>\n\n\n\n<ol><li><code>#primary</code></li><li><code>.content-area</code></li><li><code>.site-main</code></li><li><code>#main</code></li></ol>\n\n\n\n<p>Pour plus d&rsquo;informations, <a href=\"https://core.trac.wordpress.org/ticket/47066\">voici le ticket Trac du C≈ìur WordPress correspondant √† ce correctif</a> ainsi que la version originale de cet article, en anglais&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"EzwQ2qrlqW\"><a href=\"https://make.wordpress.org/core/2019/09/04/changes-on-twenty-nineteen-html-structure-in-wordpress-5-3/\">Changes on Twenty Nineteen HTML structure in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Changes on Twenty Nineteen HTML structure in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/04/changes-on-twenty-nineteen-html-structure-in-wordpress-5-3/embed/#?secret=EzwQ2qrlqW\" data-secret=\"EzwQ2qrlqW\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>En cas de doute, n&rsquo;h√©sitez pas √† publier un commentaire sous cet article (il sera mis en attente de validation par l&rsquo;un des responsables de ce site, donc patientez quelques heures‚Ä¶) ou √† utiliser le <a href=\"https://wpfr.net/support\">forum d&rsquo;entraide de WPFR</a> ou encore le <a href=\"https://wpfr.net/slack\">Slack WordPress-FR (demander une invitation gratuite ici)</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2019/09/05/wordpress-5-3-et-twenty-nineteen-verifiez-vos-css/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"D√©couvrez les nouveaut√©s de WordPress 5.2¬†¬´Jaco¬ª\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://fr.wordpress.org/2019/05/02/decouvrez-les-nouveautes-de-wordpress-5-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://fr.wordpress.org/2019/05/02/decouvrez-les-nouveautes-de-wordpress-5-2/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 May 2019 07:18:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1355\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:448:\"Nomm√©e ¬´¬†Jaco¬†¬ª en l&#8217;honneur du bassiste de jazz Jaco Pastorius, la version 5.2 de WordPress est sortie le 7 mai 2019. Cette nouvelle version majeure de WordPress est riche en changements. Pas moins de 228&#160;bugs,&#160;59&#160;am√©liorations,&#160;3&#160;nouvelles fonctionnalit√©s, et&#160;16&#160;t√¢ches de gestion ont √©t√© prises en charge avec cette version 5.2. WordPress 5.2 est d&#8217;ores et d√©j√† int√©gralement [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:16845:\"\n<p>Nomm√©e ¬´¬†Jaco¬†¬ª en l&rsquo;honneur du bassiste de jazz Jaco Pastorius, <strong>la version 5.2 de WordPress est sortie le 7 mai 2019.</strong></p>\n\n\n\n<p>Cette nouvelle version majeure de WordPress est riche en changements. Pas moins de <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">228</a>&nbsp;bugs,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">59</a>&nbsp;am√©liorations,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=feature+request&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">3</a>&nbsp;nouvelles fonctionnalit√©s, et&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">16</a>&nbsp;t√¢ches de gestion ont √©t√© <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">prises en charge avec cette version 5.2</a>.</p>\n\n\n\n<p>WordPress 5.2 est d&rsquo;ores et d√©j√† int√©gralement traduit, gr√¢ce √† la mobilisation de <a href=\"https://fr.wordpress.org/team\">l&rsquo;√©quipe de traduction de WordPress en fran√ßais</a>. <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f44f.png\" alt=\"üëè\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Voici un article r√©capitulant les changements apport√©s par WordPress 5.2. Chacun d‚Äôentre eux est accompagn√© des ressources correspondantes (appel√©es&nbsp;<em>Dev Notes</em>, celles-ci sont disponibles en anglais sur Make/Core).</p>\n\n\n\n<span id=\"more-1355\"></span>\n\n\n\n<h2>√âtat de sant√© de votre site</h2>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/05/wp-5-2-tools.png\" alt=\"\" class=\"wp-image-1363\" /></figure></div>\n\n\n\n<p>Avec WordPress 5.2, un nouvel √©cran fait son apparition dans l&rsquo;interface d&rsquo;administration.</p>\n\n\n\n<p>Disponible dans le menu ¬´&nbsp;Outils &gt; Sant√© du site&nbsp;¬ª du menu d&rsquo;administration, cette fonctionnalit√© d&rsquo;√©tat de sant√© du site permet d&rsquo;obtenir un grand nombre d&rsquo;informations utiles sur la configuration de votre site.</p>\n\n\n\n<p>Deux √©crans sont alors disponibles. Le premier permet d&rsquo;obtenir un bilan de sant√© g√©n√©ral de son site grace √† un panel de points de contr√¥le lanc√©s de fa√ßon automatique.</p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site.png\" alt=\"\" class=\"wp-image-1364\" srcset=\"https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site.png 836w, https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site-300x237.png 300w, https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site-768x607.png 768w\" sizes=\"(max-width: 836px) 100vw, 836px\" /></figure>\n\n\n\n<p>Les d√©veloppeuses et d√©veloppeurs peuvent ajouter leur propres points de contr√¥le, comme dans l&rsquo;√©cran ci-dessus (crit√®res marqu√©s ¬´&nbsp;Search Engine Optimization&nbsp;¬ª dans la capture d&rsquo;√©cran). Pour en savoir plus sur l&rsquo;ajout de points de contr√¥le personnalis√©s, consultez l&rsquo;article suivant (en anglais) :</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"hNb9pCgS0f\"><a href=\"https://make.wordpress.org/core/2019/04/25/site-health-check-in-5-2/\">Site Health Check in 5.2</a></blockquote><iframe title=\"&#8220;Site Health Check in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/25/site-health-check-in-5-2/embed/#?secret=hNb9pCgS0f\" data-secret=\"hNb9pCgS0f\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Un second √©cran (accessible via l&rsquo;onglet ¬´&nbsp;Info&nbsp;¬ª) permet d&rsquo;obtenir des informations de d√©bogage qui sont pr√©cieuses pour votre h√©bergeur ou pour les responsables techniques de votre site. </p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool.png\" alt=\"\" class=\"wp-image-1365\" srcset=\"https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool.png 842w, https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool-300x250.png 300w, https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool-768x640.png 768w\" sizes=\"(max-width: 842px) 100vw, 842px\" /></figure>\n\n\n\n<p>De la m√™me fa√ßon, les √©diteurs d&rsquo;extensions peuvent ajouter leur propres points de contr√¥le dans cet outil.</p>\n\n\n\n<p>Cela leur permettra de faciliter le support de leur extension en indiquant √† leurs utilisatrices et utilisateurs comment facilement r√©cup√©rer ces informations et leur communiquer.</p>\n\n\n\n<h2>Protection contre les erreurs fatales PHP</h2>\n\n\n\n<p>WordPress int√®gre maintenant nativement un ¬´&nbsp;mode de r√©cup√©ration&nbsp;¬ª (<em>recovery mode</em> en anglais).</p>\n\n\n\n<p>L&rsquo;id√©e est simple : si un th√®me ou une extension plante votre site, plut√¥t que de vous fournir un classique ¬´&nbsp;√©cran blanc de la mort&nbsp;¬ª √† partir duquel vous ne pouvez plus rien faire, WordPress d√©sactivera automatiquement le th√®me ou l&rsquo;extension associ√© au bug. Si cela se passe en votre absence (via une mise √† jour automatique par exemple) alors vous recevrez un e-mail contenant des informations sur le bug rencontr√© et sur le fait que votre site est pass√© en <em>mode de r√©cup√©ration</em>.</p>\n\n\n\n<p>Pour en savoir plus, vous pouvez consulter cet article (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"g5hchqhLg4\"><a href=\"https://make.wordpress.org/core/2019/04/16/fatal-error-recovery-mode-in-5-2/\">Fatal Error Recovery Mode in 5.2</a></blockquote><iframe title=\"&#8220;Fatal Error Recovery Mode in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/16/fatal-error-recovery-mode-in-5-2/embed/#?secret=g5hchqhLg4\" data-secret=\"g5hchqhLg4\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Arr√™t de la prise en charge des versions de PHP obsol√®tes</h2>\n\n\n\n<p>√Ä partir de WordPress 5.2, le CMS ne sera plus compatible avec les versions de PHP inf√©rieures √† 5.6.20. Si vous utilisez une version de PHP ant√©rieure, vous ne pourrez tout simplement pas r√©aliser la mise √† jour vers WordPress 5.2. Si vous √™tes dans ce cas l√†, rapprochez-vous de votre h√©bergeur afin de passer sur une version de PHP plus r√©cente.</p>\n\n\n\n<h2>√âditeur / Gutenberg</h2>\n\n\n\n<p>De nombreuses am√©liorations ont √©t√© faites dans l&rsquo;√©diteur. En dehors des optimisations de performances et d&rsquo;utilisabilit√©, citons notamment l&rsquo;ajout d&rsquo;un module <code>block-editor</code> r√©utilisable pour permettre l&rsquo;utilisation de l&rsquo;√©diteur de fa√ßon ind√©pendante de l&rsquo;√©diteur de publications, sans d√©pendance vis √† vis des publications. Cela permettra de pouvoir l&rsquo;utiliser dans d&rsquo;autres √©crans de l&rsquo;administration WordPress, comme par exemple dans l&rsquo;√©cran <em>Widgets</em>.</p>\n\n\n\n<p>Pour en savoir plus, vous pouvez consulter cet article (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Z65XzE2Jdn\"><a href=\"https://make.wordpress.org/core/2019/04/09/the-block-editor-javascript-module-in-5-2/\">The Block Editor JavaScript module in 5.2</a></blockquote><iframe title=\"&#8220;The Block Editor JavaScript module in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/09/the-block-editor-javascript-module-in-5-2/embed/#?secret=Z65XzE2Jdn\" data-secret=\"Z65XzE2Jdn\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Accessibilit√©</h2>\n\n\n\n<p>Une am√©lioration du balisage des onglets utilis√©s dans l&rsquo;administration WordPress a √©t√© int√©gr√©e, ainsi que du balisage des formats d‚Äôarticles, de la barre d‚Äôadministration, et le Widget de s√©lection d&rsquo;archives d&rsquo;articles a maintenant un meilleur fonctionnement sur les technologies d&rsquo;assistance telles que les lecteurs d&rsquo;√©crans/synth√®ses vocales.</p>\n\n\n\n<p>Pour en savoir plus sur ces changements (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"NhV3S5uMlh\"><a href=\"https://make.wordpress.org/core/2019/04/02/admin-tabs-semantic-improvements-in-5-2/\">Admin Tabs Semantic Improvements in 5.2</a></blockquote><iframe title=\"&#8220;Admin Tabs Semantic Improvements in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/02/admin-tabs-semantic-improvements-in-5-2/embed/#?secret=NhV3S5uMlh\" data-secret=\"NhV3S5uMlh\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"M74Sdl656H\"><a href=\"https://make.wordpress.org/core/2019/04/24/notable-accessibility-changes-in-5-2/\">Notable Accessibility Changes in 5.2</a></blockquote><iframe title=\"&#8220;Notable Accessibility Changes in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/24/notable-accessibility-changes-in-5-2/embed/#?secret=M74Sdl656H\" data-secret=\"M74Sdl656H\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Confidentialit√©</h2>\n\n\n\n<p>Le composant <em>Privacy</em> (confidentialit√©) du c≈ìur WordPress a √©t√© am√©lior√© avec l&rsquo;ajout de 4 nouvelles fonctionnalit√©s pour rendre la personnalisation et le design de la page de politique de confidentialit√© plus simple. Certaines restrictions sur les exportations de donn√©es des utilisateurs ont √©galement √©t√© assouplies.</p>\n\n\n\n<p>Pour en savoir plus sur ces changements (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"g2XIEE66bh\"><a href=\"https://make.wordpress.org/core/2019/04/24/developer-focused-privacy-updates-in-5-2/\">Developer Focused Privacy Updates in 5.2</a></blockquote><iframe title=\"&#8220;Developer Focused Privacy Updates in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/24/developer-focused-privacy-updates-in-5-2/embed/#?secret=g2XIEE66bh\" data-secret=\"g2XIEE66bh\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres changements notables</h2>\n\n\n\n<p>13 nouveaux Dashicons ont √©t√© ajout√©s et mis √† disposition des d√©veloppeur¬∑euses. Pour en savoir plus (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"byYt4IpujY\"><a href=\"https://make.wordpress.org/core/2019/04/11/dashicons-in-wordpress-5-2/\">Dashicons in WordPress 5.2</a></blockquote><iframe title=\"&#8220;Dashicons in WordPress 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/11/dashicons-in-wordpress-5-2/embed/#?secret=byYt4IpujY\" data-secret=\"byYt4IpujY\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p> De nouveaux filtres ont √©t√© ajout√©s sur les requ√™tes faisables sur les sites et les r√©seaux de sites dans un contexte WordPress multisite. Pour en savoir plus (en anglais) :</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"VeHymQMJYS\"><a href=\"https://make.wordpress.org/core/2019/04/11/new-network-and-sites-query-filters/\">New Network and Sites Query Filters</a></blockquote><iframe title=\"&#8220;New Network and Sites Query Filters&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/11/new-network-and-sites-query-filters/embed/#?secret=VeHymQMJYS\" data-secret=\"VeHymQMJYS\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Le crochet d&rsquo;action (<em>hook</em>) <code>wp_body_open</code> a √©t√© ajout√©. Il permet aux d√©veloppeuses et aux d√©veloppeurs d&rsquo;ajouter des scripts juste apr√®s l&rsquo;ouverture de la balise <code>body</code> du th√®me. Cela est notamment n√©cessaire pour int√©grer les tags propos√©s par les outils de mesure d&rsquo;audience. Pour en savoir plus (en anglais) :</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-theme-review-team\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"yKhYMfUJLH\"><a href=\"https://make.wordpress.org/themes/2019/03/29/addition-of-new-wp_body_open-hook/\">Addition of new &#8216;wp_body_open&#8217; hook.</a></blockquote><iframe title=\"&#8220;Addition of new &#8216;wp_body_open&#8217; hook.&#8221; &#8212; Theme Review Team\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/themes/2019/03/29/addition-of-new-wp_body_open-hook/embed/#?secret=yKhYMfUJLH\" data-secret=\"yKhYMfUJLH\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p> Autres changements divers (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"die5jdzcpV\"><a href=\"https://make.wordpress.org/core/2019/04/24/miscellaneous-developer-updates-in-5-2/\">Miscellaneous Developer Updates in 5.2</a></blockquote><iframe title=\"&#8220;Miscellaneous Developer Updates in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/24/miscellaneous-developer-updates-in-5-2/embed/#?secret=die5jdzcpV\" data-secret=\"die5jdzcpV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://fr.wordpress.org/2019/05/02/decouvrez-les-nouveautes-de-wordpress-5-2/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"22\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"Le 11 mai 2019, c‚Äôest le 4√®me WordPress Translation Day¬†!\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://fr.wordpress.org/2019/04/07/le-11-mai-2019-cest-le-4eme-wordpress-translation-day/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://fr.wordpress.org/2019/04/07/le-11-mai-2019-cest-le-4eme-wordpress-translation-day/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 07 Apr 2019 08:18:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"√âv√®nement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:10:\"Traduction\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1328\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:393:\"Le WordPress Translation Day (WPTD) est un √©v√®nement mondial r√©guli√®rement organis√© par les √©quipes de traduction de WordPress. L&#8217;objectif est de r√©unir virtuellement toutes les √©quipes de traduction du CMS pendant 24 heures pour contribuer √† la traduction du CMS et de son √©cosyst√®me (c≈ìur WP, sites WordPress.org, th√®mes, extensions, etc.), partout dans le monde [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3614:\"\n<p>Le <strong>WordPress Translation Day</strong> (WPTD) est un √©v√®nement mondial r√©guli√®rement organis√© par les √©quipes de traduction de WordPress. L&rsquo;objectif est de r√©unir  virtuellement toutes les √©quipes de traduction du CMS pendant 24 heures pour contribuer √† la traduction du CMS et de son √©cosyst√®me (c≈ìur WP, sites WordPress.org, th√®mes, extensions, etc.), <strong>partout dans le monde et sur tous les fuseaux horaires</strong>.</p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/04/wptd4-organize-an-event.jpg\" alt=\"\" class=\"wp-image-1332\" srcset=\"https://fr.wordpress.org/files/2019/04/wptd4-organize-an-event.jpg 768w, https://fr.wordpress.org/files/2019/04/wptd4-organize-an-event-300x120.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<span id=\"more-1328\"></span>\n\n\n\n<p>Le dernier WordPress Translation Day avait r√©uni plus de 1300 personnes sur 71 √©v√®nements organis√©s dans 29 pays diff√©rents.</p>\n\n\n\n<p>Cela avait permis de proposer plus de 93&nbsp;000 traductions pour 818 projets (th√®mes, extensions) r√©partis sur 60 langues diff√©rentes !</p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/04/wptd3-stats.png\" alt=\"\" class=\"wp-image-1331\" srcset=\"https://fr.wordpress.org/files/2019/04/wptd3-stats.png 538w, https://fr.wordpress.org/files/2019/04/wptd3-stats-231x300.png 231w\" sizes=\"(max-width: 538px) 100vw, 538px\" /></figure>\n\n\n\n<p>Les ann√©es pr√©c√©dentes, des meetups locaux avaient √©t√© organis√©s dans les villes de Toulouse, Bordeaux et Valence. Cette ann√©e nous lan√ßons un appel √† toutes les communaut√©s locales fran√ßaises et francophones pour organiser leur propre meetup local !</p>\n\n\n\n<p>Les communaut√©s locales qui disposent d&rsquo;un¬∑e ou plusieurs membres participant d√©j√† √† la traduction de WordPress sont d√©j√† en train d&rsquo;organiser leur √©v√®nement.</p>\n\n\n\n<p>Tous les meetups fran√ßais sont invit√©s √† nous rejoindre et √† organiser un √©v√®nement pour l&rsquo;occasion samedi 11 mai 2019 ! L&rsquo;objectif est de nous r√©unir pour traduire WordPress et de partager un moment en visioconf√©rence (horaire et modalit√©s encore √† d√©finir).</p>\n\n\n\n<p>Pour l&rsquo;occasion, des conf√©rences seront √©galement propos√©es en vid√©o partout dans le monde et pourront √™tre suivies en direct sur le <a href=\"https://wptranslationday.org\">site officiel de l&rsquo;√©v√®nement</a>.</p>\n\n\n\n<p>Et m√™me si vous n&rsquo;avez pas de meetup √† proximit√© de chez vous, rejoignez-nous sur le canal #traductions sur le <a href=\"http://wpfr.net/slack\">slack WordPress Fr (inscription gratuite)</a>, vous pourrez participer √† ce grand √©v√®nement et interagir avec la communaut√© le jour-J.</p>\n\n\n\n<p>Et si vous n&rsquo;avez encore jamais contribu√© √† la traduction de WordPress, de ses th√®mes et extensions, c&rsquo;est le moment id√©al de vous lancer ! N&rsquo;h√©sitez pas √† nous laisser un message sur le site de l&rsquo;√©quipe de traduction de WP en fran√ßais <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f603.png\" alt=\"üòÉ\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<ul><li><a href=\"https://fr.wordpress.org/team\">Le site de l&rsquo;√©quipe de traduction de WordPress en fran√ßais</a></li><li><a href=\"https://wptranslationday.org\">Plus d&rsquo;informations sur le site officiel du WPTD (en anglais)</a></li><li><a href=\"https://wptranslationday.org/blog/organize-a-wordpress-translation-day-4-local-event/\">Organiser un √©v√®nement local pour le WPTD4 (en anglais)</a></li></ul>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wel