rmite\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:686:\"<p><img width=\"1500\" height=\"830\" src=\"https://wpmarmite.com/wp-content/uploads/2020/04/cover-ancres.jpg\" class=\"attachment-full size-full wp-post-image\" alt=\"\" /></p>\n<p>Ok, mise en situation : vous √™tes chez vous, tranquillement install√© devant votre ordinateur, √† la recherche d‚Äôinspiration pour le design de votre blog.&nbsp; L‚Äôun des r√©sultats de Google vous...</p>\n<p>L‚Äôarticle <a rel=\"nofollow\" href=\"https://wpmarmite.com/ancre-wordpress/\">Comment cr√©er des ancres sur WordPress ?</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://wpmarmite.com\">WPMarmite</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/_dsx6WE6mmc\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://wpmarmite.com/ancre-wordpress/?utm_source=rss&#038;utm_medium=rss&%23038;utm_campaign=ancre-wordpress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:77:\"üìäWordPress 5.4 en chiffres¬†: l‚Äôinfluence des pays et entreprises sur WP\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpfr/~3/Z4WDN9IecnY/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:107:\"https://jeanbaptisteaudras.com/2020/03/wordpress-5-4-en-chiffres-linfluence-des-pays-et-entreprises-sur-wp/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 31 Mar 2020 21:44:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:636:\"\n		        L‚Äôarticle üìäWordPress 5.4 en chiffres¬†: l‚Äôinfluence des pays et entreprises sur WP provient de Jean-Baptiste Audras - CTO @ Whodunit &amp; WordPress Core Developer\nWordPress 5.4 ¬´&#160;Adderley&#160;¬ª est sorti le 31 mars 2020, notamment gr√¢ce au travail de 552 personnes qui ont contribu√© √† cette nouvelle version de notre outil de publication web pr√©f√©r√©&#160;! ü•Ç En tant que coordinateur de la documentation de WP [&#8230;]\nL‚Äôarticle üìäWordPress 5.4 en chiffres¬†: l‚Äôinfluence des pays et entreprises sur WP provient de Jean-Baptiste Audras - CTO @ Whodunit &amp; WordPress Core Developer		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"JB Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:20193:\"<p>L‚Äôarticle <a rel=\"nofollow\" href=\"https://jeanbaptisteaudras.com/2020/03/wordpress-5-4-en-chiffres-linfluence-des-pays-et-entreprises-sur-wp/\">üìäWordPress 5.4 en chiffres¬†: l‚Äôinfluence des pays et entreprises sur WP</a> provient de <a rel=\"nofollow\" href=\"https://jeanbaptisteaudras.com\">Jean-Baptiste Audras - CTO @ Whodunit &amp; WordPress Core Developer</a></p>\n\n<p><a href=\"https://wordpress.org/news/2020/03/adderley/\">WordPress 5.4 <em>¬´&nbsp;Adderley&nbsp;¬ª</em> est sorti le 31 mars 2020</a>, notamment gr√¢ce au travail de 552 personnes qui ont contribu√© √† cette nouvelle version de notre outil de publication web pr√©f√©r√©&nbsp;! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f942.png\" alt=\"ü•Ç\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<p>En tant que coordinateur de la documentation de WP 5.4, je peux dire que c&rsquo;√©tait une super exp√©rience, avec une √©quipe de coordination professionnelle et sympathique. Bravo et merci √† l&rsquo;√©quipe et aux mentors&nbsp;: Francesca, David, Sergey, Tammie, Mark, Mary, Jorge, Josepha, Jonathan, Jeff et Matt‚Ä¶ merci pour cette exp√©rience inestimable <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f64c.png\" alt=\"üôå\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"üíö\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<p>Quand WordPress 5.3 ¬´&nbsp;Kirk&nbsp;¬ª est sorti, j&rsquo;ai fait <a href=\"https://jeanbaptisteaudras.com/2019/11/distribution-of-wordpress-5-3-contributors-by-country/\">quelques statistiques et un classements par pays</a>. Pour WordPress 5.4, je suis all√© plus loin et vous trouverez dans cet article bien plus de stats&nbsp;: contributions par pays, par employeur/entreprise, ou encore le ratio entre les nouveaux contributeurs et ceux qui avaient d√©j√† contribu√© au c≈ìur WP auparavant.</p>\n\n\n\n<div class=\"schema-faq wp-block-yoast-faq-block\"><div class=\"schema-faq-section\" id=\"faq-question-1586247303757\"><strong class=\"schema-faq-question\"><strong>Comment ces donn√©es concernant WordPress 5.4 ont-elles √©t√© collect√©es¬†?</strong></strong> <p class=\"schema-faq-answer\">Avec Sergey Biryukov et Jorge Costa, nous avons travaill√© sur la g√©n√©ration des cr√©dits de WordPress 5.4. √Ä partir de cette liste, j&rsquo;ai ¬´¬†pars√©¬†¬ª la page de profil WordPress.org de chaque contributeur afin d‚Äôextraire quelques informations publiques¬†: pays, employeur, et s‚Äôil a d√©j√† contribu√© au c≈ìur WP avant. Cela concerne tout autant les contributions au c≈ìur WP faites sur Trac et les pull requests faites sur le d√©p√¥t GitHub de Gutenberg.</p> </div> <div class=\"schema-faq-section\" id=\"faq-question-1586247326006\"><strong class=\"schema-faq-question\"><strong>Est-ce que ces statistiques de WP 5.4 sont 100% pr√©cises¬†?</strong></strong> <p class=\"schema-faq-answer\">Ces stats se basent sur les informations d√©clar√©es publiquement sur le profil wp.org de chaque personne. Les utilisateurs dont les donn√©es √©taient vides n&rsquo;ont pas √©t√© pris en compte dans ces chiffres.<br />N√©anmoins, le pourcentage de personnes ayant rempli son profil √©tant important, ces donn√©es apportent tout de m√™me un √©clairage pertinent sur les ratios et sont plut√¥t repr√©sentatives de l&rsquo;ensemble.</p> </div> <div class=\"schema-faq-section\" id=\"faq-question-1586247561761\"><strong class=\"schema-faq-question\">Puis-je t√©l√©charger et r√©utiliser ces graphiques et donn√©es¬†?</strong> <p class=\"schema-faq-answer\">Oui pas de probl√®me <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60a.png\" alt=\"üòä\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /> Tous les graphiques ainsi que les jeux de donn√©es peuvent √™tre <a href=\"https://jeanbaptisteaudras.com/2019/wp-admin/post.php?post=60342&amp;action=edit#download-data\">t√©l√©charg√©s √† la fin de l&rsquo;article</a>.</p> </div> </div>\n\n\n\n<p></p>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f30d.png\" alt=\"üåç\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des pays par nombre de contributeurs</h2>\n\n\n\n<p>Ce graphique montre le nombre de pays qui ont contribu√© √† WordPress 5.4, class√©s par nombre de contributeurs.</p>\n\n\n\n<p>Sur les 48 pays qui ont contribu√© √† cette version de WordPress, les <strong>√âtats-unis</strong> ont le plus grand nombre de contributeurs (99), suivis par l‚Äô<strong>Inde</strong> (48 contributeurs). Ensuite viennent l‚Äô<strong>Allemagne</strong> avec 20, le <strong>Royaume-Uni</strong> avec 18 et ‚Äì<em>cocorico&nbsp;!</em>‚Äì la <strong>France</strong> avec 15 contributeurs.</p>\n\n\n\n<p>Les √âtats-Unis sont toujours le pays ayant le plus d&rsquo;influence sur le d√©veloppement du CMS, mais l&rsquo;Inde confirme sa seconde position (majoritairement des tickets li√©s √† la documentation du CMS, mais pas uniquement, il y a aussi beaucoup de correctifs fonctionnels). Les pays d‚ÄôEurope viennent ensuite en ordre dispers√© mais si on les additionne, on arrive √† un nombre √©quivalent aux USA.</p>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-countries-people.svg\" alt=\"\" /></figure>\n\n\n\n<p>Voici l‚Äô√©volution du top 10 des pays entre WP 5.3 et WP 5.4.</p>\n\n\n\n<figure class=\"wp-block-table is-style-regular\"><table><thead><tr><th><strong>WordPress 5.3</strong></th><th>&nbsp;</th><th><strong>WordPress 5.4</strong></th><th>&nbsp;</th></tr></thead><tbody><tr><td><strong>Pays</strong></td><td><strong>Personnes</strong></td><td><strong>Pays</strong></td><td><strong>Personnes</strong></td></tr><tr><td>USA</td><td>110</td><td>USA</td><td>99</td></tr><tr><td>Inde</td><td>63</td><td>Inde</td><td>48</td></tr><tr><td>Royaume-Uni</td><td>26</td><td>Allemagne</td><td>20</td></tr><tr><td>Allemagne</td><td>22</td><td>Royaume-Uni</td><td>18</td></tr><tr><td>Pays-bas</td><td>21</td><td>France</td><td>15</td></tr><tr><td>Australie</td><td>14</td><td>Canada</td><td>11</td></tr><tr><td>Canada</td><td>13</td><td>Pays-bas</td><td>11</td></tr><tr><td>France</td><td>11</td><td>Bangladesh</td><td>9</td></tr><tr><td>Italie</td><td>9</td><td>Italie</td><td>8</td></tr><tr><td>Japon</td><td>8</td><td>Japon</td><td>8</td></tr></tbody></table></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f30e.png\" alt=\"üåé\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des pays par nombre de contributions</h2>\n\n\n\n<p>Si au lieu de compter les contributrices et contributrices, on choisi √† la place de compter les contributions (participations √† un ticket Trac ou une issue GitHub), alors les r√©sultats sont consid√©rablement diff√©rents. Des contributeurs <strong>russes</strong> ont √©t√© cr√©dit√©s dans 558 tickets, juste devant les <strong>am√©ricains</strong> avec 538 contributions. Les <strong>n√©erlandais</strong> arrivent ensuite avec 168 contributions, les <strong>Britanniques</strong> suivent avec  114 contributions, les personnes situ√©es en <strong>Inde</strong> avec 113 contributions puis l‚Äô<strong>Alg√©rie</strong> avec 101 cr√©dits.</p>\n\n\n\n<figure class=\"wp-block-pullquote alignright is-style-solid-color small\"><blockquote><p>Notons que <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a> (lead technique de WordPress 5.4) a √©t√© cr√©dit√© 555 fois&nbsp;! Cela explique pourquoi la russie est devant. Je me demande presque si n&rsquo;aurions pas du renommer WordPress en SergeyPress 1.0‚Ä¶ <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f602.png\" alt=\"üòÇ\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p></blockquote></figure>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-country-contributions.svg\" alt=\"\" /></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"üíö\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des entreprises par nombre de contributeurs</h2>\n\n\n\n<p>Sur les 163 entreprises employant des personnes qui ont contribu√© √† WordPress 5.4, c&rsquo;est <strong>Automattic</strong> qui a de loin le plus grand nombre de contributeurs, avec 52 personnes cr√©dit√©es dans la version 5.4. Sept autres entreprises ont plus de 2 personnes ayant √©t√© cr√©dit√©es&nbsp;: <strong>Yoast</strong> avec 7 personnes, <strong><a href=\"https://whodunit.fr\">Whodunit</a></strong> ‚Äì&nbsp;mon employeur&nbsp;‚Äì avec 6 personnes, <strong>Human Made</strong> (6), <strong>10up</strong> (5), <strong>Google</strong> (4), <strong>Bluehost</strong> (4), et enfin <strong>WPMU Dev</strong> (3).</p>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-employer-people.svg\" alt=\"\" /></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49c.png\" alt=\"üíú\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des entreprises par nombre de contributions</h2>\n\n\n\n<p><strong>Automattic</strong> est la soci√©t√© la plus prolifique avec des employ√©s cr√©dit√©s dans pas moins de 754 tickets, mais elle est suivie de pr√®s par <strong>Yoast</strong> avec 601 tickets.</p>\n\n\n\n<p>Il y a trois autres entreprises apparaissant dans plus de 60 tickets&nbsp;: il s‚Äôagit de <strong>Bluehost</strong> (70), <strong>Whodunit</strong> (67) et <strong>Human Made</strong> (67).</p>\n\n\n\n<p>Automattic (√©diteur de la plateforme de blogging WordPress.com) et Yoast (√©diteur de l‚Äôextension du m√™me nom) sont donc les deux soci√©t√©s ayant eu l&rsquo;influence la plus importante sur le contenu de la version 5.4 de WordPress. Elles sont suivies par un h√©bergeur et deux agences web. Plus loin dans le classement, on retrouve l‚Äôagence 10up, les √©diteurs WPMU Dev et iThemes ou encore Google, qui laisse petit √† petit son empreinte sur le CMS.</p>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-employer-contributions.svg\" alt=\"\" /></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f423.png\" alt=\"üê£\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Ratio entre nouveaux contributeurs et contributeurs core r√©guliers</h2>\n\n\n\n<p>J‚Äôai aussi essay√© de voir quel √©tait le ratio entre les personnes ayant propos√© leurs premi√®res contributions au c≈ìur WordPress et celles qui avait d√©j√† contribu√© au CMS sur des versions pr√©c√©dentes.</p>\n\n\n\n<p>Les nouveaux contributrices et contributeurs repr√©sentent un tiers des personnes ayant particip√© √† WordPress 5.4, avec 168 people qui ont fait leur premi√®re contribution au c≈ìur du CMS pour cette version&nbsp;! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f389.png\" alt=\"üéâ\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"üíö\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<p>Ils ont √©t√© cr√©dit√©s en tout sur un petit 10% du nombre total de tickets, et les contributeurs r√©guliers repr√©sentent plus de 90% de l&rsquo;ensemble. Cela est plut√¥t normal, compte-tenu du fait que les nouveaux sont par d√©finition en train d&rsquo;exp√©rimenter la contribution, il est logique que la quantit√© de tickets sur lesquels ils soient impliqu√©s soit moins √©lev√©e <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60c.png\" alt=\"üòå\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<div class=\"wp-block-columns alignwide\">\n<div class=\"wp-block-column\">\n<h3>Nombre de nouveaux contributeurs par rapport aux contributeurs r√©guliers</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-new-people.svg\" alt=\"\" /></figure>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<h3>Nombre de contributions venant de nou