meilleures pratiques pour maximiser le SEO et la vitesse des pages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpfr/~3/ejRwhzDv3XM/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://kinsta.com/fr/blog/redirections-wordpress/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 09 Apr 2020 15:32:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:330:\"\n		        Lorsque vous remaniez un site web ou que vous mettez √† jour un ancien contenu, il est probable que la structure de vos URLs soit modifi√©e. ...\nThe post Redirections WordPress : Les meilleures pratiques pour maximiser le SEO et la vitesse des pages appeared first on H√©bergement WordPress infog√©r√© Kinsta.		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Kinsta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:36660:\"<p>Lorsque vous remaniez un site web ou que vous mettez √† jour un ancien contenu, il est probable que la structure de vos URLs soit modifi√©e. Et si vous ne suivez pas les meilleures pratiques de redirection de WordPress, vous risquez d&rsquo;avoir un impact n√©gatif sur l&rsquo;exp√©rience utilisateur (UX) et sur votre r√©f√©rencement <a href=\"https://kinsta.com/fr/blog/que-veut-dire-referencement-seo/\">(SEO)</a>.</p>\n<p>La fonctionnalit√© de redirection de WordPress int√©gr√©e √† la plateforme de base est con√ßue pour rep√©rer les URLs incorrectes. C&rsquo;est-√†-dire que lorsqu&rsquo;une mauvaise URL est demand√©e, WordPress essaie de localiser la bonne URL et redirige le visiteur si c&rsquo;est le cas.</p>\n<p>Dans cet article, nous expliquerons l&rsquo;importance des redirections WordPress et comment elles influencent la vitesse des pages et, bien s√ªr, le r√©f√©rencement. Nous discuterons √©galement de la mani√®re dont vous pouvez minimiser les redirections dans WordPress et nous vous guiderons √† travers les diff√©rentes solutions que vous pouvez utiliser pour les mettre en place.</p>\n<aside id=\"sidebar-cta-mini\">\n  <div id=\"sidebar-cta-mini-aligner\">\n    <div class=\"cta-mini cta-mini--floating\">\n      <div class=\"cta-mini--light\">\n				\n				\n				<div id=\"js-mykinsta-video\" class=\"wistia_embed wistia_async_vzsjfur4md popover=true popoverAnimateThumbnail=true videoFoam=true popoverPreventScroll=true responsive-video\" style=\"background-image: url(https://kinsta.com/fr/wp-content/themes/kinsta/images/mykinsta-dashboard-v8@2x.jpg)\"></div>\n        <a class=\"button button--purple button--small\" href=\"https://demo.kinsta.com/register?utm_campaign=mykinsta%20demo&#038;utm_source=blog&#038;utm_medium=sidebar%20video%20button\">Essayer la d√©mo gratuite</a>\n      </div>\n    </div>\n  </div>\n</aside>\n\n<p>Commen√ßons !</p>\n		<aside class=\"toc pb--50 pt--50 mt--50 mb--50\" data-heading=\"Table des mati√®res\" data-exclude=\"last\" data-list-style=\"arrow\" data-count-number=\"-1\" data-selector=\"h2\"></aside>\n		\n<h2>Une introduction aux redirections WordPress</h2>\n<p>Le noyau de WordPress est dot√© d&rsquo;une fonctionnalit√© de redirection destin√©e √† aider √† d√©tecter et √† corriger les URLs incorrectes. Si quelqu&rsquo;un demande une URL incorrecte, WordPress tente de localiser la bonne et redirige ensuite le visiteur si cela a r√©ussi.</p>\n<p>Disons que vous avez une page qui se trouve sur ¬´¬†http://www.exemple.com/parent/page¬†¬ª<em>. </em>Si vous saisissez ¬´¬†http://exemple.com/page¬†¬ª dans votre navigateur, en g√©n√©ral, WordPress est assez intelligent pour localiser automatiquement la bonne page vers laquelle vous serez redirig√©.</p>\n<p>Malheureusement, <strong>ce n&rsquo;est pas toujours aussi simple</strong>. Si vous configurez votre site web pour qu&rsquo;il utilise HTTPS (de mani√®re √† forcer tout le trafic √† √™tre redirig√© de l&rsquo;URL pr√©fix√©e <a href=\"https://kinsta.com/fr/base-de-connaissances/rediriger-http-vers-https/\">HTTP vers HTTPS</a>), le processus de redirection devient plus complexe.</p>\n<p>Par exemple, imaginez qu&rsquo;un visiteur tente d&rsquo;acc√©der √† la page web ¬´¬†https://www.exemple.com/parent/page¬†¬ª en saisissant ¬´¬†http://exemple.com/page¬†¬ª dans la barre d&rsquo;adresse. Le processus se d√©roulerait comme suit :</p>\n<ul>\n<li>Premi√®rement, le visiteur est redirig√© de HTTP vers HTTPS.</li>\n<li>Deuxi√®mement, le visiteur est redirig√© lorsque ¬´¬†www¬†¬ª est ajout√© √† l&rsquo;URL.</li>\n<li>Troisi√®mement, le visiteur est redirig√© vers la formulation de l&rsquo;URL qui inclut la page m√®re dans le chemin.</li>\n<li>Enfin, le serveur commence √† envoyer les fichiers et les ressources du site web au navigateur du visiteur.</li>\n</ul>\n<p>Vous pourriez penser : ¬´¬†C&rsquo;est g√©nial ! Je peux massacrer un lien et le visiteur finira quand m√™me l√† o√π il est cens√© √™tre¬†¬ª. Dans un sens, vous auriez raison de penser cela. WordPress est tr√®s bon pour d√©terminer o√π les URLs sont cens√©es se r√©soudre, ce qui signifie que les URLs mal saisies se r√©solvent souvent correctement.</p>\n<p>Cependant, toute cette auto-redirection a aussi un revers.</p>\n\n<h2>Comment les redirections WordPress impactent la vitesse de chargement des pages</h2>\n<p>Une fois que l&rsquo;on se rend compte √† quel point WordPress est r√©sistant, il est facile de se faire pi√©ger en n√©gligeant la formulation des URLs. Cela est particuli√®rement dangereux si vous saisissez manuellement les URLs dans les liens en ligne et les <a href=\"https://kinsta.com/fr/blog/plugins-menu-wordpress/\">menus personnalis√©s</a>.</p>\n<p>Ce n&rsquo;est pas grave, n&rsquo;est-ce pas ? Les visiteurs se retrouvent quand m√™me √† la bonne URL ! Bien que cela soit vrai en th√©orie, <strong>ce que vous n√©gligez, c&rsquo;est l&rsquo;impact des redirections sur la vitesse de chargement des pages</strong>.</p>\n<p>Jetons un coup d&rsquo;≈ìil sur le r√©sultat de la vitesse des pages <a href=\"https://kinsta.com/fr/blog/test-vitesse-pingdom/\">Pingdom</a> pour un site WordPress. Ce test est bas√© sur l&rsquo;acc√®s √† une page en utilisant une URL correctement formul√©e, afin d&rsquo;√©viter toute redirection :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 736px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-redirects-example-2.png\" alt=\"Un r√©sultat de test Pingdom avec une URL correctement form√©e\" width=\"736\" height=\"243\" /><p class=\"wp-caption-text\">Un r√©sultat de test Pingdom avec une URL correctement form√©e</p></div>\n<p>Ce n&rsquo;est pas mal du tout. Si nous examinons les requ√™tes de fichiers, nous constatons qu&rsquo;il n&rsquo;y a pas de redirection lorsque le site est demand√© :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1097px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-requete-2.png\" alt=\"Une requ√™te de fichier Pingdom\" width=\"1097\" height=\"76\" /><p class=\"wp-caption-text\">Une requ√™te de fichier Pingdom</p></div>\n<p>Que se passe-t-il donc si nous nous trompons d&rsquo;URL et que nous refaisons le test ?</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 739px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-resultat-formee-1-1.png\" alt=\"Un r√©sultat de test Pingdom avec une URL mal form√©e\" width=\"739\" height=\"241\" /><p class=\"wp-caption-text\">Un r√©sultat de test Pingdom avec une URL mal form√©e</p></div>\n<p>Cela ajoute pr√®s de 100 millisecondes au temps de chargement des pages. Bien que cela puisse sembler sans importance puisque ce site est d√©j√† assez rapide, regardons les requ√™tes de fichiers pour voir ce qui s&rsquo;est pass√© :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1113px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-requete-1-1.png\" alt=\"Une mauvaise URL de requ√™te de fichier\" width=\"1113\" height=\"114\" /><p class=\"wp-caption-text\">Une mauvaise URL de requ√™te de fichier</p></div>\n<p>Une redirection a √©t√© ajout√©e au d√©but de l&rsquo;URL. Apr√®s les redirections, la page se charge normalement. Nous pouvons donc attribuer la vitesse plus lente de la page √† la redirection qui se produit lorsque l&rsquo;URL incorrecte est introduite dans le test.</p>\n<p>En fin de compte, cette redirection impacte la <a href=\"https://kinsta.com/fr/apprendre/accelerer-wordpress/\">vitesse de chargement de page</a> ce qui est pr√©judiciable. La diff√©rence peut √™tre significative et mesurable.</p>\n<h2>Comment les redirections de WordPress affectent le SEO de votre site</h2>\n<p>Si vous avez une compr√©hension de base du r√©f√©rencement, vous connaissez probablement le r√¥le important que les liens jouent dans ce domaine. Si une URL renvoie √† une page qui n&rsquo;existe plus, ou a √©t√© transf√©r√©e vers un autre lien qui a √©t√© d√©plac√©, vos visiteurs peuvent rencontrer une <a href=\"https://kinsta.com/fr/blog/erreur-404-not-found/\">erreur de page 404</a> :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 904px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/404-erreur-1.png\" alt=\"Une page d\'erreur 404 dans Chrome\" width=\"904\" height=\"365\" /><p class=\"wp-caption-text\">Une page d&rsquo;erreur 404 dans Chrome</p></div>\n<p>En plus d&rsquo;une mauvaise exp√©rience utilisateur, une <a href=\"https://kinsta.com/fr/blog/erreur-404-not-found/\">erreur 404 ¬´¬†page non trouv√©e¬†¬ª</a> peut √©galement vous nuire du point de vue du r√©f√©rencement. Ces erreurs 404 sont le r√©sultat de <a href=\"https://kinsta.com/fr/blog/liens-casses/\">liens bris√©s</a>, qui affectent la capacit√© des <a href=\"https://kinsta.com/fr/blog/moteurs-recherche-alternatifs/\">moteurs de recherche</a> √† explorer votre site web et √† localiser ses pages.</p>\n<p>Cela indique aux moteurs de recherche que les utilisateurs sont non seulement capables de trouver ce qu&rsquo;ils cherchent, mais aussi que <a href=\"https://kinsta.com/fr/blog/sitelinks-google/\">l&rsquo;architecture de votre site</a> est m√©diocre et d√©pass√©e.</p>\n<p>Il est donc essentiel de mettre en place des redirections pour les pages dont l&rsquo;URL a √©t√© modifi√©e. Si vous <a href=\"https://kinsta.com/fr/blog/changer-votre-domaine-wordpress/\">d√©placez votre site vers un nouveau domaine</a>, la configuration des redirections de WordPress peut faire en sorte que les robots des moteurs de recherche soient toujours capables d&rsquo;indexer les nouvelles URLs du site, tout en √©liminant simultan√©ment les anciennes de l&rsquo;index.</p>\n<p>Les redirections peuvent √©galement contribuer √† garantir que le jus du lien sera transmis de votre ancien domaine √† votre nouveau et au sein de vos propres pages. Cependant, il est important de noter que seuls certains <a href=\"https://kinsta.com/fr/blog/codes-statut-http/\">codes de redirection HTTP</a> transmettront votre classement dans les moteurs de recherche.</p>\n<h3>Les diff√©rents types de redirections d‚ÄôURL</h3>\n<p>En tant qu&rsquo;<a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-wordpress/\">utilisateur de WordPress</a>, le type de redirection le plus courant auquel vous aurez affaire (et le meilleur pour le r√©f√©rencement) est une redirection 301. Elle est utilis√©e pour les contenus qui ont √©t√© d√©plac√©s de fa√ßon permanente.</p>\n<p>Les redirections 301 indiquent aux moteurs de recherche que la page √† laquelle vous souhaitez envoyer des visiteurs a chang√© ou a √©t√© d√©plac√©e et passe entre 90 et 99 % du jus de lien. Dans la plupart des cas, ce type de redirection aura pour effet que les moteurs de recherche transmettront la majorit√© du contenu du lien (ou de l&rsquo;autorit√© de la page) √† la nouvelle page ou √† la page mise √† jour.</p>\n<p><a href=\"https://kinsta.com/fr/blog/codes-statut-http/\">D&rsquo;autres types de redirections c√¥t√© serveur sont √©galement possibles</a> :</p>\n<ul>\n<li><strong>302</strong>. Cette redirection temporaire informe les moteurs de recherche que la page est d√©plac√©e, mais pas de fa√ßon permanente. Elle ne transmet pas le jus de lien comme le fait une redirection 301.</li>\n<li><strong>303</strong>. Ce type de redirection temporaire est utilis√© pour √©viter que les pages qui stockent des donn√©es ne soient rafra√Æchies ou mises en favoris (<a href=\"https://kinsta.com/fr/blog/passerelles-paiement-woocommerce/\">formulaires de paiement</a>, pages d‚Äôatterrissage, etc.). De cette fa√ßon, les utilisateurs ne peuvent pas soumettre √† nouveau les formulaires apr√®s avoir appuy√© sur le bouton ¬´¬†retour¬†¬ª de leur navigateur. Ces redirections n&rsquo;influencent pas le r√©f√©rencement.</li>\n<li><strong>307</strong>. Une redirection 307 est similaire √† une redirection 303, en ce sens qu&rsquo;elle ne doit √™tre utilis√©e que pour une page temporairement d√©plac√©e. Cependant, une redirection 302 est g√©n√©ralement la m√©thode pr√©f√©r√©e.</li>\n<li><strong>308</strong>. Une redirection 308 est une redirection permanente, donc elle transmet le jus de lien et l&rsquo;autorit√© de la page. Comme la pr√©c√©dente redirection, cependant, ses effets sur le r√©f√©rencement ne sont pas bien connus. Dans la plupart des cas, il est pr√©f√©rable d&rsquo;utiliser une redirection 301.</li>\n</ul>\n<p>Comme nous l&rsquo;avons dit, tous les √©l√©ments ci-dessus sont consid√©r√©s comme des redirections c√¥t√© serveur.</p>\n<p>Il existe √©galement des redirections c√¥t√© client, qui sont d√©clench√©es lorsque le navigateur d&rsquo;un utilisateur g√®re la redirection ou le transfert. Cependant, ces derni√®res ne sont pas fiables et doivent √™tre √©vit√©es.</p>\n<p>Les redirections c√¥t√© serveur sont le meilleur moyen de s&rsquo;assurer que les moteurs de recherche peuvent rapidement comprendre les redirections et transf√©rer votre jus SEO de mani√®re appropri√©e.</p>\n<h2>Rediriger ou ne pas rediriger ?</h2>\n<p>Les redirections existent pour une raison. Elles vous permettent d&rsquo;envoyer des visiteurs depuis un contenu obsol√®te et des URLs inexistantes vers un contenu mis √† jour. Nous avons d√©j√† couvert l&rsquo;angle des URLs inexistantes dans une certaine mesure. WordPress fait un peu cela tout seul.</p>\n<p>Cependant, WordPress ne peut pas tout attraper, et il y a des moments o√π des r√®gles de redirection manuelle sont n√©cessaires.</p>\n<p>Par exemple, disons que vous avez √©crit un article intitul√© ¬´¬†What&rsquo;s Brand New in WordPress¬†¬ª √† l&rsquo;√©poque de la sortie de WordPress 3.0. C&rsquo;√©tait un excellent article en 2010, mais les internautes qui cherchent ¬´¬†ce qu&rsquo;il y a de neuf dans WordPress¬†¬ª aujourd&rsquo;hui en 2020 veulent des informations plus r√©centes. Vous voulez garder ces lecteurs heureux, alors <a href=\"https://kinsta.com/fr/blog/conseils-relecture/\">vous r√©digez un nouvel article</a> sur les fonctionnalit√©s incluses dans une prochaine version de WordPress.</p>\n<p>Dans ce sc√©nario, une r√©orientation de l&rsquo;ancien article vers le nouvel article est parfaitement acceptable et appropri√©e. En outre, dans ce cas, une redirection est une <a href=\"https://kinsta.com/blog/wordpress-seo\">bonne pratique de r√©f√©rencement</a>. Le jus de lien attribu√© √† l&rsquo;ancien article sera plut√¥t transmis √† votre nouvel article, ce qui lui donnerait un poids instantan√© dans les moteurs de recherche.</p>\n<p>Il existe plusieurs sc√©narios dans lesquels les redirections sont appropri√©es, notamment</p>\n<ul>\n<li>Vous avez publi√© un contenu mis √† jour et vous voulez √©loigner les visiteurs de l&rsquo;ancienne version.</li>\n<li>Vous avez remani√© <a href=\"https://kinsta.com/fr/blog/reecriture-url-permaliens-wordpress/\">la structure des permaliens d‚Äôun</a> <a href=\"https://kinsta.com/fr/blog/reecriture-url-permaliens-wordpress/\">site web</a> et devez rediriger les anciennes URL vers leur nouvelle structure.</li>\n<li>Vous mettez √† jour une page ou un article publi√© et souhaitez rediriger temporairement le trafic vers un autre article ou une autre page pendant que vous travaillez sur la mise √† jour.</li>\n</ul>\n<h3>Quand ne pas rediriger</h3>\n<p>Dans tous les sc√©narios ci-dessus, des <strong>redirections sont n√©cessaires</strong> pour envoyer les visiteurs d&rsquo;un contenu obsol√®te et d&rsquo;URLs bris√©es vers un contenu mis √† jour. Elles sont √©galement utiles comme mesure temporaire pendant qu&rsquo;un contenu sp√©cifique est mis √† jour.</p>\n<p>Alors, quand n&rsquo;est-il <em>pas</em> appropri√© d&rsquo;utiliser une redirection WordPress ? Par exemple, si vous avez construit un <a href=\"https://kinsta.com/fr/blog/plugins-menu-wordpress/\">menu personnalis√©</a> en utilisant des URLs qui n&rsquo;incluent pas ¬´¬†www¬†¬ª, mais que l&rsquo;URL de votre site se r√©sout avec le sous-domaine ¬´¬†www¬†¬ª au d√©but de l&rsquo;URL, vous faites une erreur.</p>\n<p>L&rsquo;utilisation de redirections dans ce sc√©nario n&rsquo;est pas appropri√©e et nuit √† <a href=\"https://kinsta.com/fr/apprendre/vitesse-de-site/\">la vitesse</a> et au SEO de votre site.</p>\n<h2>Comment r√©duire les redirections dans WordPress</h2>\n<p>Si vous √™tes convaincu de la n√©cessit√© de r√©duire les redirections dans WordPress, il y a deux choses importantes √† faire.</p>\n<h3>1. Ne jamais cr√©er de redirections non n√©cessaires</h3>\n<p>La premi√®re chose √† retenir est de ne jamais cr√©er intentionnellement des redirections inutiles. Par exemple, vous ne devez pas cr√©er de redirections lorsque vous cr√©ez des liens et des menus internes.</p>\n<p>Si vous avez pris l&rsquo;habitude de saisir les URL paresseusement, il est pr√©f√©rable de repenser votre fa√ßon de travailler. Au contraire, lorsque vous cr√©ez une URL, assurez-vous que vous :</p>\n<ul>\n<li>Utilisez le pr√©fixe de protocole appropri√© (HTTP ou HTTPS).</li>\n<li>Incluez ou excluez le sous-domaine ¬´¬†www¬†¬ª selon le cas.</li>\n<li>N&rsquo;utilisez pas les IDs d‚Äôarticle et de page dans les liens.</li>\n<li>Incluez le chemin d&rsquo;acc√®s complet √† la page ou √† l&rsquo;article.</li>\n</ul>\n<p>Le pouvoir de redirection int√©gr√© dans WordPress est cens√© √™tre un moyen de secours, au cas o√π vous cr√©eriez accidentellement une mauvaise URL. Ce n&rsquo;est pas une solution tr√®s fiable pour les URL paresseuses en g√©n√©ral.</p>\n<h3>2. Assurez-vous que votre domaine de premier niveau (TLD) ne soit pas redirig√© plus d&rsquo;une fois</h3>\n<p>La deuxi√®me chose que vous pouvez faire pour minimiser l&rsquo;occurrence des redirections de WordPress est de vous assurer que votre <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-qu-un-tld/\">domaine de premier niveau (TLD)</a> se r√©sout avec pas plus d&rsquo;une redirection. Votre objectif est de vous assurer que la bonne URL est atteinte par une seule redirection ou moins, quelle que soit la combinaison de pr√©fixe de protocole et de sous-domaine qu&rsquo;un visiteur lance devant le TLD.</p>\n<p>Prenons un exemple. Toutes les URLs suivantes devraient se r√©soudre au TLD avec au maximum une redirection et l&rsquo;une d&rsquo;entre elles devrait se r√©soudre sans redirection :</p>\n<ul>\n<li>http://exemple.com</li>\n<li>http://www.exemple.com</li>\n<li>https://exemple.com</li>\n<li>https://www.exemple.com</li>\n</ul>\n<p>Si vous n&rsquo;√™tes pas s√ªr du nombre de redirections n√©cessaires pour r√©soudre l&rsquo;URL de votre site en utilisant ces diff√©rentes combinaisons de pr√©fixes de protocole et de <a href=\"https://kinsta.com/fr/blog/sous-domaine-wordpress/\">sous-domaines</a>, vous pouvez le v√©rifier en utilisant le <a href=\"https://varvy.com/tools/redirects/\">mappeur de redirection de Patrick Sexton</a> :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1600px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/redirect-mapper-1-1.png\" alt=\"L\'outil Redirect mapper\" width=\"1600\" height=\"624\" /><p class=\"wp-caption-text\">L&rsquo;outil Redirect mapper</p></div>\n<p>Vous trouverez ci-dessous un exemple de la mani√®re dont les redirections qui ne sont pas correctement configur√©es sont facilement rep√©rables gr√¢ce √† ce mappeur de redirection :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1084px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/mal-redirections-configurees-1.png\" alt=\"Redirections mal configur√©es\" width=\"1084\" height=\"420\" /><p class=\"wp-caption-text\">Redirections mal configur√©es</p></div>\n<p>Vous pouvez voir qu&rsquo;il y a des redirections en double dans la version ¬´¬†www¬†¬ª du domaine. √Ä l&rsquo;inverse, voici un exemple de redirections correctement mises en place :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 955px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/place-correctement-redirections-1.png\" alt=\"Redirections correctement mises en place\" width=\"955\" height=\"296\" /><p class=\"wp-caption-text\">Redirections correctement mises en place</p></div>\n<p>Comme vous pouvez le voir, il n&rsquo;y a qu&rsquo;une seule redirection qui se produit √† la fois pour les ¬´¬†www¬†¬ª et les ¬´¬†non www¬†¬ª.</p>\n<p>Si vous constatez que certaines de ces combinaisons ne se r√©solvent pas (renvoi d&rsquo;un <a href=\"https://kinsta.com/fr/blog/codes-statut-http/\">code de statut de serveur 404</a>) ou n√©cessitent plus d&rsquo;une redirection pour √™tre r√©solues, il est temps de se mettre au travail.</p>\n<h2>Mise en place de redirections au niveau du serveur</h2>\n<p>Une m√©thode que vous pouvez utiliser pour configurer une redirection WordPress est d&rsquo;ajouter une ou plusieurs r√®gles de redirection √† votre serveur. Cela permettra aux visiteurs d&rsquo;arriver le plus rapidement possible √† la bonne formulation d&rsquo;URL de votre site.</p>\n<p>L&rsquo;objectif de base que vous essayez d&rsquo;atteindre est de cr√©er des r√®gles de redirection qui ciblent toute formulation d&rsquo;URL n√©cessitant plus d&rsquo;une redirection. Vous voulez forcer ces URLs √† se r√©soudre directement √† l&rsquo;URL correctement formul√©e.</p>\n<p>Par exemple, si l&rsquo;URL ¬´¬†http://exemple.com¬†¬ª n√©cessite deux redirections pour arriver √† ¬´¬†https://www.exemple.com¬†¬ª, vous pouvez cr√©er une redirection manuelle qui permet de le faire en une seule √©tape (au lieu de deux).</p>\n<h3>R√®gles de redirection dans Apache</h3>\n<p>Si votre site est h√©berg√© sur une <a href=\"https://en.wikipedia.org/wiki/LAMP_(software_bundle)\">pile LAMP</a> standard, vous devrez ajouter des r√®gles de r√©√©criture d&rsquo;URL au <a href=\"https://kinsta.com/fr/base-de-connaissances/fichier-htaccess-wordpress/\">fichier</a><a href=\"https://kinsta.com/fr/base-de-connaissances/fichier-htaccess-wordpress/\"> .htaccess de</a> votre site<a href=\"https://kinsta.com/fr/base-de-connaissances/fichier-htaccess-wordpress/\">.</a> La mise en place d&rsquo;une redirection WordPress via un fichier de configuration de serveur web est un processus technique et peut √™tre compliqu√©.</p>\n<p>Par cons√©quent, n&rsquo;utilisez cette m√©thode que si vous √™tes √† l&rsquo;aise pour modifier votre fichier <em>.htaccess. </em>M√™me si vous l&rsquo;√™tes, il est toujours bon de <a href=\"https://kinsta.com/fr/base-de-connaissances/comment-sauvegarder-base-de-donnees-mysql-avec-phpmyadmin/\">d‚Äôabord cr√©er une sauvegarde</a> du fichier.</p>\n<p>Ensuite, la premi√®re √©tape consiste √† se connecter √† votre installation WordPress √† l&rsquo;aide d&rsquo;un <a href=\"https://kinsta.com/fr/blog/meilleurs-clients-ftp/\">client FTP,</a> ou par le biais <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-cpanel/\">du gestionnaire de fichiers du</a> <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-cpanel/\">cPanel</a> de votre h√©bergement. Vous pouvez localiser le fichier<em> .htaccess</em> dans le r√©pertoire racine de votre site WordPress.</p>\n<p>Pour mettre en place une redirection 301, vous devrez sp√©cifier les anciens et nouveaux emplacements d&rsquo;URL avec une structure syntaxique qui ressemble √† ceci :</p>\n<p><code>Redirect 301 \"old-page\" \"new-page\"</code></p>\n<p>Si vous souhaitez rediriger tout le trafic de votre site de <a href=\"https://stackoverflow.com/questions/13977851/htaccess-redirect-to-https-www\">HTTP vers HTTPS</a>, vous pouvez utiliser les moyens suivants</p>\n<pre><code class=\"language-apacheconf\">&lt;IfModule mod_rewrite.c&gt;\n\nRewriteEngine On\nRewriteCond !{HTTPS} off\nRewriteRule ^(.*)$ https://www.%{HTTP_HOST}%{REQUEST_URI} [L,R=301]\nRewriteCond %{HTTP_HOST} !^www\\.\nRewriteRule ^(.*)$ https://www.%{HTTP_HOST}%{REQUEST_URI} [L,R=301]\n\n&lt;/IfModule&gt;</code></pre>\n<p>Gardez √† l&rsquo;esprit qu&rsquo;avant de faire cela, il est important de vous assurer que votre <a href=\"https://kinsta.com/fr/base-de-connaissances/comment-installer-un-certificat-ssl/\">certificat SSL </a>est correctement configur√© sur le nouveau site WordPress.</p>\n<h3>R√®gles de redirection dans Nginx</h3>\n<p>Si vous utilisez une <a href=\"https://kinsta.com/knowledgebase/htaccess/\">configuration d&rsquo;h√©bergement plus avanc√©e</a>, il y a de fortes chances qu&rsquo;elle soit <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-nginx/\">propuls√©e par Nginx</a> plut√¥t que par <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-qu-apache/\">Apache</a>. Dans ce cas, les choses ne sont pas aussi simples.</p>\n<p>Si vous √™tes un <a href=\"https://kinsta.com/fr/plans/\">utilisateur de Kinsta</a>, n&rsquo;h√©sitez pas √† passer √† la section suivante.</p>\n<p>La configuration de la redirection varie d&rsquo;un h√©bergeur √† l&rsquo;autre et vous devrez contacter le support de votre h√©bergeur pour r√©soudre le probl√®me de redirection.</p>\n<p>Cependant, si vous avez confiance en vos capacit√©s, vous pouvez cr√©er une redirection dans Nginx en cr√©ant un bloc serveur pour le contenu que vous souhaitez rediriger, en utilisant le code suivant :</p>\n<pre><code class=\"language-nginx\">server {\n	listen 80;\n	server_name domain1.com;\n	return 301 $scheme://domain2.com$request_uri;\n}</code></pre>\n<p>Dans la directive ci-dessus, le terme ¬´¬†return¬†¬ª est utilis√© pour une substitution d&rsquo;URL. Il renvoie le code de statut sp√©cifi√© dans l&rsquo;URL de redirection. La variable ¬´¬†$scheme¬†¬ª utilise le sch√©ma de la requ√™te http/https originale et renvoie le code de redirection 301 avec la nouvelle URL.</p>\n<p>Une autre option est d&rsquo;utiliser :</p>\n<pre><code class=\"language-nginx\">rewrite ^/$ http://www.domain2.com permanent;\nrewrite ^/(.*)$ http://www.domain2.com/$1 permanent;\n</code></pre>\n<p>Cela peut √™tre utilis√© pour cr√©er une redirection permanente. Pour des informations plus d√©taill√©es, vous pouvez consulter les conseils de F5 Network sur la <a href=\"https://www.nginx.com/blog/creating-nginx-rewrite-rules/\">cr√©ation de r√®gles de r√©√©criture Nginx</a>.</p>\n<h4>R√®gles de redirection dans MyKinsta</h4>\n<p>Si votre site est h√©berg√© par Kinsta, <strong>il est facile de mettre en place des redirections</strong>. Vous pouvez utiliser notre <a href=\"https://kinsta.com/fr/base-de-connaissances/regles-redirection/\">outil de r√®gles de redirection</a> dans MyKinsta pour cr√©er des redirections 301 et 302.</p>\n<p>Apr√®s vous √™tre connect√© √† votre MyKinsta, cliquez sur votre site et allez sur <strong>Redirections</strong>, puis sur <strong>Ajouter une r√®gle de redirection</strong> :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1914px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/redirection-regle-mykinsta.png\" alt=\"Ajouter ne r√®gle de redirection dans MyKinsta\" width=\"1914\" height=\"1066\" /><p class=\"wp-caption-text\">Ajouter ne r√®gle de redirection dans MyKinsta</p></div>\n<p>Ensuite, sur l&rsquo;√©cran de d&rsquo;<strong>ajout de r√®gle de redirection</strong>, vous pouvez choisir le pr√©fixe de domaine pour lequel ajouter la redirection. En g√©n√©ral, vous voudrez rediriger √† la fois le trafic www et non www, auquel cas vous choisirez <strong>Tous les domaines</strong> :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 900px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/kinsta-redirection-regle-1.png\" alt=\"L\'√©cran ¬´ Ajouter une r√®gle de redirection ¬ª dans MyKinsta.\" width=\"900\" height=\"526\" /><p class=\"wp-caption-text\">L&rsquo;√©cran ¬´ Ajouter une r√®gle de redirection ¬ª dans MyKinsta.</p></div>\n<p>Une fois que c&rsquo;est clair, vous devrez alors remplir les champs <strong>Rediriger de</strong> et <strong>Rediriger vers</strong>.</p>\n<p>Sous le <strong>code de statut HTTP</strong>, vous pouvez facilement choisir le type de r√®gle de redirection que vous souhaitez utiliser : 301 ou 302. Lorsque vous √™tes satisfait de votre choix, cliquez sur <strong>Ajouter une r√®gle de redirection</strong>.</p>\n<p>Gardez √† l&rsquo;esprit que, comme notre outil de redirection utilise automatiquement regex, vous devez ajouter ¬´¬†^¬†¬ª avant chaque chemin ¬´¬†de¬†¬ª. Cela l&#8217;emp√™chera de cr√©er une boucle de redirection avec d&rsquo;autres URL. Bien que cet outil soit assez simple, vous pouvez toujours contacter le support si vous avez des questions ou si vous avez besoin d&rsquo;aide.</p>\n<p>L&rsquo;ajout de redirections dans MyKinsta signifie que les r√®gles sont mises en ≈ìuvre au niveau du serveur, ce qui est la mani√®re optimale. Cependant, il existe √©galement des extensions WordPress avec lesquelles vous pouvez mettre en place des redirections pour les sites WordPress.</p>\n<p>Avant d&rsquo;examiner de plus pr√®s les extensions de redirection, il est important de noter que leur utilisation peut parfois causer des probl√®mes de performance. La plupart d&rsquo;entre eux utilisent la <a href=\"https://developer.wordpress.org/reference/functions/wp_redirect/\">fonction wp_redirect</a>, qui n√©cessite une ex√©cution de code et des ressources suppl√©mentaires.</p>\n<h2>Cr√©er une redirection WordPress avec une extension</h2>\n<p>Si votre h√©bergeur ne dispose pas d&rsquo;une fonction de r√®gles de redirection, vous devrez peut-√™tre utiliser une extension WordPress. De nombreuses extensions de redirection sont disponibles et <a href=\"https://wordpress.org/plugins/redirection/\">Redirection</a> est l&rsquo;une des plus populaires que vous pouvez utiliser :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1600px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/wordpress-redirection-plugin-1.jpg\" alt=\"L‚Äôextension WordPress Redirection\" width=\"1600\" height=\"516\" /><p class=\"wp-caption-text\">L‚Äôextension WordPress Redirection</p></div>\n<p>Cette extension est tr√®s facile √† utiliser et peut √™tre configur√©e pour cr√©er des redirections en utilisant du code WordPress, des <em>.htaccess</em> sur les serveurs Apache ou des redirections de serveur Nginx. De plus, elle est gratuite.</p>\n<p>Voici comment d√©marrer avec l‚Äôextension Redirection.</p>\n<p>Apr√®s l&rsquo;avoir t√©l√©charg√© √† partir du r√©pertoire des extensions, vous pouvez la localiser en allant sur <strong>Outils &gt; Redirection</strong> :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1897px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/redirection-extension.png\" alt=\"Page d\'accueil de l‚Äôextension WordPress Redirection\" width=\"1897\" height=\"1058\" /><p class=\"wp-caption-text\">Page d&rsquo;accueil de l‚Äôextension WordPress Redirection</p></div>\n<p>Cela vous am√®nera √† une page d&rsquo;accueil. Cliquez sur le bouton ¬´¬†<strong>D√©marrer la configuration</strong>¬†¬ª, puis suivez la s√©rie d&rsquo;invites. Une fois que c&rsquo;est fait, vous pouvez commencer √† l&rsquo;utiliser.</p>\n<h3>Comment ajouter manuellement une nouvelle redirection</h3>\n<p>Vous pouvez ajouter manuellement une nouvelle redirection en cliquant sur le bouton <strong>Ajouter</strong>, puis en saisissant les URL source et cible dans les champs respectifs du formulaire et en cliquant sur le bouton <strong>Ajouter une redirection</strong> :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1735px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/ajouter-redirection-1.png\" alt=\"L\'√©cran Ajouter une nouvelle redirection dans l‚Äôextension Redirection\" width=\"1735\" height=\"751\" /><p class=\"wp-caption-text\">L&rsquo;√©cran Ajouter une nouvelle redirection dans l‚Äôextension Redirection</p></div>\n<p>Cette approche n&rsquo;est recommand√©e que si vous n&rsquo;avez que quelques URL √† rediriger. Si vous avez affaire √† un site entier, vous √™tes encourag√© √† gagner du temps en utilisant la fonction d&rsquo;importation d&rsquo;URL de l‚Äôextension.</p>\n<h3>Importation/exportation de redirections</h3>\n<p>Une autre fa√ßon utile d&rsquo;utiliser cette extension est d&rsquo;importer et d&rsquo;exporter des redirections. Par exemple, vous pouvez exporter d&rsquo;anciennes URLs de votre site web, puis utiliser l‚Äôextension sur un nouveau site pour importer la liste.</p>\n<p>Pour ce faire, installez et activez l‚Äôextension Redirection sur votre ancien site web. Ensuite, √† partir de votre tableau de bord d&rsquo;administration WordPress, allez dans <strong>Outils &gt; Redirection &gt; Import/Export</strong>.</p>\n<p>En bas de l&rsquo;√©cran, sous <strong>Exporter</strong>, vous pouvez tout exporter vers un fichier CSV, Apache <em>.htaccess,</em> Nginx rewrite rules, ou Redirection JSON :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1093px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/extension-redirection-1.png\" alt=\"La section ¬´ Exporter ¬ª de l‚Äôextension WordPress Redirection\" width=\"1093\" height=\"462\" /><p class=\"wp-caption-text\">La section ¬´ Exporter ¬ª de l‚Äôextension WordPress Redirection</p></div>\n<p>Ensuite, avec l‚Äôextension install√©e sur votre nouveau site, vous pouvez vous rendre sur le m√™me √©cran pour importer le fichier :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1719px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/importing-redirection-1.png\" alt=\"L\'√©cran Import/Export de l‚Äôextension Redirection\" width=\"1719\" height=\"424\" /><p class=\"wp-caption-text\">L&rsquo;√©cran Import/Export de l‚Äôextension Redirection</p></div>\n<p>Cliquez sur le bouton <strong>Ajouter un fichier</strong> et s√©lectionnez le fichier. Une fois le fichier t√©l√©vers√©, vous pouvez trouver les nouvelles URLs sous l&rsquo;onglet <strong>Redirections</strong>.</p>\n<h2>Autres extensions WordPress de redirection</h2>\n<p>Ce n&rsquo;est pas la seule extension WordPress de redirection que vous pouvez utiliser. <a href=\"https://wordpress.org/plugins/eps-301-redirects/\">301 Redirects</a> est une autre extension populaire qui sera pr√©f√©r√©e par les utilisateurs √† la recherche d&rsquo;une liste d&rsquo;options de configuration. Avec plus de 80 000 installations actives, elle a certainement √©t√© bien test√©e. Elle est facile √† apprendre, poss√®de une interface bien con√ßue et peut √™tre utilis√©e pour cr√©er manuellement des redirections 301 et 302.</p>\n<p>Une fonctionnalit√© particuli√®rement int√©ressante est un <a href=\"https://kinsta.com/fr/base-de-connaissances/menu-deroulant-wordpress/\">menu d√©roulant</a> permettant de s√©lectionner des pages, des articles, des pages de m√©dias et des pages d&rsquo;archives comme cible de redirection. Cela permet de garantir que les r√®gles de redirection cr√©√©es manuellement se r√©solvent sans aucun probl√®me. Vous pouvez √©galement conserver des requ√™te cha√Ænes dans les redirections.</p>\n\n<h2>R√©sum√©</h2>\n<p>C&rsquo;est simple : si elles sont mal impl√©ment√©es, les redirections WordPress peuvent ralentir votre site. C&rsquo;est pourquoi il vaut la peine de prendre le temps de <strong>minimiser le nombre de redirections</strong>.</p>\n<p>Vous pouvez le faire en √©vitant de cr√©er des redirections inutiles et en vous assurant que votre <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-qu-un-tld/\">TLD </a>se r√©sout avec une seule redirection.</p>\n<p>Cependant, il y a des moments o√π il est appropri√© de cr√©er et d&rsquo;utiliser intentionnellement la redirection. Lorsque c&rsquo;est le cas, il y a deux fa√ßons de proc√©der :</p>\n<ul>\n<li>Vous pouvez configurer des redirections au niveau du serveur. Certains fournisseurs d&rsquo;h√©bergement proposent des fonctionnalit√©s qui peuvent vous aider, comme l&rsquo;<a href=\"https://kinsta.com/fr/base-de-connaissances/regles-redirection/\">outil de r√®gles de redirection</a> ici chez Kinsta.</li>\n<li>Utilisez une extension WordPress telle que Redirection pour ajouter manuellement quelques redirections ou importer une liste de redirections d&rsquo;URL.</li>\n</ul>\n<p>En limitant l&rsquo;utilisation de la redirection aux instances n√©cessaires et en utilisant les meilleures pratiques WordPress de redirection, vous contribuez √† ce que vos visiteurs aient l&rsquo;exp√©rience la plus rapide possible et √† ce que <a href=\"https://kinsta.com/fr/blog/suivi-des-conversions/\">vos taux de conversion ne diminuent pas</a>.</p>\n<p>De plus, vous n&rsquo;aurez pas √† craindre de nuire √† <a href=\"https://kinsta.com/blog/wordpress-seo\">votre SEO</a> et de perdre votre classement !</p>\n<p>Qu&rsquo;en pensez-vous¬†? Avez-vous rencontr√© des probl√®mes de performance dus √† un trop grand nombre de redirections ? Faites-le nous savoir dans la section des commentaires ci-dessous !</p>\n<p>The post <a rel=\"nofollow\" href=\"https://kinsta.com/fr/blog/redirections-wordpress/\">Redirections WordPress : Les meilleures pratiques pour maximiser le SEO et la vitesse des pages</a> appeared first on <a rel=\"nofollow\" href=\"https://kinsta.com/fr\">H√©bergement WordPress infog√©r√© Kinsta</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/ejRwhzDv3XM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://kinsta.com/fr/blog/redirections-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:52:\"http://backend.userland.com/creativeCommonsRssModule\";a:1:{s:7:\"license\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://creativecommons.org/licenses/by-nc-sa/3.0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:2:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";s:4:\"href\";s:32:\"http://feeds.feedburner.com/wpfr\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:3:\"rel\";s:3:\"hub\";s:4:\"href\";s:32:\"http://pubsubhubbub