(24, 1, '2020-04-30 10:50:03', '2020-04-30 08:50:03', '<!-- wp:paragraph -->\n<p>Le basket-ball est invent√© en d√©cembre 1891 par James Naismith, professeur d\'√©ducation physique canado-am√©ricain au <em>Springfield College</em>, dans l\'√âtat du Massachusetts (√âtats-Unis). Lors d\'une journ√©e de pluie, Naismith tente d\'assurer malgr√© tout son cours de sport, et essaie de d√©velopper un sport d\'int√©rieur pour maintenir la condition physique de ses √©l√®ves entre les saisons de football am√©ricain et de baseball, pendant les longs hivers de la Nouvelle-Angleterre. Il souhaite leur trouver une activit√© o√π les contacts physiques sont restreints, afin d\'√©viter les risques de blessure.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Apr√®s avoir √©cart√© certains jeux trop violents ou peu appropri√©s √† une pratique en salle, il reprend l\'id√©e d\'un ancien jeu de balle maya (le <em>Pok-ta-pok</em>) et place deux caisses de p√™ches sur les rampes du gymnase, √† 3,05&nbsp;m√®tres de hauteur (dix pieds). Le but du jeu est de faire p√©n√©trer un ballon dans ces caisses en bois pour marquer un <q>panier</q>. Contrairement aux paniers actuels, la caisse de p√™ches dispose d\'un fond&nbsp;: la balle devait donc √™tre r√©cup√©r√©e manuellement apr√®s chaque <q>panier</q> inscrit. Afin d\'√©viter d\'avoir √† rechercher syst√©matiquement la balle, le fond du panier est √©vid√© pour pouvoir l\'extraire avec une longue perche. Naismith √©tablit rapidement treize r√®gles principales (les Treize r√®gles originelles) pour rendre le jeu praticable&nbsp;; la majorit√© sont encore en vigueur. Ces r√®gles comportent notamment l\'interdiction de courir en tenant la balle (marcher) et de <q>donner des coups d\'√©paule, de tenir, de pousser ou de faire tomber de quelconque mani√®re</q> l\'adversaire. Elles d√©finissent en outre la dur√©e d\'une partie&nbsp;: quatre quarts-temps de quinze minutes, avec une pause de cinq minutes entre elles.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce sport est baptis√© basket-ball, ce qui signifie litt√©ralement en anglais ¬´&nbsp;ballon panier&nbsp;¬ª. Il est d\'abord pratiqu√© avec un ballon de football, puis avec des balles de couleur brune. Le tout premier match public de basket-ball est jou√© le 11 mars 1892 entre des √©l√®ves d\'une classe d\'√©tudiants de la <em>Springfield Christian Training Association</em> et leurs enseignants. Les √©tudiants gagnent 5-1&nbsp;; le seul panier marqu√© par les enseignants est celui du c√©l√®bre entra√Æneur de football am√©ricain Amos Alonzo Stagg. La m√™me ann√©e, le jeu est adapt√© pour √™tre jou√© par des femmes. Le premier match f√©minin se d√©roule en 1893 au <em>Smith College</em> de Northampton, dans le Massachusetts. D√®s 1897-1898, le nombre de joueurs par √©quipe est fix√© √† cinq. √Ä l\'occasion d\'une d√©monstration au Y.M.C.A. de New York en avril 1892, la discipline gagne une premi√®re mention dans The New York Times. Il est pr√©sent√© comme <q>un nouveau sport de balle, un substitut du football sans ses aspects brutaux</q>. Les premiers articles sur ce sport en France datent de 1897. Dans ce dernier pays, il est d\'abord plut√¥t consid√©r√© comme un sport f√©minin et se fait encore appeler ¬´&nbsp;balle au panier&nbsp;¬ª.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 1906, les caisses en bois sont finalement remplac√©es par des anneaux en m√©tal fix√©s √† des panneaux. La balle passe ainsi √† travers un arceau et retombe au sol lorsqu\'un panier est inscrit. Le panneau sert quant √† lui √† √©viter que la balle n\'atterrisse dans les tribunes, et permet d\'effectuer des tirs avec rebond. Dans son journal, d√©couvert en 2006 par sa petite-fille, James Naismith fait part de ses appr√©hensions quant au jeu qu\'il a invent√©, et indique qu\'il y a introduit certaines r√®gles d\'un jeu enfantin m√©di√©val, le <em>Duck on a Rock</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:html -->\n<p>Au d√©but de son histoire, le basket-ball est surtout port√© sur le jeu offensif et la d√©fense est rel√©gu√©e au second plan. La d√©fense est alors la phase passive du basket-ball, o√π les joueurs attendent l\'√©chec de l\'adversaire¬†; elle a depuis acquis un r√¥le comparable √† celui de l\'attaque. Par ailleurs, la passe et le tir √©taient les seules mani√®res de d√©placer la balle vers le panier. En effet, le dribble n\'existait pas dans le basket-ball originel, hormis lors d\'une √©ventuelle passe √† un co√©quipier avec rebond au sol¬†: il √©tait rendu difficile par la forme asym√©trique des premiers ballons. Il est devenu essentiel dans le jeu √† partir des ann√©es 1950, lorsque les ballons manufactur√©s eurent une forme r√©guli√®re et les qualit√©s de rebond n√©cessaires</p>\n<!-- /wp:html -->\n\n<!-- wp:paragraph -->\n<p>Le sport prend diverses appellations en fonction des pays. En espagnol, il est nomm√© <em>baloncesto</em> (Espagne) ou <em>b√°squetbol</em> (Argentine); en italien <em>pallacanestro</em> ; et en tch√®que <em>ko≈°√≠kov√°</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":22,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Dr._James_Naismith-1.jpg\" alt=\"\" class=\"wp-image-22\"/><figcaption>James Naismith, inventeur du basketball, avec un ballon et un panier.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":23,\"width\":376,\"height\":529,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Firstbasketball.jpg\" alt=\"\" class=\"wp-image-23\" width=\"376\" height=\"529\"/><figcaption>Le premier terrain de basket-ball au <em>Springfield College</em>.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Histoire du basket-ball', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-04-30 10:50:03', '2020-04-30 08:50:03', '', 1, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/1-revision-v1/', 0, 'revision', '', 0),
