(29, 1, '2020-04-30 11:20:28', '2020-04-30 09:20:28', '<!-- wp:paragraph -->\n<p>La <em>National Basketball League</em>, fond√©e en 1898 et dissoute en 1904, est le pr√©curseur des nombreuses ligues professionnelles cr√©√©es aux √âtats-Unis et dans le reste du monde tout au long du si√®cle. Hormis la <em>Eastern Basket Ball League</em>, fond√©e en 1909, les principales ligues professionnelles sont cr√©√©es au d√©but des ann√©es 1920¬†: la <em>Metropolitan Basketball League</em> (1921) et l\'<em>American Basketball League</em> (1925). En 1922 est cr√©√©e l\'√©quipe des Rens de Dayton (√©galement appel√©e New York Renaissance), compos√©e uniquement d\'Afro-Am√©ricains. Leurs principaux rivaux √©taient les Original Celtics, consid√©r√©s comme les <q>p√®res du basketball</q> et pr√©sent√©s comme les champions du monde de la discipline. √Ä l\'image des Harlem Globetrotters, fond√©s en 1926, ceux-ci organisaient des tourn√©es dans le pays √† la mani√®re d\'un cirque. Les Celtics dominent le basketball am√©ricain de 1922 √† 1928, ann√©e de leur dissolution.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le 6 juin 1946 est cr√©√©e la <em>Basketball Association of America</em> (BAA)¬†: son premier match oppose les Huskies de Toronto, √† domicile, aux Knickerbockers de New York. Apr√®s trois saisons, en 1949, la ligue fusionne avec la <em>National Basketball League</em> pour former la <em>National Basketball Association</em> (NBA). D√®s les ann√©es 1950 apparaissent les premi√®res stars du basketball, dont le pivot George Mikan et le meneur Bob Cousy. Les Lakers de Minneapolis (qui s\'installent √† Los Angeles en 1960) et les Celtics de Boston assoient leur domination sur la NBA en remportant seize titres √† eux deux de 1949 √† 1970. Les deux √©quipes s\'opposent alors dans une rivalit√© qui les voit s\'affronter √† dix reprises en finales entre 1959 et 1987.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les ann√©es 1960 voient √©clore plusieurs joueurs aujourd\'hui l√©gendaires¬†: l\'arri√®re des Lakers Jerry West¬†; le meneur Oscar Robertson¬†; le pivot des Celtics Bill Russell, onze fois champion NBA et qui r√©volutionna la mani√®re de pratiquer la d√©fense; et Wilt Chamberlain, qui d√©tient encore aujourd\'hui de nombreux records de statistiques. Le 2 mars 1962, il inscrit 100¬†points lors d\'un match entre les Warriors de Philadelphie et les Knicks de New York.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 1967, l\'<em>American Basketball Association</em> (ABA) est lanc√©e pour tenter de rivaliser avec la NBA, qui conna√Æt un pic de popularit√©. Celle-ci suscite l\'int√©r√™t du public en proposant un nouveau style de jeu et des r√®gles diff√©rentes. La balle est tricolore (rouge, blanc, bleu), le jeu est plus agressif et spectaculaire, et le tir √† trois points est cr√©√©. Julius Erving est alors le joueur le plus c√©l√®bre de cette ligue, gr√¢ce √† un style a√©rien o√π le saut et le jeu au-dessus du panier sont aussi importants que le tir. Toutefois, les faibles recettes et le succ√®s d√©clinant de la ligue la contraignent √† √™tre absorb√©e par la NBA¬†: ses quatre meilleures √©quipes (les Nets de New York, les Nuggets de Denver, les Pacers de l\'Indiana et les Spurs de San Antonio) y sont incorpor√©es, et certains √©l√©ments sont conserv√©s, comme le tir √† trois points. Apr√®s 1970, la NBA est sans conteste la ligue de basketball la plus importante, tant en termes de popularit√© que de budget ou de niveau de jeu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":28,\"width\":644,\"height\":873,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Wilt_Chamberlain_Bill_Russell_2-755x1024.jpg\" alt=\"\" class=\"wp-image-28\" width=\"644\" height=\"873\"/><figcaption>Bill Russell (√† gauche) en d√©fense sur Wilt Chamberlain. De 1959 √† 1969, ces deux pivots s\'opposent et donnent lieu √† l\'une des plus grandes rivalit√©s de l\'histoire du basket-ball.</figcaption></figure>\n<!-- /wp:image -->', 'Cr√©ation des premi√®res ligues professionnelles am√©ricaines', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2020-04-30 11:20:28', '2020-04-30 09:20:28', '', 27, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/27-revision-v1/', 0, 'revision', '', 0),
(30, 1, '2020-04-30 11:28:25', '2020-04-30 09:28:25', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu apr√®s sa cr√©ation, le basket-ball s\'√©tend progressivement en dehors des √âtats-Unis et du Canada et atteint l\'Europe, o√π il se d√©veloppe rapidement. En 1909 se tient le premier match international de basketball, opposant le Mayak Saint-P√©tersbourg (√† domicile) √† une √©quipe de YMCA am√©ricaine. Le premier grand √©v√®nement europ√©en se d√©roule en 1919 √† Joinville-le-Pont durant les Jeux interalli√©s¬†: les √âtats-Unis, emmen√©s par Marty Friedman, l\'emportent contre la France en finale. Le jeu gagne en popularit√© dans ces deux pays.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 18 juin 1932, la F√©d√©ration internationale de basket-ball amateur (FIBA) est fond√©e √† Gen√®ve par l\'Argentine, la Tch√©coslovaquie, la Gr√®ce, l\'Italie, la Lettonie, le Portugal, la Roumanie et la Suisse. √Ä l\'origine, cette f√©d√©ration ne supervise que les √©quipes d\'amateurs. Elle joue un r√¥le fondamental dans l\'inscription du basketball au programme des Jeux olympiques d\'√©t√© de 1936 √† Berlin. Les matchs y sont disput√©s en ext√©rieur, sur un terrain en terre battue. Le premier titre olympique est remport√© par l\'√©quipe nationale am√©ricaine, avec entre autres Sam Balter, Ralph Bishop et Francis Johnson, contre l\'√©quipe du Canada. Le 22 ao√ªt 1951, √† Berlin-Ouest, une rencontre est disput√©e devant plus de 75¬†000¬†spectateurs, ce qui en ferait la plus importante fr√©quentation pour un match de basket-ball.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le premier championnat du monde de basket-ball est organis√© en Argentine en 1950, et trois ans plus tard a lieu le premier championnat du monde de basket-ball f√©minin √† Santiago du Chili. L\'√©preuve f√©minine ne devient olympique qu\'en 1976, lors des Jeux olympiques de Montr√©al, gr√¢ce notamment √† l\'action du secr√©taire g√©n√©ral de la FIBA Renato William Jones.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":31,\"width\":411,\"height\":265,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Jeux_interalli√©s_1919_basket-ball_01-1024x664.jpg\" alt=\"\" class=\"wp-image-31\" width=\"411\" height=\"265\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Rencontre entre les √âtats-Unis et la France lors des Jeux Interralli√©s de 1919.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":32,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Equipe_de_France_1953.jpg\" alt=\"\" class=\"wp-image-32\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">√âquipe de France de basket-ball f√©minin 1953.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Implantation en Europe et comp√©titions internationales', '', 'publish', 'open', 'open', '', 'implantation-en-europe-et-competitions-internationales', '', '', '2020-04-30 14:38:40', '2020-04-30 12:38:40', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?p=30', 0, 'post', '', 0),
