(40, 1, '2020-04-30 11:40:44', '2020-04-30 09:40:44', '<!-- wp:heading -->\n<h2>Ach√®vement de la professionnalisation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>La NBA gagne en visibilit√© et est diffus√©e dans un nombre croissant de pays, dont la France √† partir de 1985. De nouveaux talents √©mergent dans les ann√©es 1970, comme Kareem Abdul-Jabbar (meilleur marqueur de l\'histoire de la NBA), Elvin Hayes, Moses Malone, Robert Parish ou Bernard King, ainsi que dans les ann√©es 1980 o√π d√©butent entre autres Hakeem Olajuwon, John Stockton, Karl Malone, Dominique Wilkins et Patrick Ewing. Toutefois, trois joueurs dominent la d√©cennie et contribuent √† accro√Ætre la popularit√© du basketball dans le monde¬†: Larry Bird, Magic Johnson et surtout Michael Jordan, consid√©r√© comme le plus grand joueur de l\'histoire. √Ä partir des ann√©es 1990, quelques √©quipes parviennent √† remettre en cause la domination des Lakers de Los Angeles et des Celtics de Boston sur le basketball am√©ricain, comme les Bulls de Chicago emmen√©s par Jordan (six titres entre 1991 et 1998) et les Spurs de San Antonio (cinq titres de 1999 √† 2014). De nouvelles stars font leur apparition¬†: David Robinson, Gary Payton, Jason Kidd, Steve Nash, Dirk Nowitzki, Tim Duncan, Kobe Bryant ou encore Shaquille O\'Neal, connu pour son physique impressionnant et ses fac√©ties sur le terrain.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>La professionnalisation du basket-ball se poursuit dans les ann√©es 1970 et ne s\'ach√®ve v√©ritablement qu\'en 1990. En 1989, la FIBA cesse d\'exclure les joueurs professionnels de ses comp√©titions, et des joueurs professionnels sont pour la premi√®re fois admis aux Jeux olympiques de 1992. N√©anmoins, la pratique amateur continue de se d√©velopper¬†: en 2012, vingt-six millions d\'Am√©ricains pratiquent le basketball (dont quinze millions de mani√®re occasionnelle). En juin 2015, la F√©d√©ration fran√ßaise de basket-ball annonce une progression importante du nombre de licenci√©s, avec un record de plus de 600¬†000, dont 36¬†% de femmes. Au d√©but des ann√©es 2010, le basket-ball est l\'un des sports les plus pratiqu√©s au monde, avec plus de 100¬†millions de licenci√©s et plus de 450¬†millions de pratiquants occasionnels.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2>Mondialisation et contestation de la domination am√©ricaine</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Depuis la cr√©ation du sport, les √âtats-Unis ont domin√© les comp√©titions internationales masculines et f√©minines, quoique concurrenc√©s par les √©quipes de Yougoslavie (puis de Serbie) et d\'Union sovi√©tique. L\'√©quipe am√©ricaine a notamment remport√© l\'or olympique √† quatorze reprises, sur dix-huit olympiades o√π le basketball figure au programme. La premi√®re <em>Dream Team</em> (¬´¬†√âquipe de r√™ve¬†¬ª) am√©ricaine, compos√©e notamment de Michael Jordan, Magic Johnson, Charles Barkley et Scottie Pippen, entre en comp√©tition lors des Jeux olympiques de Barcelone et remporte le titre avec un √©cart moyen de 42 points sur ses adversaires. Elle est ainsi consid√©r√©e comme la meilleure √©quipe de l\'histoire. Toutefois, avec la popularit√© croissante du basket-ball dans le monde, de nouvelles √©quipes nationales gagnent en niveau et parviennent √† contester la supr√©matie am√©ricaine. L\'√©quipe am√©ricaine, bien que compos√©e int√©gralement de joueurs √©voluant en NBA, finit sixi√®me lors des championnats du monde en 2002 derri√®re la Yougoslavie, l\'Argentine, l\'Allemagne, la Nouvelle-Z√©lande et l\'Espagne. Lors des Jeux olympiques de 2004 √† Ath√®nes, les √âtats-Unis n\'obtiennent que la m√©daille de bronze, apr√®s des d√©faites contre Porto Rico, la Lituanie et l\'Argentine. Ils perdent √©galement contre la Gr√®ce en demi-finales des championnats du monde en 2006. Selon le classement √©tabli par la FIBA en date du 3 octobre 2015, l\'√©quipe am√©ricaine demeure la meilleure au monde, suivie par l\'Espagne, la Lituanie, l\'Argentine, la France, la Serbie, la Russie, la Turquie, le Br√©sil et la Gr√®ce.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Depuis les ann√©es 1990, une ¬´¬†globalisation¬†¬ª du basket-ball semble se mettre en place, avec la cr√©ation de nombreux championnats et ligues √† travers le monde. Aux championnats les plus anciens, cr√©√©s avant les ann√©es 1970 (Pro A, Lega Basket, ESAKE, TBL, BBL, Liga ACB) s\'ajoutent de nouvelles ligues professionnelles, essentiellement en Asie o√π le sport est en plein essor. La premi√®re ligue professionnelle d\'Asie, la <em>Philippine Basketball Association</em> (PBA), organise son premier match le 9 avril 1975 √† Quezon City, dans la banlieue de Manille. La <em>National Basketball League</em> est fond√©e en 1979 regroupe sept √©quipes australiennes et une √©quipe n√©o-z√©landaise¬†; une ligue f√©minine est cr√©√©e en 1981. Des ligues sont cr√©√©es partout dans le monde dans les ann√©es 2000, comme la Bj League au Japon (2005), la NBB au Br√©sil (2008) et la VTB United League en Russie et Europe de l\'Est (2008). Toutefois, c\'est la <em>Chinese Basketball Association</em> qui conna√Æt le plus fort d√©veloppement et attire m√™me d\'anciens joueurs NBA, comme Metta World Peace, Stephon Marbury ou Tracy McGrady. Au Canada, bien que le hockey sur gla<a href=\"https://fr.wikipedia.org/wiki/Hockey_sur_glace\">c</a>e demeure le sport le plus pratiqu√© et m√©diatis√©, le nombre de licenci√©s et de matchs diffus√©s ne cesse de cro√Ætre depuis une dizaine d\'ann√©es.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Face au d√©veloppement international du basketball, la NBA s\'est peu √† peu ouverte aux meilleurs joueurs √©trangers non form√©s aux √âtats-Unis. Parmi les premiers figurent des Yougoslaves comme Dra≈æen Petroviƒá, Toni Kukoƒç et Vlade Divac, ou des Lituaniens (Arvydas Sabonis, ≈†ar≈´nas Marƒçiulionis). Une vingtaine de joueurs fran√ßais a foul√© les parquets de la ligue am√©ricaine¬†: Tariq Abdul-Wahad fut le premier, en 1997, suivi par d\'autres comme Nicolas Batum, Joakim Noah, Micka√´l Pi√©trus, Kevin S√©raphin, Johan Petro, Boris Diaw ou encore Tony Parker, quatre fois champion NBA avec les Spurs de San Antonio. La ligue recrute aussi plusieurs joueurs africains¬†: Manute Bol, Michael Olowokandi, DeSagana Diop, Luc Mbah a Moute, Hasheem Thabeet ou Bismack Biyombo.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Des joueurs russes (Timofe√Ø Mozgov, Andre√Ø Kirilenko), espagnols (les fr√®res Pau et Marc Gasol), allemands (Dirk Nowitzki, Detlef Schrempf), italiens (Andrea Bargnani, Marco Belinelli), suisses (Thabo Sefolosha, Clint Capela), argentins (Manu Gin√≥bili, Andr√©s Nocioni) et br√©siliens (Anderson Varej√£o et Nen√™) font √©galement leur apparition. Quelques Australiens (Luc Longley, Andrew Bogut) sont aussi parvenus √† int√©grer un club am√©ricain. Enfin, depuis les ann√©es 2000 et le gain de popularit√© du basketball en Asie, la NBA a accueilli quelques joueurs chinois ou d\'origine chinoise¬†: Yi Jianlian, Wang Zhizhi, Jeremy Lin et surtout le g√©ant Yao Ming, figure de proue de l\'expansion du basket-ball en Chine, o√π le basket-ball est devenu le deuxi√®me sport le plus pratiqu√© apr√®s le tennis de table.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":37,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Jordan_by_Lipofsky_16577.jpg\" alt=\"\" class=\"wp-image-37\"/><figcaption>Michael Jordan sautant au panier pour r√©aliser un dunk. Durant sa carri√®re longue de pr√®s de vingt ans (1984-2003), ses actions spectaculaires et ses cinq titres de meilleur joueur de la saison (MVP) ont fait de lui le basketteur le plus c√©l√®bre au monde.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":38,\"width\":271,\"height\":193,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Gasol_Brothers_at_the_2012_Summer_Olympics-1024x731.jpg\" alt=\"\" class=\"wp-image-38\" width=\"271\" height=\"193\"/><figcaption>Les fr√®res Marc et Pau Gasol sous le maillot de l\'√©quipe d\'Espagne, lors des Jeux olympiques de 2012 √† Londres.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":39,\"width\":269,\"height\":218,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Yao_Ming_2310550443.jpg\" alt=\"\" class=\"wp-image-39\" width=\"269\" height=\"218\"/><figcaption>Le joueur chinois Yao Ming en d√©cembre 2006, sous le maillot des Rockets de Houston. De 2002 √† 2011, il dispute neuf saisons en NBA et contribue √† l\'expansion du basket-ball en Asie.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Depuis les ann√©es 1970', '', 'inherit', 'closed', 'closed', '', '34-revision-v1', '', '', '2020-04-30 11:40:44', '2020-04-30 09:40:44', '', 34, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/34-revision-v1/', 0, 'revision', '', 0),
