(56, 1, '2020-04-30 12:20:37', '2020-04-30 10:20:37', '<!-- wp:paragraph -->\n<p>L\'histoire du basket-ball f√©minin d√©bute en 1892 au <em>Smith College</em> (Massachusetts), lorsque la professeure d\'√©ducation physique Senda Berenson Abbott adapte les r√®gles du jeu pour les femmes. Ainsi, elle interdit d\'arracher le ballon √† l\'adversaire ou de dribbler au sol plus de trois fois, afin de ne pas <q>d√©velopper une tendance √† la nervosit√© et perdre la gr√¢ce, la dignit√© et l\'estime de soi</q>. Peu apr√®s avoir √©t√© embauch√©e, elle rencontre Naismith afin d\'en apprendre davantage sur le basket-ball. Convaincue de l\'int√©r√™t de ce sport et des valeurs qu\'il peut v√©hiculer, elle organise le premier match universitaire f√©minin au <em>Smith College</em> le 21 mars 1893¬†: les √©l√®ves en premi√®re ann√©e (<em>freshmen</em>) jouent contre les deuxi√®mes ann√©es (<em>sophomores</em>). Le sport s\'implante dans plusieurs universit√©s pour femmes, dont Wellesley, Vassar et Bryn Mawr College. Le 4 avril 1896, l\'√©quipe de Stanford affronte celle de Berkeley dans un match √† neuf contre neuf, qui voit la victoire de Stanford par 2‚Äì1.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 1895, Clara Gregory Baer publie le premier recueil des r√®gles du basket-ball f√©minin, alors appel√© basquette. Les r√®gles de Berenson sont publi√©es pour la premi√®re fois en 1899, et celle-ci r√©alise la premi√®re √©dition du <em>Women\'s Basketball Guide</em> d\'Albert Spalding en 1901. La pratique f√©minine est alors tr√®s mal consid√©r√©e¬†: devant le d√©veloppement du sport dans les lyc√©es, de nombreuses √©tudes tentent de prouver les effets du basket-ball sur la moralit√© des jeunes filles et pr√¥nent son interdiction. Les joueuses portent le corset ainsi que de longues robes, qui les font fr√©quemment tr√©bucher. Le tir devait √™tre effectu√© √† une seule main¬†: tirer √† deux mains √©tait jug√© disgracieux car il mettait la poitrine en avant. Les joueuses des <em>Edmonton Grads</em>, une √©quipe canadienne qui r√©alise des tourn√©es entre 1915 et 1940, n\'√©taient pas pay√©es et devaient imp√©rativement rester c√©libataires.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>De premi√®res stars f√©minines √©mergent aux √âtats-Unis, comme Mildred Didrickson des Golden Cyclones et l\'√©quipe des All American Red Heads. Cette derni√®re se produit en spectacle √† la mani√®re des Globetrotters de Harlem et joue parfois contre des √©quipes masculines, avec les r√®gles destin√©es aux hommes. Elles ont cependant pour obligation de se maquiller et de soigner leur apparence. D√®s 1924, la F√©d√©ration sportive f√©minine internationale organise une comp√©tition de basket-ball. Les <em>Edmonton Grads</em> dominent le basket-ball f√©minin jusqu\'aux ann√©es 1940&nbsp;: elles jouent contre toutes les √©quipes qui acceptent de les d√©fier et remportent 522&nbsp;victoires pour seulement 20&nbsp;d√©faites. Elles remportent √©galement le tournoi de d√©monstration du basket-ball f√©minin aux Jeux olympiques de 1924, 1928, 1932 et 1936.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le basket-ball f√©minin acc√®de √† plus de reconnaissance dans la seconde moiti√© du <abbr title=\"20·µâ si√®cle\">XX<sup>e</sup></abbr>&nbsp;si√®cle, avec notamment la cr√©ation du championnat du monde de basket-ball f√©minin en 1953 et du championnat d\'Afrique en 1966. Le sport prend son essor aux √âtats-Unis apr√®s l\'adoption du Titre IX, qui interdit toute discrimination sur la base du sexe dans les programmes d\'√©ducation soutenus par l‚Äô√âtat, et permet la constitution de nombreuses √©quipes universitaires&nbsp;: un championnat NCAA f√©minin est cr√©√© en 1982. En 1976, le basket-ball f√©minin devient un sport olympique. L\'√©quipe des √âtats-Unis (7) et celle d\'URSS/Russie (3) se partagent les dix titres mis en jeu. En 1985, Senda Berenson, Bertha Teague et Margaret Wade deviennent les premi√®res femmes √† √™tre intronis√©es au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball f√©minin se renforce en 1997 avec la cr√©ation de la Women\'s National Basketball Association (WNBA), sur le mod√®le de la NBA. Elle voit rapidement √©merger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffus√©s sur la cha√Æne de t√©l√©vision ESPN depuis 2009 et participent au d√©veloppement de la popularit√© du basket-ball f√©minin.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption>L\'√©quipe f√©minine de basket-ball du Smith College en 1902.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption>La joueuse fran√ßaise C√©line Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Basket-ball f√©minin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 12:20:37', '2020-04-30 10:20:37', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0),
