(50, 1, '2020-04-30 12:06:10', '2020-04-30 10:06:10', '<!-- wp:paragraph -->\n<p>Le basket-ball se joue g√©n√©ralement dans un endroit couvert, comme un <a href=\"https://fr.wikipedia.org/wiki/Gymnase_(sport)\">gymnase</a>, mais peut aussi √™tre pratiqu√© sur des aires de jeu en tant que loisir, sous sa variante la plus populaire&nbsp;: le <em><a href=\"https://fr.wikipedia.org/wiki/Streetball\">streetball</a></em> (¬´&nbsp;basket-ball de rue&nbsp;¬ª). Le <a href=\"https://fr.wikipedia.org/wiki/Terrain_de_basket-ball\">terrain</a> est doublement <a href=\"https://fr.wikipedia.org/wiki/Sym%C3%A9trie_axiale\">sym√©trique</a>, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 √† 29&nbsp;m√®tres de long sur 13 √† 15&nbsp;m√®tres de large. Les terrains en ext√©rieur (<em><a href=\"https://fr.wikipedia.org/wiki/Terrain_de_jeux\">playgrounds</a></em>) peuvent √™tre goudronn√©s ou en <a href=\"https://fr.wikipedia.org/wiki/Terre_battue\">terre battue</a>. Les terrains couverts sont g√©n√©ralement r√©alis√©s en <a href=\"https://fr.wikipedia.org/wiki/Parquet_(construction)\">parquet</a>, avec des lattes d\'<a href=\"https://fr.wikipedia.org/wiki/%C3%89rable\">√©rable</a> dispos√©es dans le sens de la longueur. Le nom et le logo de l\'√©quipe r√©sidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en comp√©tition poss√®dent des √©quipements suppl√©mentaires comme l\'<a href=\"https://fr.wikipedia.org/wiki/Shot_clock\">horloge des 24 secondes</a>, une <a href=\"https://fr.wikipedia.org/wiki/Table_de_marque_(basket-ball)\">table de marque</a> (sur le c√¥t√©), des tableaux d\'affichage et des compteurs. Aux √âtats-Unis, la plupart comprennent √©galement des √©crans suspendus au plafond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Aux deux extr√©mit√©s du terrain se trouve un <a href=\"https://fr.wikipedia.org/wiki/Panier_(basket-ball)\">panier</a>, form√© par un anneau (ou <em>arceau</em>) m√©tallique situ√© √† 3,05&nbsp;m du sol, en dessous duquel est attach√© un filet ouvert en son centre<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-Basketball_equipment_and_history-55\">55</a></sup>. L\'arceau est fix√© √† un <a href=\"https://fr.wikipedia.org/wiki/Panneau_de_basket-ball\">panneau</a> rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un <a href=\"https://fr.wikipedia.org/wiki/Slam_dunk\">dunk</a> puis revenir en position horizontale (les <a href=\"https://fr.wikipedia.org/wiki/Anneau_inclinable\">anneaux inclinables</a>).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sous chaque panier se trouve une zone <a href=\"https://fr.wikipedia.org/wiki/Rectangle\">rectangulaire</a> (<a href=\"https://fr.wikipedia.org/wiki/Trap%C3%A8ze\">trap√©zo√Ødale</a> avant octobre 2010) appel√©e la <a href=\"https://fr.wikipedia.org/wiki/Raquette_(basket-ball)\">raquette</a> (ou zone restrictive). Un arc de cercle situ√© √† 6,25&nbsp;m (6,75&nbsp;m depuis 2010 pour les championnats de <a href=\"https://fr.wikipedia.org/wiki/Championnat_de_France_de_basket-ball\">Pro A</a>, <a href=\"https://fr.wikipedia.org/wiki/Championnat_de_France_de_basket-ball_de_Pro_B\">Pro B</a>, N1 fran√ßais et basket-ball f√©minin&nbsp;; 7,23&nbsp;m en NBA) de chaque panier repr√©sente la ligne de <a href=\"https://fr.wikipedia.org/wiki/Panier_%C3%A0_trois_points\">tirs √† trois points</a>. Sous l\'anneau est trac√© un arc de cercle d\'un rayon de 1,25&nbsp;m dans lequel aucun passage en force d\'un attaquant ne sera siffl√© par l\'arbitre<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-Dimitri-56\">56</a></sup>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_basket-ball\">ballon de basket-ball</a> standard est de forme sph√©rique, et a une masse de 650&nbsp;g et un diam√®tre de 24&nbsp;cm. Sa pression int√©rieure est de 0,55 <a href=\"https://fr.wikipedia.org/wiki/Atmosph%C3%A8re_(unit%C3%A9)\">atm</a><sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-57\">57</a></sup>. Initialement, le basket-ball se pratiquait avec un <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_football\">ballon de football</a>, puis des ballons sp√©cifiques de couleur marron. Ce n\'est qu\'√† la fin des ann√©es 1950 que <a href=\"https://fr.wikipedia.org/wiki/Tony_Hinkle\">Tony Hinkle</a>, d√©sireux de cr√©er une balle plus visible des joueurs et des spectateurs, d√©veloppe la <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_basket-ball\">balle de couleur orange</a> encore utilis√©e aujourd\'hui<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-:04-7\">7</a></sup>. Constitu√©e de huit pi√®ces de cuir cousues autour d\'une <a href=\"https://fr.wikipedia.org/wiki/Chambre_%C3%A0_air\">chambre √† air</a>, il existe en plusieurs tailles&nbsp;: 7 pour les hommes, 6 pour les femmes, et de 5 √† 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqu√© par <a href=\"https://fr.wikipedia.org/wiki/Spalding_(entreprise)\">Spalding</a>, et celui de la FIBA par l\'√©quipementier japonais <a href=\"https://fr.wikipedia.org/wiki/Molten\">Molten</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption>Un terrain de basket-ball selon les r√®gles de la FIBA.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption>Un panier de basket-ball √† l\'ext√©rieur, avec un arceau, un filet et un panneau transparent.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', '√âquipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 12:06:10', '2020-04-30 10:06:10', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
