r√©√© en 1982. En 1976, le basket-ball f√©minin devient un sport olympique. L\'√©quipe des √âtats-Unis (7) et celle d\'URSS/Russie (3) se partagent les dix titres mis en jeu. En 1985, Senda Berenson, Bertha Teague et Margaret Wade deviennent les premi√®res femmes √† √™tre intronis√©es au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball f√©minin se renforce en 1997 avec la cr√©ation de la Women\'s National Basketball Association (WNBA), sur le mod√®le de la NBA. Elle voit rapidement √©merger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffus√©s sur la cha√Æne de t√©l√©vision ESPN depuis 2009 et participent au d√©veloppement de la popularit√© du basket-ball f√©minin.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption><span style=\"color:#130ba3\" class=\"has-inline-color\">L\'√©quipe f√©minine de basket-ball du Smith College en 1902.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption><span style=\"color:#130ba3\" class=\"has-inline-color\">La joueuse fran√ßaise C√©line Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Basket-ball f√©minin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 12:25:40', '2020-04-30 10:25:40', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0),
(76, 1, '2020-04-30 15:06:56', '2020-04-30 13:06:56', '<!-- wp:heading -->\n<h2>Mat√©riel</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball se joue g√©n√©ralement dans un endroit couvert, comme un gymnase, mais peut aussi √™tre pratiqu√© sur des aires de jeu en tant que loisir, sous sa variante la plus populaire¬†: le <em>streetball</em> (¬´¬†basket-ball de rue¬†¬ª). Le terrain est doublement sym√©trique, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 √† 29¬†m√®tres de long sur 13 √† 15¬†m√®tres de large. Les terrains en ext√©rieur (<em>playgrounds</em>) peuvent √™tre goudronn√©s ou en terre battue. Les terrains couverts sont g√©n√©ralement r√©alis√©s en parquet, avec des lattes d\'√©rable dispos√©es dans le sens de la longueur. Le nom et le logo de l\'√©quipe r√©sidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en comp√©tition poss√®dent des √©quipements suppl√©mentaires comme l\'horloge des 24 secondes, une table de marque (sur le c√¥t√©), des tableaux d\'affichage et des compteurs. Aux √âtats-Unis, la plupart comprennent √©galement des √©crans suspendus au plafond.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Aux deux extr√©mit√©s du terrain se trouve un panier, form√© par un anneau (ou <em>arceau</em>) m√©tallique situ√© √† 3,05¬†m du sol, en dessous duquel est attach√© un filet ouvert en son centre. L\'arceau est fix√© √† un panneau rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un dunk puis revenir en position horizontale (les anneaux inclinables).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Sous chaque panier se trouve une zone rectangulaire appel√©e la raquette (ou zone restrictive). Un arc de cercle situ√© √† 6,25¬†m (6,75¬†m depuis 2010 pour les championnats de Pro A, Pro B, N1 fran√ßais et basket-ball f√©minin¬†; 7,23¬†m en NBA) de chaque panier repr√©sente la ligne de tirs √† trois points. Sous l\'anneau est trac√© un arc de cercle d\'un rayon de 1,25¬†m dans lequel aucun passage en force d\'un attaquant ne sera siffl√© par l\'arbitre.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon de basket-ball standard est de forme sph√©rique, et a une masse de 650¬†g et un diam√®tre de 24¬†cm. Sa pression int√©rieure est de 0,55 atm. Initialement, le basket-ball se pratiquait avec un ballon de football, puis des ballons sp√©cifiques de couleur marron. Ce n\'est qu\'√† la fin des ann√©es 1950 que Tony Hinkle, d√©sireux de cr√©er une balle plus visible des joueurs et des spectateurs, d√©veloppe la balle de couleur orange encore utilis√©e aujourd\'hui. Constitu√©e de huit pi√®ces de cuir cousues autour d\'une chambre √† air, il existe en plusieurs tailles¬†: 7 pour les hommes, 6 pour les femmes, et de 5 √† 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqu√© par Spalding, et celui de la FIBA par l\'√©quipementier japonais Molten.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un terrain de basket-ball selon les r√®gles de la FIBA.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un panier de basket-ball √† l\'ext√©rieur, avec un arceau, un filet et un panneau transparent.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2>V√™tements et accessoires</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout d√©but du si√®cle, les joueurs portaient des maillots en tricot de laine et des pantalons en √©toffe. La duret√© du jeu et le mauvais √©tat des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. D√®s les ann√©es 1910, le port du maillot se d√©veloppe et les pantalons en √©toffe sont remplac√©s par des shorts. Dans les ann√©es 1960, l\'habillement des joueurs √©volue¬†: les maillots deviennent plus l√©gers et sont progressivement r√©alis√©s en fibres synth√©tiques. √Ä l\'initiative notamment de Michael Jordan, les shorts sont allong√©s et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts¬†: les <em>sleeves</em>. D\'autres comme Slick Watts ou Bill Walton ont rendu populaires les bandeaux, port√©s autour de la t√™te ou au poignet. Fabriqu√©s en nylon et √©lasthanne extensibles, ils sont destin√©s √† garder les muscles chauds ou √©ponger la sueur, mais sont aussi utilis√©s comme un accessoire de style.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les chaussures de basket-ball ont √©galement chang√© au fil du temps. Au d√©but du si√®cle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'√©quipementier sportif Spalding met en vente un mod√®le sp√©cialement con√ßu pour le basket-ball, avec un syst√®me de ventouses pour √©viter de glisser. Des mod√®les en toile et en caoutchouc ont ensuite √©t√© cr√©√©s, parfois sur les conseils de joueurs comme Chuck Taylor, qui contribua au d√©veloppement des Converse. Les Chuck Taylor All Star et les Keds sont les chaussures les plus utilis√©es dans les ann√©es 1960 et 1970. √Ä partir des ann√©es 1980 appara√Æt la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la mall√©ole m√©diale afin d\'√©viter les risques de torsion de la cheville¬†: Nike et Adidas dominent alors le march√©. Les plus grands joueurs sont sponsoris√©s par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs d√©velopp√© sa propre collection de baskets nomm√©e Air Jordan. Si les chaussures de basket-ball se sont impos√©es en comp√©tition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples baskets.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dans les matchs officiels, chaque joueur porte un maillot num√©rot√©. La r√®gle FIBA imposait les num√©ros de 4 √† 15 (ce n\'est plus forc√©ment le cas) lors des comp√©titions internationales, soit douze num√©ros (autant qu\'il y a de joueurs dans une √©quipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel num√©ro de 0 √† 99 compris (le 00 existe aussi). Ainsi, en g√©n√©ral et dans la mesure du possible, les joueurs de NBA conservent le m√™me num√©ro durant toute leur carri√®re, m√™me en changeant d\'√©quipe, sauf quand un joueur le poss√®de d√©j√† ou quand celui-ci est retir√©. Lorsque certains joueurs marquent l\'histoire de leur franchise, il arrive que celle-ci d√©cide de retirer leur num√©ro pour leur rendre hommage. Ainsi, le c√©l√®bre num√©ro 23 port√© par Michael Jordan aux Bulls de Chicago a √©t√© rendu indisponible dans cette franchise apr√®s son d√©part.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":75,\"width\":656,\"height\":878,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Carmelo_Anthony_Nov_2013-765x1024.jpg\" alt=\"\" class=\"wp-image-75\" width=\"656\" height=\"878\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur am√©ricain Carmelo Anthony portant un √©quipement complet¬†: maillot, short, bandeau et <em>shooting sleeve</em> avec protection au coude sur les deux bras.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', '√âquipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 15:06:56', '2020-04-30 13:06:56', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
(66, 1, '2020-04-30 13:46:37', '2020-04-30 11:46:37', '<!-- wp:heading -->\n<h2>Mat√©riel</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le basket-ball se joue g√©n√©ralement dans un endroit couvert, comme un <a href=\"https://fr.wikipedia.org/wiki/Gymnase_(sport)\">gymnase</a>, mais peut aussi √™tre pratiqu√© sur des aires de jeu en tant que loisir, sous sa variante la plus populaire&nbsp;: le <em><a href=\"https://fr.wikipedia.org/wiki/Streetball\">streetball</a></em> (¬´&nbsp;basket-ball de rue&nbsp;¬ª). Le <a href=\"https://fr.wikipedia.org/wiki/Terrain_de_basket-ball\">terrain</a> est doublement <a href=\"https://fr.wikipedia.org/wiki/Sym%C3%A9trie_axiale\">sym√©trique</a>, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 √† 29&nbsp;m√®tres de long sur 13 √† 15&nbsp;m√®tres de large. Les terrains en ext√©rieur (<em><a href=\"https://fr.wikipedia.org/wiki/Terrain_de_jeux\">playgrounds</a></em>) peuvent √™tre goudronn√©s ou en <a href=\"https://fr.wikipedia.org/wiki/Terre_battue\">terre battue</a>. Les terrains couverts sont g√©n√©ralement r√©alis√©s en <a href=\"https://fr.wikipedia.org/wiki/Parquet_(construction)\">parquet</a>, avec des lattes d\'<a href=\"https://fr.wikipedia.org/wiki/%C3%89rable\">√©rable</a> dispos√©es dans le sens de la longueur. Le nom et le logo de l\'√©quipe r√©sidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en comp√©tition poss√®dent des √©quipements suppl√©mentaires comme l\'<a href=\"https://fr.wikipedia.org/wiki/Shot_clock\">horloge des 24 secondes</a>, une <a href=\"https://fr.wikipedia.org/wiki/Table_de_marque_(basket-ball)\">table de marque</a> (sur le c√¥t√©), des tableaux d\'affichage et des compteurs. Aux √âtats-Unis, la plupart comprennent √©galement des √©crans suspendus au plafond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Aux deux extr√©mit√©s du terrain se trouve un <a href=\"https://fr.wikipedia.org/wiki/Panier_(basket-ball)\">panier</a>, form√© par un anneau (ou <em>arceau</em>) m√©tallique situ√© √† 3,05&nbsp;m du sol, en dessous duquel est attach√© un filet ouvert en son centre<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-Basketball_equipment_and_history-55\">55</a></sup>. L\'arceau est fix√© √† un <a href=\"https://fr.wikipedia.org/wiki/Panneau_de_basket-ball\">panneau</a> rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un <a href=\"https://fr.wikipedia.org/wiki/Slam_dunk\">dunk</a> puis revenir en position horizontale (les <a href=\"https://fr.wikipedia.org/wiki/Anneau_inclinable\">anneaux inclinables</a>).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sous chaque panier se trouve une zone <a href=\"https://fr.wikipedia.org/wiki/Rectangle\">rectangulaire</a> (<a href=\"https://fr.wikipedia.org/wiki/Trap%C3%A8ze\">trap√©zo√Ødale</a> avant octobre 2010) appel√©e la <a href=\"https://fr.wikipedia.org/wiki/Raquette_(basket-ball)\">raquette</a> (ou zone restrictive). Un arc de cercle situ√© √† 6,25&nbsp;m (6,75&nbsp;m depuis 2010 pour les championnats de <a href=\"https://fr.wikipedia.org/wiki/Championnat_de_France_de_basket-ball\">Pro A</a>, <a href=\"https://fr.wikipedia.org/wiki/Championnat_de_France_de_basket-ball_de_Pro_B\">Pro B</a>, N1 fran√ßais et basket-ball f√©minin&nbsp;; 7,23&nbsp;m en NBA) de chaque panier repr√©sente la ligne de <a href=\"https://fr.wikipedia.org/wiki/Panier_%C3%A0_trois_points\">tirs √† trois points</a>. Sous l\'anneau est trac√© un arc de cercle d\'un rayon de 1,25&nbsp;m dans lequel aucun passage en force d\'un attaquant ne sera siffl√© par l\'arbitre<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-Dimitri-56\">56</a></sup>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_basket-ball\">ballon de basket-ball</a> standard est de forme sph√©rique, et a une masse de 650&nbsp;g et un diam√®tre de 24&nbsp;cm. Sa pression int√©rieure est de 0,55 <a href=\"https://fr.wikipedia.org/wiki/Atmosph%C3%A8re_(unit%C3%A9)\">atm</a><sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-57\">57</a></sup>. Initialement, le basket-ball se pratiquait avec un <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_football\">ballon de football</a>, puis des ballons sp√©cifiques de couleur marron. Ce n\'est qu\'√† la fin des ann√©es 1950 que <a href=\"https://fr.wikipedia.org/wiki/Tony_Hinkle\">Tony Hinkle</a>, d√©sireux de cr√©er une balle plus visible des joueurs et des spectateurs, d√©veloppe la <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_basket-ball\">balle de couleur orange</a> encore utilis√©e aujourd\'hui<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-:04-7\">7</a></sup>. Constitu√©e de huit pi√®ces de cuir cousues autour d\'une <a href=\"https://fr.wikipedia.org/wiki/Chambre_%C3%A0_air\">chambre √† air</a>, il existe en plusieurs tailles&nbsp;: 7 pour les hommes, 6 pour les femmes, et de 5 √† 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqu√© par <a href=\"https://fr.wikipedia.org/wiki/Spalding_(entreprise)\">Spalding</a>, et celui de la FIBA par l\'√©quipementier japonais <a href=\"https://fr.wikipedia.org/wiki/Molten\">Molten</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption>Un terrain de basket-ball selon les r√®gles de la FIBA.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption>Un panier de basket-ball √† l\'ext√©rieur, avec un arceau, un filet et un panneau transparent.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2>V√™tements et accessoires</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Au tout d√©but du si√®cle, les joueurs portaient des maillots en <a href=\"https://fr.wikipedia.org/wiki/Tricot\">tricot</a> de <a href=\"https://fr.wikipedia.org/wiki/Laine\">laine</a> et des pantalons en <a href=\"https://fr.wikipedia.org/wiki/Textile\">√©toffe</a>. La duret√© du jeu et le mauvais √©tat des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. D√®s les <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1910\">ann√©es 1910</a>, le port du maillot se d√©veloppe et les pantalons en √©toffe sont remplac√©s par des <a href=\"https://fr.wikipedia.org/wiki/Short\">shorts</a>. Dans les <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1960\">ann√©es 1960</a>, l\'habillement des joueurs √©volue¬†: les maillots deviennent plus l√©gers et sont progressivement r√©alis√©s en <a href=\"https://fr.wikipedia.org/wiki/Fibre_synth%C3%A9tique\">fibres synth√©tiques</a>. √Ä l\'initiative notamment de <a href=\"https://fr.wikipedia.org/wiki/Michael_Jordan\">Michael Jordan</a>, les shorts sont allong√©s et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts¬†: les <em><a href=\"https://fr.wikipedia.org/wiki/Basketball_sleeve\">sleeves</a></em>. D\'autres comme <a href=\"https://fr.wikipedia.org/wiki/Slick_Watts\">Slick Watts</a> ou <a href=\"https://fr.wikipedia.org/wiki/Bill_Walton\">Bill Walton</a> ont rendu populaires les bandeaux, port√©s autour de la t√™te ou au poignet. Fabriqu√©s en <a href=\"https://fr.wikipedia.org/wiki/Nylon\">nylon</a> et <a href=\"https://fr.wikipedia.org/wiki/%C3%89lasthanne\">√©lasthanne</a> extensibles, ils sont destin√©s √† garder les muscles chauds ou √©ponger la sueur, mais sont aussi utilis√©s comme un accessoire de style.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les <a href=\"https://fr.wikipedia.org/wiki/Chaussure_de_basket-ball\">chaussures de basket-ball</a> ont √©galement chang√© au fil du temps. Au d√©but du si√®cle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'√©quipementier sportif <a href=\"https://fr.wikipedia.org/wiki/Spalding_(entreprise)\">Spalding</a> met en vente un mod√®le sp√©cialement con√ßu pour le basket-ball, avec un syst√®me de ventouses pour √©viter de glisser. Des mod√®les en toile et en caoutchouc ont ensuite √©t√© cr√©√©s, parfois sur les conseils de joueurs comme <a href=\"https://fr.wikipedia.org/wiki/Chuck_Taylor\">Chuck Taylor</a>, qui contribua au d√©veloppement des <a href=\"https://fr.wikipedia.org/wiki/Converse_(chaussure)\">Converse</a>. Les <a href=\"https://fr.wikipedia.org/wiki/Chuck_Taylor_All_Star\">Chuck Taylor All Star</a> et les <a href=\"https://fr.wikipedia.org/wiki/Keds\">Keds</a> sont les chaussures les plus utilis√©es dans les ann√©es 1960 et <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1970\">1970</a>. √Ä partir des <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1980\">ann√©es 1980</a> appara√Æt la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la <a href=\"https://fr.wikipedia.org/wiki/Mall%C3%A9ole_m%C3%A9diale\">mall√©ole m√©diale</a> afin d\'√©viter les risques de torsion de la <a href=\"https://fr.wikipedia.org/wiki/Cheville_(anatomie)\">cheville</a>¬†: <a href=\"https://fr.wikipedia.org/wiki/Nike\">Nike</a> et <a href=\"https://fr.wikipedia.org/wiki/Adidas\">Adidas</a> dominent alors le march√©. Les plus grands joueurs sont sponsoris√©s par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs d√©velopp√© sa propre collection de baskets nomm√©e <a href=\"https://fr.wikipedia.org/wiki/Nike_Air_Jordan\">Air Jordan</a>. Si les chaussures de basket-ball se sont impos√©es en comp√©tition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples <a href=\"https://fr.wikipedia.org/wiki/Chaussure_de_sport\">baskets</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans les matchs officiels, chaque joueur porte un maillot num√©rot√©. La r√®gle FIBA impose les num√©ros de 4 √† 15 lors des comp√©titions internationales, soit douze num√©ros (autant qu\'il y a de joueurs dans une √©quipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel num√©ro de 0 √† 99 compris (le 00 existe aussi). Ainsi, en g√©n√©ral et dans la mesure du possible, les joueurs de NBA conservent le m√™me num√©ro durant toute leur carri√®re, m√™me en changeant d\'√©quipe, sauf quand un joueur le poss√®de d√©j√† ou quand celui-ci est retir√©. Lorsque certains joueurs marquent l\'histoire de leur <a href=\"https://fr.wikipedia.org/wiki/Franchise_(sport)\">franchise</a>, il arrive que celle-ci d√©cide de <a href=\"https://fr.wikipedia.org/wiki/Maillot_retir%C3%A9\">retirer leur num√©ro</a> pour leur rendre hommage. Ainsi, le c√©l√®bre num√©ro 23 port√© par Michael Jordan aux <a href=\"https://fr.wikipedia.org/wiki/Bulls_de_Chicago\">Bulls de Chicago</a> a √©t√© rendu indisponible dans cette franchise apr√®s son d√©part.</p>\n<!-- /wp:paragraph -->', '√âquipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 13:46:37', '2020-04-30 11:46:37', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
(67, 1, '2020-04-30 13:55:11', '2020-04-30 11:55:11', '<!-- wp:paragraph -->\n<p><span style=\"color:#dbe8ed\" class=\"has-inline-color\">L</span><span style=\"color:#d5f1fc\" class=\"has-inline-color\">\'histoire du basket-ball f√©minin d√©bute en 1892 au <em>Smith College</em> (Massachusetts), lorsque la professeure d\'√©ducation physique Senda Berenson Abbott adapte les r√®gles du jeu pour les femmes. Ainsi, elle interdit d\'arracher le ballon √† l\'adversaire ou de dribbler au sol plus de trois fois, afin de ne pas <q>d√©velopper une tendance √† la nervosit√© et perdre la gr√¢ce, la dignit√© et l\'estime de soi</q>. Peu apr√®s avoir √©t√© embauch√©e, elle rencontre Naismith afin d\'en apprendre davantage sur le basket-ball. Convaincue de l\'int√©r√™t de ce sport et des valeurs qu\'il peut v√©hiculer, elle organise le premier match universitaire f√©minin au <em>Smith College</em> le 21 mars 1893&nbsp;: les √©l√®ves en premi√®re ann√©e (<em>freshmen</em>) jouent contre les deuxi√®mes ann√©es (<em>sophomores</em>). Le sport s\'implante dans plusieurs universit√©s pour femmes, dont Wellesley, Vassar et Bryn Mawr College. Le 4 avril 1896, l\'√©quipe de Stanford affronte celle de Berkeley dans un match √† neuf contre neuf, qui voit la victoire de Stanford par 2‚Äì1.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1895, Clara Gregory Baer publie le premier recueil des r√®gles du basket-ball f√©minin, alors appel√© basquette. Les r√®gles de Berenson sont publi√©es pour la premi√®re fois en 1899, et celle-ci r√©alise la premi√®re √©dition du <em>Women\'s Basketball Guide</em> d\'Albert Spalding en 1901. La pratique f√©minine est alors tr√®s mal consid√©r√©e&nbsp;: devant le d√©veloppement du sport dans les lyc√©es, de nombreuses √©tudes tentent de prouver les effets du basket-ball sur la moralit√© des jeunes filles et pr√¥nent son interdiction. Les joueuses portent le corset ainsi que de longues robes, qui les font fr√©quemment tr√©bucher. Le tir devait √™tre effectu√© √† une seule main&nbsp;: tirer √† deux mains √©tait jug√© disgracieux car il mettait la poitrine en avant. Les joueuses des <em>Edmonton Grads</em>, une √©quipe canadienne qui r√©alise des tourn√©es entre 1915 et 1940, n\'√©taient pas pay√©es et devaient imp√©rativement rester c√©libataires.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">De premi√®res stars f√©minines √©mergent aux √âtats-Unis, comme Mildred Didrickson des Golden Cyclones et l\'√©quipe des All American Red Heads. Cette derni√®re se produit en spectacle √† la mani√®re des Globetrotters de Harlem et joue parfois contre des √©quipes masculines, avec les r√®gles destin√©es aux hommes. Elles ont cependant pour obligation de se maquiller et de soigner leur apparence. D√®s 1924, la F√©d√©ration sportive f√©minine internationale organise une comp√©tition de basket-ball. Les <em>Edmonton Grads</em> dominent le basket-ball f√©minin jusqu\'aux ann√©es 1940&nbsp;: elles jouent contre toutes les √©quipes qui acceptent de les d√©fier et remportent 522&nbsp;victoires pour seulement 20&nbsp;d√©faites. Elles remportent √©galement le tournoi de d√©monstration du basket-ball f√©minin aux Jeux olympiques de 1924, 1928, 1932 et 1936.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball f√©minin acc√®de √† plus de reconnaissance dans la seconde moiti√© du <abbr title=\"20·µâ si√®cle\">XX<sup>e</sup></abbr>&nbsp;si√®cle, avec notamment la cr√©ation du championnat du monde de basket-ball f√©minin en 1953 et du championnat d\'Afrique en 1966. Le sport prend son essor aux √âtats-Unis apr√®s l\'adoption du Titre IX, qui interdit toute discrimination sur la base du sexe dans les programmes d\'√©ducation soutenus par l‚Äô√âtat, et permet la constitution de nombreuses √©quipes universitaires&nbsp;: un championnat NCAA f√©minin est cr√©√© en 1982. En 1976, le basket-ball f√©minin devient un sport olympique. L\'√©quipe des √âtats-Unis (7) et celle d\'URSS/Russie (3) se partagent les dix titres mis en jeu. En 1985, Senda Berenson, Bertha Teague et Margaret Wade deviennent les premi√®res femmes √† √™tre intronis√©es au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball f√©minin se renforce en 1997 avec la cr√©ation de la Women\'s National Basketball Association (WNBA), sur le mod√®le de la NBA. Elle voit rapidement √©merger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffus√©s sur la cha√Æne de t√©l√©vision ESPN depuis 2009 et participent au d√©veloppement de la popularit√© du basket-ball f√©minin.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'√©quipe f√©minine de basket-ball du Smith College en 1902.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">La joueuse fran√ßaise C√©line Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Basket-ball f√©minin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 13:55:11', '2020-04-30 11:55:11', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0);
