(68, 1, '2020-04-30 14:06:48', '2020-04-30 12:06:48', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Ach√®vement de la professionnalisation</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La NBA gagne en visibilit√© et est diffus√©e dans un nombre croissant de pays, dont la France √† partir de 1985. De nouveaux talents √©mergent dans les ann√©es 1970, comme Kareem Abdul-Jabbar (meilleur marqueur de l\'histoire de la NBA), Elvin Hayes, Moses</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">Malone, Robert Parish ou Bernard King, ainsi que dans les ann√©es 1980 o√π d√©butent entre autres Hakeem Olajuwon, John Stockton, Karl Malone, Dominique Wilkins et Patrick Ewing. Toutefois, trois joueurs dominent la d√©cennie et contribuent √† accro√Ætre la popularit√© du basketball dans le monde¬†: Larry Bird, Magic Johnson et surtout Michael Jordan, consid√©r√© comme le plus grand joueur de l\'histoire. √Ä partir des ann√©es 1990, quelques √©quipes parviennent √† remettre en cause la domination des Lakers de Los Angeles et des Celtics de Boston sur le basketball am√©ricain, comme les Bulls de Chicago emmen√©s par Jordan (six titres entre 1991 et 1998) et les Spurs de San Antonio (cinq titres de 1999 √† 2014). De nouvelles stars font leur apparition¬†: David Robinson, Gary Payton, Jason Kidd, Steve Nash, Dirk Nowitzki, Tim Duncan, Kobe Bryant ou encore Shaquille O\'Neal, connu pour son physique impressionnant et ses fac√©ties sur le terrain.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La professionnalisation du basket-ball se poursuit dans les ann√©es 1970 et ne s\'ach√®ve v√©ritablement qu\'en 1990. En 1989, la FIBA cesse d\'exclure les joueurs professionnels de ses comp√©titions, et des joueurs professionnels sont pour la premi√®re fois admis aux Jeux olympiques de 1992. N√©anmoins, la pratique amateur continue de se d√©velopper¬†: en 2012, vingt-six millions d\'Am√©ricains pratiquent le basketball (dont quinze millions de mani√®re occasionnelle). En juin 2015, la F√©d√©ration fran√ßaise de basket-ball annonce une progression importante du nombre de licenci√©s, avec un record de plus de 600¬†000, dont 36¬†% de femmes. Au d√©but des ann√©es 2010, le basket-ball est l\'un des sports les plus pratiqu√©s au monde, avec plus de 100¬†millions de licenci√©s et plus de 450¬†millions de pratiquants occasionnels.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Mondialisation et contestation de la domination am√©ricaine</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Depuis la cr√©ation du sport, les √âtats-Unis ont domin√© les comp√©titions internationales masculines et f√©minines, quoique concurrenc√©s par les √©quipes de Yougoslavie (puis de Serbie) et d\'Union sovi√©tique. L\'√©quipe am√©ricaine a notamment remport√© l\'or olympique √† quatorze reprises, sur dix-huit olympiades o√π le basketball figure au programme. La premi√®re <em>Dream Team</em> (¬´¬†√âquipe de r√™ve¬†¬ª) am√©ricaine, compos√©e notamment de Michael Jordan, Magic Johnson, Charles Barkley et Scottie Pippen, entre en comp√©tition lors des Jeux olympiques de Barcelone et remporte le titre avec un √©cart moyen de 42 points sur ses adversaires. Elle est ainsi consid√©r√©e comme la meilleure √©quipe de l\'histoire. Toutefois, avec la popularit√© croissante du basket-ball dans le monde, de nouvelles √©quipes nationales gagnent en niveau et parviennent √† contester la supr√©matie am√©ricaine. L\'√©quipe am√©ricaine, bien que compos√©e int√©gralement de joueurs √©voluant en NBA, finit sixi√®me lors des championnats du monde en 2002 derri√®re la Yougoslavie, l\'Argentine, l\'Allemagne, la Nouvelle-Z√©lande et l\'Espagne. Lors des Jeux olympiques de 2