(69, 1, '2020-04-30 14:09:56', '2020-04-30 12:09:56', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu apr√®s sa cr√©ation, le basket-ball s\'√©tend progressivement en dehors des √âtats-Unis et du Canada et atteint l\'Europe, o√π il se d√©veloppe rapidement. En 1909 se tient le premier match international de basketball, opposant le Mayak Saint-P√©tersbourg (√† domicile) √† une √©quipe de YMCA am√©ricaine. Le premier grand √©v√®nement europ√©en se d√©roule en 1919 √† Joinville-le-Pont durant les Jeux interalli√©s¬†: les √âtats-Unis, emmen√©s par Marty Friedman, l\'emportent contre la France en finale. Le jeu gagne en popularit√© dans ces deux pays.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 18 juin 1932, la F√©d√©ration internationale de basket-ball amateur (FIBA) est fond√©e √† Gen√®ve par l\'Argentine, la Tch√©coslovaquie, la Gr√®ce, l\'Italie, la Lettonie, le Portugal, la Roumanie et la Suisse. √Ä l\'origine, cette f√©d√©ration ne supervise que les √©quipes d\'amateurs. Elle joue un r√¥le fondamental dans l\'inscription du basketball au programme des Jeux olympiques d\'√©t√© de 1936 √† Berlin. Les matchs y sont disput√©s en ext√©rieur, sur un terrain en terre battue. Le premier titre olympique est remport√© par l\'√©quipe nationale am√©ricaine, avec entre autres Sam Balter, Ralph Bishop et Francis Johnson, contre l\'√©quipe du Canada. Le 22 ao√ªt 1951, √† Berlin-Ouest, une rencontre est disput√©e devant plus de 75¬†000¬†spectateurs, ce qui en ferait la plus importante fr√©quentation pour un match de basket-ball.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le premier championnat du monde de basket-ball est organis√© en Argentine en 1950, et trois ans plus tard a lieu le premier championnat du monde de basket-ball f√©minin √† Santiago du Chili. L\'√©preuve f√©minine ne dev