(72, 1, '2020-04-30 14:44:59', '2020-04-30 12:44:59', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>Young Men\'s Christian Association</em> (YMCA) joue un grand r√¥le dans la diffusion du basketball √† travers les √âtats-Unis et le Canada, mais aussi dans le reste du monde. Le premier match europ√©en est disput√© en 1893 √† Paris, dans le quartier de Montmartre. √Ä la m√™me √©poque, des matchs sont organis√©s √† Tianjin (Chine), en Inde, au Japon et en Perse. D√®s 1895, le sport est pratiqu√© dans plusieurs lyc√©es de jeunes filles. Toutefois, la YMCA ne parvient pas √† pr√©server l\'esprit originel du basketball, qui devient de plus en plus violent et est pratiqu√© par des bandes de jeunes bagarreurs. Pour permettre le respect des r√®gles de jeu, la premi√®re ligue professionnelle, la <em>National Basketball League</em>, est fond√©e aux √âtats-Unis en 1898 avec six √©quipes. Les premiers champions sont les <em>Trenton Nationals</em>, suivis des <em>New York Wanderers</em>, des <em>Bristol Pile Drivers</em> et des <em>Camden Electrics</em>. La ligue est dissoute en 1904. De nombreux championnats sont alors organis√©s.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout d√©but du <abbr title=\"20·µâ si√®cle\">XX<sup>e</sup></abbr>¬†si√®cle, le basketball devient peu √† peu une activit√© courante dans de nombreuses universit√©s am√©ricaines, notamment gr√¢ce √† l\'action de James Naismith. Le premier match interuniversitaire est disput√© le 9 f√©vrier 1895 entre l\'universit√© Hamline et l\'√©cole d\'agriculture de l\'universit√© du Minnesota¬†; cette derni√®re remporte le match sur le score de 9 points √† 3. La premi√®re √©quipe universitaire est fond√©e en 1896 au <em>Geneva College</em> de Pittsburgh. Naismith lui-m√™me entra√Æne pendant six ans l\'√©quipe de l\'universit√© du Kansas, avant de laisser la place √† Phog Allen. Amos Alonzo Stagg introduit le basketball √† l\'universit√© de Chicago tandis qu\'Adolph Rupp, un ancien √©l√®ve de Naismith, conna√Æt le succ√®s en tant qu\'entra√Æneur de l\'universit√© du Kentucky.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">D√®s 1897, l\'<em>Amateur Athletic Union</em> prend le contr√¥le de la gestion du basketball √† la YMCA. En 1901, de nombreuses universit√©s commencent √† financer des matchs, dont l\'universit√© de Chicago, Columbia, le Dartmouth College, l\'universit√© du Minnesota, l\'Acad√©mie navale d\'Annapolis, l\'universit√© du Colorado et Yale. Le premier match universitaire au Canada a lieu le 6 f√©vrier 1904 et oppose l\'universit√© McGill √† l\'universit√© Queen\'s. En avril 1905, des repr√©sentants de quinze universit√©s cr√©ent le <em>Basket Ball Rule Committee</em> (<q>Comit√© de r√®glementation du basket-ball</q>) afin de superviser le basketball universitaire. La m√™me ann√©e, sur la suggestion du pr√©sident Theodore Roosevelt qui estimait que les blessures √©taient trop fr√©quentes dans le football am√©ricain, se forme l‚Äô<em>Intercollegiate Athletic Association</em>. Elle absorbe le comit√© en 1909, et devient en 1910 la NCAA - la principale f√©d√©ration am√©ricaine de sport universitaire actuelle.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu avant le d√©but de la Premi√®re Guerre mondiale, la NCAA et l‚Äô<em>Amateur Athletic Union</em> se disputent ainsi le contr√¥le des r√®gles</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">du jeu. Apr√®s l\'entr√©e en guerre des √âtats-Unis en 1917, les forces arm√©es am√©ricaines contribuent √† la diffusion du basketball sur le continent europ√©en¬†: plusieurs entra√Æneurs sportifs √©taient pr√©sents aux c√¥t√©s des troupes. Naismith a lui-m√™me pass√© deux ans en France avec la YMCA √† cette √©poque.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":19,\"width\":810,\"height\":642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Kansas_U_team_1899.jpg\" alt=\"\" class=\"wp-image-19\" width=\"810\" height=\"642\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'√©quipe de l\'universit√© du Kansas en 1899, avec leur entra√Æneur James Naismith (rang du haut, √† droite).</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'D√©veloppement aux √âtats-Unis et au Canada', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2020-04-30 14:44:59', '2020-04-30 12:44:59', '', 18, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/18-revision-v1/', 0, 'revision', '', 0),
(71, 1, '2020-04-30 14:42:26', '2020-04-30 12:42:26', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>National Basketball League</em>, fond√©e en 1898 et dissoute en 1904, est le pr√©curseur des nombreuses ligues professionnelles cr√©√©es aux √âtats-Unis et dans le reste du monde tout au long du si√®cle. Hormis la <em>Eastern Basket Ball League</em>, fond√©e en 1909, les principales ligues professionnelles sont cr√©√©es au d√©but des ann√©es 1920¬†: la <em>Metropolitan Basketball League</em> (1921) et l\'<em>American Basketball League</em> (1925). En 1922 est cr√©√©e l\'√©quipe des Rens de Dayton (√©galement appel√©e New York Renaissance), compos√©e uniquement d\'Afro-Am√©ricains. Leurs principaux rivaux √©taient les Original Celtics, consid√©r√©s comme les <q>p√®res du basketball</q> et pr√©sent√©s comme les champions du monde de la discipline. √Ä l\'image des Harlem Globetrotters, fond√©s en 1926, ceux-ci organisaient des tourn√©es dans le pays √† la mani√®re d\'un cirque. Les Celtics dominent le basketball am√©ricain de 1922 √† 1928, ann√©e de leur dissolution.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 6 juin 1946 est cr√©√©e la <em>Basketball Association of America</em> (BAA)¬†: son premier match oppose les Huskies de Toronto, √† domicile, aux Knickerbockers de New York. Apr√®s trois saisons, en 1949, la ligue fusionne avec la <em>National Basketball League</em> pour former la <em>National Basketball Association</em> (NBA). D√®s les ann√©es 1950 apparaissent les premi√®res stars du basketball, dont le pivot George Mikan et le meneur Bob Cousy. Les Lakers de Minneapolis (qui s\'installent √† Los Angeles en 1960) et les Celtics de Boston assoient leur domination sur la NBA en remportant seize titres √† eux deux de 1949 √† 1970. Les deux √©quipes s\'opposent alors dans une rivalit√© qui les voit s\'affronter √† dix reprises en finales entre 1959 et 1987.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les ann√©es 1960 voient √©clore plusieurs joueurs aujourd\'hui l√©gendaires¬†: l\'arri√®re des Lakers Jerry West¬†; le meneur Oscar Robertson¬†; le pivot des Celtics Bill Russell, onze fois champion NBA et qui r√©volutionna la mani√®re de pratiquer la d√©fense; et Wilt Chamberlain, qui d√©tient encore aujourd\'hui de nombreux records de statistiques. Le 2 mars 1962, il inscrit 100¬†points lors d\'un match entre les Warriors de Philadelphie et les Knicks de New York.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1967, l\'<em>American Basketball Association</em> (ABA) est lanc√©e pour tenter de rivaliser avec la NBA, qui conna√Æt un pic de popularit√©. Celle-ci suscite l\'int√©r√™t du public en proposant un nouveau style de jeu et des r√®gles diff√©rentes. La balle est tricolore (rouge, blanc, bleu), le jeu est plus agressif et spectaculaire, et le tir √† trois points est cr√©√©. Julius Erving est alors le joueur le plus c√©l√®bre de cette ligue, gr√¢ce √† un style a√©rien o√π le saut et le jeu au-dessus du panier sont aussi importants que le tir. Toutefois, les faibles recettes et le succ√®s d√©clinant de la ligue la contraignent √† √™tre absorb√©e par la NBA¬†: ses quatre meilleures √©quipes (les Nets de New York, les Nuggets de Denver, les Pacers de l\'Indiana et les Spurs de San Antonio) y sont incorpor√©es, et certains √©l√©ments sont conserv√©s, comme le tir √† trois points. Apr√®s 1970, la NBA est sans conteste la ligue de basketball la plus importante, tant en termes de popularit√© que de budget ou de niveau de jeu.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":28,\"width\":644,\"height\":873,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Wilt_Chamberlain_Bill_Russell_2-755x1024.jpg\" alt=\"\" class=\"wp-image-28\" width=\"644\" height=\"873\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Bill Russell (√† gauche) en d√©fense sur Wilt Chamberlain. De 1959 √† 1969, ces deux pivots s\'opposent et donnent lieu √† l\'une des plus grandes rivalit√©s de l\'histoire du basket-ball.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Cr√©ation des premi√®res ligues professionnelles am√©ricaines', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2020-04-30 14:42:26', '2020-04-30 12:42:26', '', 27, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/27-revision-v1/', 0, 'revision', '', 0),
(73, 1, '2020-04-30 14:48:30', '2020-04-30 12:48:30', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball est invent√© en d√©cembre 1891 par James Naismith, professeur d\'√©ducation physique canado-am√©ricain au <em>Springfield College</em>, dans l\'√âtat du Massachusetts (√âtats-Unis). Lors d\'une journ√©e de pluie, Naismith tente d\'assurer malgr√© tout son cours de sport, et essaie de d√©velopper un sport d\'int√©rieur pour maintenir la condition physique de ses √©l√®ves entre les saisons de football am√©ricain et de baseball, pendant les longs hivers de la Nouvelle-Angleterre. Il souhaite leur trouver une activit√© o√π les contacts physiques sont restreints, afin d\'√©viter les risques de blessure.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Apr√®s avoir √©cart√© certains jeux trop violents ou peu appropri√©s √† une pratique en salle, il reprend l\'id√©e d\'un ancien jeu de balle maya (le <em>Pok-ta-pok</em>) et place deux caisses de p√™ches sur les rampes du gymnase, √† 3,05¬†m√®tres de hauteur (dix pieds). Le but du jeu est de faire p√©n√©trer un ballon dans ces caisses en bois pour marquer un <q>panier</q>. Contrairement aux paniers actuels, la caisse de p√™ches dispose d\'un fond¬†: la balle devait donc √™tre r√©cup√©r√©e manuellement apr√®s chaque <q>panier</q> inscrit. Afin d\'√©viter d\'avoir √† rechercher syst√©matiquement la balle, le fond du panier est √©vid√© pour pouvoir l\'extraire avec une longue perche. Naismith √©tablit rapidement treize r√®gles principales (les Treize r√®gles originelles) pour rendre le jeu praticable¬†; la majorit√© sont encore en vigueur. Ces r√®gles comportent notamment l\'interdiction de courir en tenant la balle (marcher) et de <q>donner des coups d\'√©paule, de tenir, de pousser ou de faire tomber de quelconque mani√®re</q> l\'adversaire. Elles d√©finissent en outre la dur√©e d\'une partie¬†: quatre quarts-temps de quinze minutes, avec une pause de cinq minutes entre elles.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Ce sport est baptis√© basket-ball, ce qui signifie litt√©ralement en anglais ¬´¬†ballon panier¬†¬ª. Il est d\'abord pratiqu√© avec un ballon de football, puis avec des balles de couleur brune. Le tout premier match public de basket-ball est jou√© le 11 mars 1892 entre des √©l√®ves d\'une classe d\'√©tudiants de la <em>Springfield Christian Training Association</em> et leurs enseignants. Les √©tudiants gagnent 5-1¬†; le seul panier marqu√© par les enseignants est celui du c√©l√®bre entra√Æneur de football am√©ricain Amos Alonzo Stagg. La m√™me ann√©e, le jeu est adapt√© pour √™tre jou√© par des femmes. Le premier match f√©minin se d√©roule en 1893 au <em>Smith College</em> de Northampton, dans le Massachusetts. D√®s 1897-1898, le nombre de joueurs par √©quipe est fix√© √† cinq. √Ä l\'occasion d\'une d√©monstration au Y.M.C.A. de New York en avril 1892, la discipline gagne une premi√®re mention dans The New York Times. Il est pr√©sent√© comme <q>un nouveau sport de balle, un substitut du football sans ses aspects brutaux</q>. Les premiers articles sur ce sport en France datent de 1897. Dans ce dernier pays, il est d\'abord plut√¥t consid√©r√© comme un sport f√©minin et se fait encore appeler ¬´¬†balle au panier¬†¬ª.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1906, les caisses en bois sont finalement remplac√©es par des anneaux en m√©tal fix√©s √† des panneaux. La balle passe ainsi √† travers un arceau et retombe au sol lorsqu\'un panier est inscrit. Le panneau sert quant √† lui √† √©viter que la balle n\'atterrisse dans les tribunes, et permet d\'effectuer des tirs avec rebond. Dans son journal, d√©couvert en 2006 par sa petite-fille, James Naismith fait part de ses appr√©hensions quant au jeu qu\'il a invent√©, et indique qu\'il y a introduit certaines r√®gles d\'un jeu enfantin m√©di√©val, le <em>Duck on a Rock</em>.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au d√©but de son histoire, le basket-ball est surtout port√© sur le jeu offensif et la d√©fense est rel√©gu√©e au second plan. La d√©fense est alors la phase passive du basket-ball, o√π les joueurs attendent l\'√©chec de l\'adversaire¬†; elle a depuis acquis un r√¥le comparable √† celui de l\'attaque. Par ailleurs, la passe et le tir √©taient les seules mani√®res de d√©placer la balle vers le panier. En effet, le dribble n\'existait pas dans le basket-ball originel, hormis lors d\'une √©ventuelle passe √† un co√©quipier avec rebond au sol¬†: il √©tait rendu difficile par la forme asym√©trique des premiers ballons. Il est devenu essentiel dans le jeu √† partir des ann√©es 1950, lorsque les ballons manufactur√©s eurent une forme r√©guli√®re et les qualit√©s de rebond n√©cessaires.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le sport prend diverses appellations en fonction des pays. En espagnol, il est nomm√© <em>baloncesto</em> (Espagne) ou <em>b√°squetbol</em> (Argentine); en italien <em>pallacanestro</em> ; et en tch√®que <em>ko≈°√≠kov√°</em>.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":22,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Dr._James_Naismith-1.jpg\" alt=\"\" class=\"wp-image-22\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">James Naismith, inventeur du basketball, avec un ballon et un panier.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":23,\"width\":376,\"height\":529,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Firstbasketball.jpg\" alt=\"\" class=\"wp-image-23\" width=\"376\" height=\"529\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le premier terrain de basket-ball au <em>Springfield College</em>.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Histoire du basket-ball', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-04-30 14:48:30', '2020-04-30 12:48:30', '', 1, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/1-revision-v1/', 0, 'revision', '', 0),
(77, 1, '2020-04-30 15:10:42', '2020-04-30 13:10:42', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Mat√©riel</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball se joue g√©n√©ralement dans un endroit couvert, comme un gymnase, mais peut aussi √™tre pratiqu√© sur des aires de jeu en tant que loisir, sous sa variante la plus populaire&nbsp;: le <em>streetball</em> (¬´&nbsp;basket-ball de rue&nbsp;¬ª). Le terrain est doublement sym√©trique, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 √† 29&nbsp;m√®tres de long sur 13 √† 15&nbsp;m√®tres de large. Les terrains en ext√©rieur (<em>playgrounds</em>) peuvent √™tre goudronn√©s ou en terre battue. Les terrains couverts sont g√©n√©ralement r√©alis√©s en parquet, avec des lattes d\'√©rable dispos√©es dans le sens de la longueur. Le nom et le logo de l\'√©quipe r√©sidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en comp√©tition poss√®dent des √©quipements suppl√©mentaires comme l\'horloge des 24 secondes, une table de marque (sur le c√¥t√©), des tableaux d\'affichage et des compteurs. Aux √âtats-Unis, la plupart comprennent √©galement des √©crans suspendus au plafond.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Aux deux extr√©mit√©s du terrain se trouve un panier, form√© par un anneau (ou <em>arceau</em>) m√©tallique situ√© √† 3,05&nbsp;m du sol, en dessous duquel est attach√© un filet ouvert en son centre. L\'arceau est fix√© √† un panneau rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un dunk puis revenir en position horizontale (les anneaux inclinables).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Sous chaque panier se trouve une zone rectangulaire appel√©e la raquette (ou zone restrictive). Un arc de cercle situ√© √† 6,25&nbsp;m (6,75&nbsp;m depuis 2010 pour les championnats de Pro A, Pro B, N1 fran√ßais et basket-ball f√©minin&nbsp;; 7,23&nbsp;m en NBA) de chaque panier repr√©sente la ligne de tirs √† trois points. Sous l\'anneau est trac√© un arc de cercle d\'un rayon de 1,25&nbsp;m dans lequel aucun passage en force d\'un attaquant ne sera siffl√© par l\'arbitre.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon de basket-ball standard est de forme sph√©rique, et a une masse de 650&nbsp;g et un diam√®tre de 24&nbsp;cm. Sa pression int√©rieure est de 0,55 atm. Initialement, le basket-ball se pratiquait avec un ballon de football, puis des ballons sp√©cifiques de couleur marron. Ce n\'est qu\'√† la fin des ann√©es 1950 que Tony Hinkle, d√©sireux de cr√©er une balle plus visible des joueurs et des spectateurs, d√©veloppe la balle de couleur orange encore utilis√©e aujourd\'hui. Constitu√©e de huit pi√®ces de cuir cousues autour d\'une chambre √† air, il existe en plusieurs tailles&nbsp;: 7 pour les hommes, 6 pour les femmes, et de 5 √† 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqu√© par Spalding, et celui de la FIBA par l\'√©quipementier japonais Molten.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un terrain de basket-ball selon les r√®gles de la FIBA.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un panier de basket-ball √† l\'ext√©rieur, avec un arceau, un filet et un panneau transparent.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">V√™tements et accessoires</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout d√©but du si√®cle, les joueurs portaient des maillots en tricot de laine et des pantalons en √©toffe. La duret√© du jeu et le mauvais √©tat des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. D√®s les ann√©es 1910, le port du maillot se d√©veloppe et les pantalons en √©toffe sont remplac√©s par des shorts. Dans les ann√©es 1960, l\'habillement des joueurs √©volue&nbsp;: les maillots deviennent plus l√©gers et sont progressivement r√©alis√©s en fibres synth√©tiques. √Ä l\'initiative notamment de Michael Jordan, les shorts sont allong√©s et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts&nbsp;: les <em>sleeves</em>. D\'autres comme Slick Watts ou Bill Walton ont rendu populaires les bandeaux, port√©s autour de la t√™te ou au poignet. Fabriqu√©s en nylon et √©lasthanne extensibles, ils sont destin√©s √† garder les muscles chauds ou √©ponger la sueur, mais sont aussi utilis√©s comme un accessoire de style.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les chaussures de basket-ball ont √©galement chang√© au fil du temps. Au d√©but du si√®cle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'√©quipementier sportif Spalding met en vente un mod√®le sp√©cialement con√ßu pour le basket-ball, avec un syst√®me de ventouses pour √©viter de glisser. Des mod√®les en toile et en caoutchouc ont ensuite √©t√© cr√©√©s, parfois sur les conseils de joueurs comme Chuck Taylor, qui contribua au d√©veloppement des Converse. Les Chuck Taylor All Star et les Keds sont les chaussures les plus utilis√©es dans les ann√©es 1960 et 1970. √Ä partir des ann√©es 1980 appara√Æt la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la mall√©ole m√©diale afin d\'√©viter les risques de torsion de la cheville&nbsp;: Nike et Adidas dominent alors le march√©. Les plus grands joueurs sont sponsoris√©s par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs d√©velopp√© sa propre collection de baskets nomm√©e Air Jordan. Si les chaussures de basket-ball se sont impos√©es en comp√©tition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples baskets.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dans les matchs officiels, chaque joueur porte un maillot num√©rot√©. La r√®gle FIBA imposait les num√©ros de 4 √† 15 (ce n\'est plus forc√©ment le cas) lors des comp√©titions internationales, soit douze num√©ros (autant qu\'il y a de joueurs dans une √©quipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel num√©ro de 0 √† 99 compris (le 00 existe aussi). Ainsi, en g√©n√©ral et dans la mesure du possible, les joueurs de NBA conservent le m√™me num√©ro durant toute leur carri√®re, m√™me en changeant d\'√©quipe, sauf quand un joueur le poss√®de d√©j√† ou quand celui-ci est retir√©. Lorsque certains joueurs marquent l\'histoire de leur franchise, il arrive que celle-ci d√©cide de retirer leur num√©ro pour leur rendre hommage. Ainsi, le c√©l√®bre num√©ro 23 port√© par Michael Jordan aux Bulls de Chicago a √©t√© rendu indisponible dans cette franchise apr√®s son d√©part.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":75,\"width\":656,\"height\":878,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Carmelo_Anthony_Nov_2013-765x1024.jpg\" alt=\"\" class=\"wp-image-75\" width=\"656\" height=\"878\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur am√©ricain Carmelo Anthony portant un √©quipement complet&nbsp;: maillot, short, bandeau et <em>shooting sleeve</em> avec protection au coude sur les deux bras.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', '√âquipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 15:10:42', '2020-04-30 13:10:42', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
