est √† ce moment-l√† que le match commence.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">√Ä l\'issue de la rencontre, l\'√©quipe ayant inscrit le plus de points remporte le match. En cas d\'√©galit√©, on joue alors cinq minutes de prolongation pour d√©partager les deux √©quipes, et ce quelle que soit la comp√©tition en cours. S\'il y a √† nouveau √©galit√© au terme de la prolongation, on rejoue une autre prolongation. Il n\'y a ainsi jamais de match nul au basket-ball (sauf en cas de phase finale aller/retour, o√π il peut y avoir match nul au match aller ou retour, le vainqueur se d√©cidant au cumul des points sur les deux matchs).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=QGGLH1EtA9Y\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=QGGLH1EtA9Y\n</div><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Exemples de Buzzer beater</span></figcaption></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'R√®glement', '', 'inherit', 'closed', 'closed', '', '78-revision-v1', '', '', '2020-04-30 16:39:35', '2020-04-30 14:39:35', '', 78, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/78-revision-v1/', 0, 'revision', '', 0),
(84, 1, '2020-04-30 20:20:47', '2020-04-30 18:20:47', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les rencontres professionnelles de basket-ball sont supervis√©es par trois arbitres. En NBA, l\'arbitrage est effectu√© par un arbitre pr√©sent sur le terrain (nomm√© <em>crew chief</em>) et deux arbitres de touche. La <a href=\"https://fr.wikipedia.org/wiki/FIBA\">FIBA</a> utilise une organisation diff√©rente avec un arbitre dit <q>de queue</q> (le plus proche du centre du terrain), un dit <q>de t√™te</q> (sous le panier) et un troisi√®me dit <q>central</q> (entre ses deux coll√®gues). Les officiels de la table de marque sont charg√©s de compter les points inscrits, de g√©rer le chronom√®tre de jeu, de noter les fautes individuelles et d\'√©quipe commises ainsi que les remplacements effectu√©s. Ils g√®rent √©galement la fl√®che de possession altern√©e et le chronom√®tre des tirs (ou horloge des 24 secondes) ainsi que les drapeaux signalant que la prochaine faute d\'une √©quipe entra√Ænera deux lancers francs.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les joueurs doivent manipuler le ballon avec les mains exclusivement. Celui-ci peut √™tre d√©plac√© en √©tant lanc√©, pass√© entre deux joueurs, roul√© au sol ou d√©vi√© par la main. En revanche, il est interdit de le toucher avec une partie quelconque de la jambe de mani√®re d√©lib√©r√©e ou de le frapper du poing¬†: cela constitue une violation qui entra√Æne la perte de possession du ballon.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Lorsqu\'un joueur est en possession du ballon, il doit dribbler, c\'est-√†-dire faire constamment rebondir le ballon sur le sol avec une main, pour pouvoir se d√©placer avec. Si le joueur qui poss√®de le ballon prend plus de deux appuis sans dribbler, ou s\'il fait un saut complet en conservant le ballon √† la retomb√©e, il est alors sanctionn√© par un marcher (en anglais¬†: <em>traveling</em>), et le ballon est rendu √† l\'√©quipe adverse par une remise en jeu. Lorsqu\'un joueur reprend son dribble apr√®s l\'avoir arr√™t√©, ou r√©cup√®re le ballon apr√®s l\'avoir l√¢ch√© sans que celui-ci n\'ait rien touch√©, il est sanctionn√© par une reprise de dribble (<em>double dribble</em> en anglais). De m√™me, un joueur qui a le ballon n\'a pas le droit de poser sa main sous le ballon au cours de son dribble, ce qui constitue un porter de ballon (<em>carry</em>). La main doit en effet toujours √™tre en contact avec l\'h√©misph√®re sup√©rieur du ballon. Dans les deux cas, la balle est rendue √† l\'adversaire.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon est hors-jeu d√®s qu‚Äôil rebondit sur ou en dehors des limites du terrain (les lignes de touche ne font pas partie du terrain), ou lorsqu\'il est touch√© par un joueur qui mord ou d√©passe les limites du terrain. Contrairement au football, ce n‚Äôest pas la position absolue du joueur ou du ballon qui compte, mais le rebond ou l\'appui¬†: un joueur peut ainsi plonger en dehors du terrain et sauver la balle, du moment qu\'il saute depuis l\'int√©rieur du terrain et qu\'il la l√¢che avant de toucher le sol en dehors du terrain. Si une √©quipe se trouve en zone avant (moiti√© de terrain adverse) avec le ballon, et que ce dernier vient √† revenir en zone arri√®re sans toucher un adversaire (par une passe ou un appui dans sa propre moiti√© de terrain), l\'arbitre siffle un retour en zone (<em>backcourt violation</em>). Le ballon est rendu √† l\'adversaire √† l\'endroit le plus proche de la violation, en dehors des limites du terrain. Pour √™tre consid√©r√© en zone avant il faut le ballon et les deux appuis du joueur qui contr√¥le la balle aient travers√© la ligne m√©diane.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Afin de favoriser un jeu offensif, des r√®gles de temps de possession du ballon ont progressivement √©t√© impos√©es. Les joueurs disposent de 8¬†secondes (NBA, FIBA) ou 10¬†secondes (NCAA) pour franchir leur moiti√© de terrain en attaque. Les attaquants doivent en outre effectuer un tir avant 24¬†secondes, mesur√©es par l\'horloge des 24 secondes, depuis 1954 pour la NBA. La r√®gle est adapt√©e √† 30¬†secondes par la FIBA, qui passe aussi √† 24¬†secondes en 1999. La NCAA choisit 35¬†secondes avant de passer √† 30 pour la saison 2015-2016.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Un joueur en attaque ne peut rester plus de trois secondes d\'affil√©e dans la raquette √† partir du moment ou son √©quipe d√©passe le milieu de terrain. Les 3¬†secondes ne sont plus comptabilis√©es d√®s qu\'un joueur tente un tir au panier. Lors d\'une remise en jeu, l‚Äô√©quipe attaquante dispose de 5¬†secondes pour effectuer celle-ci. Un joueur qui poss√®de le ballon et qui arr√™te de dribbler dispose de 5¬†secondes pour s\'en d√©barrasser (par une passe, un tir, ou en la faisant habilement toucher par un adversaire) si le joueur adverse le soumet √† une pression d√©fensive (action de d√©fense individuelle rapproch√©e).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les r√®gles connaissent r√©guli√®rement des √©volutions importantes comme avec l‚Äôintroduction la r√®gle des 24 secondes (1954 en NBA, 1956 par la FIBA d\'abord avec 30 secondes), du panier √† trois points en 1984, puis en 2010 un nouveau trac√© du terrain faisant notamment passer la ligne des tirs prim√©s √† 6,75¬†m (22‚Ä≤¬†2‚Ä≥).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les r√®gles changent au fil du temps, parfois en r√©action √† l\'influence d\'un joueur. Ainsi le <em>goaltending</em> ‚Äì changer la trajectoire de la balle lorsque celle-ci se trouve dans la zone cylindrique situ√©e au-dessus de l‚Äôarceau ‚Äì n‚Äôest sanctionn√© qu\'√† partir de 1956 que parce que Bill Russell l\'utilisait trop facilement en NCAA. La m√™me ann√©e, il est d√©finitivement interdit de franchir la ligne des lancers francs avant le tir car Wilt Chamberlain d√©tournait l\'exercice en prenant trois pas d‚Äô√©lan pour transformer son tir en lay-up. √Ä partir du 29 mars 1967 et jusqu\'en 1976, la NCAA bannit le dunk pour minorer la domination de Lew Alcindor (Kareem Abdul-Jabbar).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Enfin, l\'interf√©rence¬†(en) (<em>goaltending</em>) est une violation du r√®glement qui se manifeste dans plusieurs cas¬†: si un joueur touche la balle alors qu\'elle est sur le cercle, par-dessus ou par-dessous le panier¬†; qu\'elle a touch√© la planche mais pas le cercle¬†; qu\'elle d√©crit une trajectoire descendante vers le panier¬†; ou si un joueur abaisse volontairement l\'arceau pour emp√™cher le tir de rentrer. Si l\'√©quipe en attaque commet la faute, le panier est annul√©, mais il est accord√© si l\'√©quipe d√©fensive commet la faute m√™me si le ballon ne p√©n√®tre pas dans le panier.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":85,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Nalini_Hawkins_2011.jpg\" alt=\"\" class=\"wp-image-85\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Une joueuse en train de dribbler pour avancer sur le terrain.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":86,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/NBA_shot_clock.jpg\" alt=\"\" class=\"wp-image-86\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Une horloge des 24 secondes affichant un temps restant de dix secondes pour l\'√©quipe en attaque.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=eEjJi1lOgAw\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=eEjJi1lOgAw\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=s2ioIuMu0mE\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=s2ioIuMu0mE\n</div></figure>\n<!-- /wp:core-embed/youtube -->', 'Violations', '', 'publish', 'closed', 'closed', '', 'violations', '', '', '2020-04-30 20:20:49', '2020-04-30 18:20:49', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=84', 0, 'page', '', 0),
(83, 1, '2020-04-30 17:22:51', '2020-04-30 15:22:51', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les dur√©es de jeu et les dimensions des lignes du terrain varient souvent en fonction et des championnats et des ligues organisatrices&nbsp;: le r√®glement pr√©sent√© ci-dessous comprend les normes internationales (<a href=\"https://fr.wikipedia.org/wiki/F%C3%A9d%C3%A9ration_internationale_de_basket-ball\">FIBA</a>) et nord-am√©ricaines (<a href=\"https://fr.wikipedia.org/wiki/National_Basketball_Association\">NBA</a>). La FIBA a toutefois annonc√© son intention de se rapprocher progressivement des normes am√©ricaines.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">L\'objectif du jeu est de marquer davantage de points que ses adversaires, en inscrivant des paniers tout en emp√™chant l\'autre √©quipe de le faire. Un panier inscrit vaut deux points, ou trois s\'il r√©sulte d\'un tir effectu√© derri√®re la ligne des trois points (6,75&nbsp;m d\'apr√®s la FIBA&nbsp;; 7,24&nbsp;m en NBA). Le lancer franc, accord√© par l\'arbitre apr√®s certaines fautes, n\'accorde qu\'un seul point.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">R√®gles du jeu</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Un match se d√©roule en quatre p√©riodes (appel√©es ¬´&nbsp;quarts-temps&nbsp;¬ª) de dix minutes selon les r√®gles <a href=\"https://fr.wikipedia.org/wiki/F%C3%A9d%C3%A9ration_internationale_de_basket-ball\">FIBA</a>, et quatre p√©riodes de douze minutes selon les r√®gles <a href=\"https://fr.wikipedia.org/wiki/National_Basketball_Association\">NBA</a>. Le championnat universitaire am√©ricain (<a href=\"https://fr.wikipedia.org/wiki/Championnat_NCAA_de_basket-ball\">NCAA</a>) utilise quant √† lui deux p√©riodes de vingt minutes. Une pause de quinze minutes est accord√©e √† la mi-temps dans les trois r√®glements, et les √©quipes changent de panier pour la seconde partie du jeu. Le chronom√®tre est arr√™t√© √† chaque coup de sifflet de l\'arbitre (en cas de faute ou de sortie par exemple)&nbsp;: la dur√©e r√©elle du match exc√®de donc beaucoup le temps de jeu r√®glementaire et atteint g√©n√©ralement deux heures. Le temps de jeu √©tant effectif, il n\'y a pas de temps additionnel comme au football&nbsp;; une sonnerie retentit au moment o√π la derni√®re seconde de chaque p√©riode s\'est √©coul√©e, mais un tir r√©ussi apr√®s la sonnerie peut √™tre accord√© si le joueur a l√¢ch√© le ballon avant que la sonnerie ne retentisse (<em>buzzer beater</em>).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Seuls cinq joueurs de chaque √©quipe peuvent √™tre pr√©sents simultan√©ment sur le terrain. Chaque √©quipe peut remplacer un ou plusieurs joueurs pendant les arr√™ts de jeu et les temps morts. Un nombre limit√© de temps morts est autoris√©, √† la demande de l\'entra√Æneur. Leur dur√©e est comprise entre vingt et cent secondes (en NBA). L\'entra√Æneur se trouve au bord du terrain et donne des instructions strat√©giques √† ses joueurs. Le banc accueille les joueurs rempla√ßants, ainsi que les entra√Æneurs assistants et d\'autres membres du personnel de l\'√©quipe.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au d√©but du match, l\'engagement est effectu√© par l\'arbitre sous la forme d\'un entre-deux. Pour cela, un joueur de chaque √©quipe (g√©n√©ralement le plus grand, celui qui saute le plus haut ou un compromis des deux) se place face √† son adversaire, derri√®re la ligne du milieu de terrain, en direction du panier o√π il doit attaquer. L\'arbitre lance alors la balle au-dessus des deux joueurs et ceux-ci doivent pousser le ballon avec la main pour qu\'un de leurs √©quipiers l\'attrape. C\'est √† ce moment-l√† que le match commence.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">√Ä l\'issue de la rencontre, l\'√©quipe ayant inscrit le plus de points remporte le match. En cas d\'√©galit√©, on joue alors cinq minutes de prolongation pour d√©partager les deux √©quipes, et ce quelle que soit la comp√©tition en cours. S\'il y a √† nouveau √©galit√© au terme de la prolongation, on rejoue une autre prolongation. Il n\'y a ainsi jamais de match nul au basket-ball (sauf en cas de phase finale aller/retour, o√π il peut y avoir match nul au match aller ou retour, le vainqueur se d√©cidant au cumul des points sur les deux matchs).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=QGGLH1EtA9Y\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=QGGLH1EtA9Y\n</div><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Exemples de Buzzer beater</span></figcaption></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'R√®glement', '', 'inherit', 'closed', 'closed', '', '78-revision-v1', '', '', '2020-04-30 17:22:51', '2020-04-30 15:22:51', '', 78, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/78-revision-v1/', 0, 'revision', '', 0),
