(93, 1, '2020-04-30 20:43:22', '2020-04-30 18:43:22', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Nouvelles r√®gles FIBA (2014)</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>√Ä partir du 1<sup>er</sup> octobre 2014, la FIBA modifie six r√®gles :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">dans le demi-cercle juste sous le panier, une ligne augmente la protection de l\'attaquant¬†;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">nouveau trac√© de ligne √† trois points et zone restrictive (raquette) au format NBA¬†;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">dans les deux derni√®res minutes, chaque √©quipe ne peut prendre qu\'un maximum de deux temps-morts¬†;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">sur un rebond offensif, l\'horloge des 24 secondes reprend √† 14 secondes¬†;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">en cas de faute d√©fensive alors qu\'il reste moins de 14 secondes de possession pour l\'√©quipe adverse, le chronom√®tre des tirs est aussi remis √† 14 secondes¬†;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">apr√®s une faute technique, un seul lancer franc est accord√©, plus la remise en jeu au milieu du terrain par l\'√©quipe non-sanctionn√©e ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">la seconde faute technique est disqualifiante.</span></li></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">R√®gles sp√©cifiques en NCAA</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">√Ä compter de la saison 2015-2016, la NCAA f√©minine se rapproche des r√®gles FIBA en passant aux quarts-temps de 10¬†minutes au lieu de deux mi-temps de 20¬†minutes, avec quatre temps-morts m√©dias au lieu de huit. La p√©nalit√© (deux lancers-francs, au lieu d\'un lancer-franc et un second si le premier est r√©ussi) s\'applique apr√®s la cinqui√®me faute d‚Äô√©quipe dans chaque p√©riode. La r√®gle des 10¬†secondes pour amener la balle en zone avant s\'applique strictement au lieu de repartir √† z√©ro en cas d\'arr√™t du jeu. Enfin, apr√®s un temps-mort d√©cid√© par l\'√©quipe ayant la possession de la balle, notamment apr√®s un panier encaiss√©, la remise en jeu est effectu√©e au milieu du terrain, ce qui favorise l\'√©quipe offensive. Toutefois, l\'√©quipe attaquante a toujours au plus 35 secondes pour tenter un tir. Quelques semaines plus tard, la NCAA masculine d√©cide d\'abandonner la r√®gle des 35¬†secondes pour passer √† 30 d√®s la saison 2015-2016.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">R√®gles sp√©cifiques en NBA</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les rencontres NBA se disputent en quatre p√©riodes de 12¬†minutes au lieu de 10 dans les r√®gles FIBA et l\'√©limination des joueurs est effective √† la sixi√®me faute. Les r√®gles diff√®rent d\'avec la FIBA sur des points secondaires, comme l\'interf√©rence¬†(en) (<em>goaltending</em>) pour laquelle il est interdit de toucher la balle alors qu\'elle est sur le cercle, contrairement aux dispositions de la FIBA. La r√®gle des trois¬†secondes en d√©fense interdit √† un joueur de rester plus de trois¬†secondes dans la raquette sans d√©fendre directement sur un attaquant, ce qui limite la d√©fense de zone. La dimension des terrains NBA est de 28,65 x 15,24¬†m√®tres contre 28 x 15¬†m√®tres pour la FIBA. Depuis la saison 2016-2017, afin d\'√©viter l\'abus du hack-a-player, si une faute intentionnelle est effectu√©e sur un joueur dans les deux derni√®res minutes d\'un quart-temps, un lancer-franc bonus est offert √† l\'√©quipe ayant subi le hack. Ce lancer-franc bonus peut-√™tre tir√© par n\'importe quel membre de l\'√©quipe pr√©sent sur le terrain.</span></p>\n<!-- /wp:paragraph -->', 'Quelques r√®gles suppl√©mentaires', '', 'publish', 'closed', 'closed', '', 'quelques-regles-supplementaires', '', '', '2020-04-30 20:43:23', '2020-04-30 18:43:23', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=93', 0, 'page', '', 0),
